','H','0.000','2018-10-15 00:00:00.0000000','PT00H00M00S','2018-10-19 00:00:00.0000000','PT00H00M00S','2018-10-15 00:00:00.0000000','PT00H00M00S','2018-10-19 00:00:00.0000000','PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S','2018-10-15 00:00:00.0000000','PT00H00M00S','2018-10-19 00:00:00.0000000','PT00H00M00S','0.0','1','','','','',NULL,NULL,'24212278','1004729617','','OR000024212278','');
