ISFARGING OSV.\n2. INSPISER ROTORSPOLENS AVSTøTNINGER, SKRUER, SKIVER OG ISOLASJON.\n3. SJEKK POLSKO FOR MISFARGING.\n\n   LAGER\n   -----\n1. INSPISER LAGERHUS FOR LEKKASJE, OG AT BOLTET SAMMENFøYNINGER ER\n   FORSVARLIG FESTET. SJEKK OGSå LAGERETS STYRESTøTTE\n   OG BæRE-ANORDNING.\n2. SJEKK AKSELTETNING FOR LEKKASJE.FORETA EVENTUELT\n   INNVENDIG RENGJØRING.\n3. INSPISER RøRSYSTEMET FOR OLJE OG OM MULIG LEKKASJE.\n4. FUNKSJONSSJEKK ALLE MåLEINSTRUMENTER.\n5. HVIS NøDVENDIG, SKIFT UT FILTERET FOR LUFTINNTAK TIL\n   LUFTSLUSEN (LUFTTRYKKSUTJEVNING) LOKALISERT På LAGERSTøTTEN.\n\n   PMG (PERMANENT MAGNETIC GENERATOR) INGEN åRLIG KONTROLL\n   ---\n\n   MAGNETISERINGSMASKIN (EXCITER) OG LIKERETTER\n   --------------------------------------------\n1. VISUELL INSPEKSJON AV MAGNETISERINGSMASKINENS ROTOR.\n2. VISUELL INSPEKSJON AV MAGNETISERINGSMASKINENS STATOR.\n\n   ROTORS JORDFEILBøRSTE\n   ---------------------\n1. VISUELL INSPEKSJON AV BøRSTE OG BøRSTEHOLDER. SKIFT UT\n   BøRSTEN HVIS DEN ER KORTERE ENN 15MM.\n2. SJEKK ROTORS JORDFEILVERN.\n3. VISUELL INSPEKSJON AV SLEPERING.\n\n   ROTOR JORDINGSBøRSTE\n\n   --------------------\n1. VISUELL INSPEKSJON AV BøRSTE OG BøRSTEHOLDER, SKIFT UT\n   BøRSTEN HVIS DEN ER KORTERE ENN 15MM.\n   ROTORS JORDFEILBøRSTE\n   ---------------------\n2. MåL OVERGANGSMOTSTAND MELLOM BøRSTE OG BøRSTEHOLDER.\n   500V DC MEGGER.\n\n   KJøLESYSTEM\n\n   -----------\n1. VISUELL INSPEKSJON AV KJøLERE.\n2. SJEKK OM SYSTEMET ER RENT, SJEKK OM KORROSJON,\n   EROSJON På LUFT- OG VANNSIDER.\n3. RENGJøR LUFT OG VANNSIDER MED BRUK AV BøRSTE OG KJEMISK RENSING.\n4. TRYKKTEST.\n5. FUNKSJONSSJEKK DETEKTOR (VANNFøLER) FOR LEKKASJE På KAPPE.\n\n   SPENNINGSREGULERING (AVR)\n   -------------------------\n1. KONTROLLER ALLE KOMPONENTER MED HENBLIKK På SPOR ETTER VARME-\n   UTVIKLING.\n2. KONTROLLER MAGNETISERINGSSTRøM-KONTAKTOR MED HENBLIKK På\n   BRENTE KONTAKTER.\n\n\nISOLASJONSMÅLING\n\n1. MåL ISOLASJONSMOTSTANDEN FOR STATORVIKLINGENE (5000V MEGGER)\n   MERK: FøR MEGGINGEN PåBEGYNNES SKAL 0-PUNKT KOBLINGEN åPNES.\n         SPENNINGSTRAFO SKUFFE I INNKOMMER-BRYTER åPNES.\n         BRYTER-JORDING åPNES. MEGG HVER FASE INKL. KABEL,\n         TIL JORD MED DE TO øVRIGE FASENE KORTSLUTTET MOT JORD.\n         MEGGING KAN FORETAS FRA 0-PUNKT KOBLINGSHUS.\n\n2. MåL ISOLASJONSMOTSTANDEN I ROTORVIKLINGENE FOR GENERATOR\n   OG HOVEDMAGNETISERINGSMASKINEN.\n   (BEGGE VIKLINGENE MåLES SAMTIDIG).(500V MEGGER).\n   MERK: FøR MEGGINGEN PåBEGYNNES SKAL DIODENE KORTSLUTTES\n         OG BøRSTEN FOR JORDFEILMåLING AV MAGNETISERINGSKRETSEN\n         TAS UT.MEGG MELLOM +/- POL TIL JORD.\n\n3. MåL ISOLASJONSMOTSTANDEN FOR STATORVIKLINGENE I HOVEDMAGNET-\n   ISERINGSENHETEN (500V MEGGER).\n   MERK: FøR MEGGINGEN PåBEGYNNES SKAL SPENNINGSREGULATOREN\n         (A.V.R.)FRAKOBLES, (KAN GJøRES VED å FRAKOBLE\n         LEDNINGER I TIL- KOBLINGSHUS MAGN.MASKIN)\n\n4. MåL ISOLASJONSMOTSTANDEN FOR STATORVIKLINGENE I PILOTMAGNET-\n   ISERINGSMASKIN (500V MEGGER).\n   MERK:\n   FøR MEGGINGEN PåBEGYNNES SKAL SPENNINGSREGULATOREN (A.V.R.)\n   FRAKOBLES. (KAN GJøRES VED å FRAKOBLE LEDNINGER\n   I TILKOBLINGSHUSMAGN.MASKIN.)\n\n\n6-åRLIG KONTROLL AV HOVEDGENERATOR\n\nEL0552\n\n   GENERATOR\n   ---------\n1. INSPISER STøPEMASSE MELLOM FUNDAMENT OG GENERATOR,\n   SJEKK OGSå FUNDAMENTBOLTER. SJEKK OM KLARINGEN\n   På BOLTENE ER KORREKT ELLER FOR STOR.\n   INSPISER OM FUNDAMENTET HAR SPREKKER.\n\n   STATOR\n   ------\n1. INSPISER AT VIKLINGER ER RENE OG AT DE IKKE ER MISFARGET,\n   SJEKK OGSå ISOLASJONENS TILSTAND, SLARK OG OM DET ER\n   BEVEGELSE ELLER SLITASJE.\n   RENGJøR OM NøDVENDIG.\n\n2. MåL POLARISERINGSINDEX\n\n3. FUNKSJONSSJEKK VARMEELEMENTER.\n\n   STATOR KOPLINGSHUS\n   ------------------\n1. SJEKK TILSKRUINGSMOMENTET På ALLE FORBINDELSER OG\n   ISOLASJONEN På BAKSIDEN AV KOPLINGSKLEMMENE.\n\n   ROTOR\n   -----\n1. SJEKK ALLE LODDEDE FORBINDELSER FOR SPREKKDANNELSER.\n\n2. SJEKK VIKLINGSFORBINDELSER.\n\n3. SJEKK VIKLINGSISOLASJONEN MED SPENNINGSFALLTEST.\n   TESTEN UTFØRES MED Å TILFØRE EN VEKSELSPENNING. MÅL STRØM OG\n   SPENNINGSFALL OVER HELE ROTORVIKLINGEN OG OVER HVER\n   ENKELT SPOLE. TILFØRT SPENNING SKAL VÆRE 380V 50 HZ,\n   ELLER 440 V 60 HZ AVHENGIG AV NOMINELL FREKVENS\n\n4. SJEKK ISOLASJONSPLATEN FOR ROTORS øVRE VIKLINGSFESTE MAX.\n   BEVEGELSE, 10MM UT AV ORGINAL INNSTILLING.\n\n5. INSPISER VIFTEBLADER OG SVEISER.\n\n6.INSPISER BALANSEVEKT OG FESTEDETALJER.\n\n   LAGRER\n   ------\n1. LAGRENE åPNES FOR INSPEKSJON. LAGRENE MÅLES FOR SLITASJE.\n\n2. RENGJøR DRENERINGSHULL I AKSELTETNING. KONTROLLER AT\n   TETNINGS-OVERFLATER ER FRI FOR KORROSJON OG SLITASJE.\n\n3. VISUELL INSPEKSJON AV KONTAKTFLATEN På LAGERFORINGER.\n\n4. MåL ISOLASJONSMOTSTAND På LAGRER.\n\n5. ANALYSER SMøREOLJEN FOR FORURENSING, SKIFT UT OLJEN OG\n   RENGJøR SYSTEMET HVIS NøDVENDIG.\n      PMG (PERMANENT MAGNETIC GENERATOR)\n   ----------------------------------\n\n1. VISUELL INSPEKSJON AV PMG-STATOR.\n\n2. VISUELL INSPEKSJON AV PMG-ROTOR.\n\n3. SJEKK LUFTSPALTE.\n\n   MAGNETISERINGSMASKIN (EXCITER) OG LIKERETTER\n   --------------------------------------------\n1. DIODER, THYRISTORER OG RC-KRETS (LIKERETTER). UTFøR HOVED-\n   RENGJøRING, SJEKK ALLE BOLTEFESTER OG TA INVERSE SPENNINGS-\n   TEST.\n\n2. SJEKK LUFTSPALTE.\n\n3. FUNKSJONSSJEKK FARMEELEMENT\n\n\nFØLGENDE UTFØRES HVERT 12.ÅR:\n\nROTOR\n-----\n1. INSPISER BOLTENE VED å BANKE På BOLTEHODE. HVIS BOLTENE\n   ER LøSE ELLER KORRODERT SKAL DE SKIFTES UT.\n\n2. SJEKK LUFTSPALTE ETTER MONTERING AV MASKINEN.\n\n','','1001','700','3.05.02',NULL,NULL,'1','H4','0016957704','00000000','1003889402','00010','Oseberg Sør offshore','36.0','H',' ',' ','36.0','H','0.000','2018-10-09 07:00:00.0000000','PT07H00M00S','2018-10-12 16:00:00.0000000','PT16H00M00S','2018-10-09 07:00:00.0000000','PT07H00M00S','2018-10-12 16:00:00.0000000','PT16H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','20