insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004904675','OV100490467500000001','00000001',' ','1210','','PM01','','10008254','IMOMECTM','','','12M Termografi - inspeksjon elektro','12M Termografi - inspeksjon elektro\n\n\nTermografi av elektrisk utstyr.\n\nEL0513\n\nTermografi av elektrisk utstyr.\n\nHensikt:\n\nTermografi av elektrisk utstyr skal foregå som en del av det\nforebyggende vedlikehold. Hensikten med termografi er å\nforebygge og avdekke feil på et tidlig tidspunkt slik at\nalvorlige feil kan unngåes. På denne måten kan en avverge\nnedstengning av utstyr, svikt av krafttilførsel, produksjonstap\nog store følgeskader.\n\nPlanlegging:\n\nDet er viktig med en god planlegging av termografiarbeidet.\nForskrift om sikkerhet ved arbeid i og drift av elektriske\nanlegg, FSH må følges. Alle tag som skal termograferes\nlistes i "object list"\n\nIntervaller:\n\nI utgangspunktet utføres termografi årlig. Det må vurderes om\ndet er hensiktsmessig å dele anlegget i to da det kan være\nvanskelig å få tilkomst til alt utstyr samtidig Intervallene må\nimidlertid vurderes kontinuerlig på bakgrunn av de observasjoner\nog erfaringer som gjøres.\n\nGjennomføring av termografi:\n\nDet er viktig å ha normallast på utstyr når det termograferes.\nTermografi av høyspenning skal bare gjennomføres gjennom\ntermografivindu.\n\nForekommer det avvik på inngangsbrytere i lavspenningstavler\nmå det vurderes å legge all last over på den side som har avvik\nog ta ny måling. Det samme gjelder for transformatorer som mater\ntavlene.','','','','',NULL,NULL,'1','H4','0017186750','00000000','','00000','','42.0','H',' ',' ','42.0','H','0.000','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24385332','1004904675','','OR000024385332','1766-TERMOGRAFI');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004904675','OV100490467500000002','00000002',' ','1215','','PM01','','10008254','IMOMECTM','','','12M Termografi - inspeksjon Automasjon','12M Termografi - inspeksjon Automasjon\n\n\n\n\nTERMOGRAFI AV ELEKTRISK UTSTYR\n\nOS0047\n\nHensikt:\n\nTermografi av elektrisk utstyr skal foregå som en del av det\nforebyggende vedlikehold på Oseberg Sør.\nHensikten med termografi er å forebygge og avdekke feil på et\ntidlig tidspunkt slik at alvorlige feil kan unngåes.\nPå denne måten kan en avverge nedstengning av utstyr  svikt i\nkrafttilførsel  produksjonstap og store følgeskader.\n\nPlanlegging:\n\nDet er viktig med god planlegging av termografiarbeidet.\nForskrifter for El. anlegg  FSL og FSH må alltid følges.\nAlle tag som skal termograferes listes i "Object list".\n\nDet bør alltid være en elektriker med under termografering  hans\nviktigste oppgave er å påse at sikkerheten ivaretaes. Elektriker\nskal fjerne pleksiglassplater  deksler etc. for nødvendig tilkomst.\nHan skal videre påse at det benyttes personlig verneutsyr  vurdere\nbehov for avskjerming/avsperring ihht.FSH og FSL. I tillegg\nutføres det som kan utføres der og da. Dersom det oppdages avvik\nsom ikke kan rettes på stedet lages aktiviteter i SAP for\nutbedring.\n\nIntervaller:\n\nI utgangspunktet utføre termografi årlig. Det må vurderes om det\ner hensiktsmessig å dele anlegget i to  da det kan være vanskelig\nå få tilkomst til alt utstyr samtidig  utkall vil da bli 6 mnd.\nIntervallene må midlertid vurderes kontinuerlig på bakgrunn av de\nobservasjoner og erfaringer som gjøres.\n\nUtstyr som skal termograferes.\n\nHoved og nødgeneratorer. (Kabeltilkoblinger).\n\nHøyspenningstransformatorer.\n- Primær og sekundær side\n- Tilkoblinger for 0-punkt.\n\nTavler for nødgeneratorer\nFrekvensomformere for brannpumper\n\n690 volts tavler og fordelinger.\n\n690/400 volt transformatorer\n- Primær og sekundær side\n- Tilkoblinger for 0-punkt.\n\nSCR.MUD DRILL OG SCR DRILL TAVLER 690 volt.\n\n- Samleskinneforbindelser\n- Samleskinner på brytervogn samt bryter\n- Kabel og kontrollutrustning i lavspenningsfelt\n- Styrte likerettere knyttet til tavlene\n\nVSD for oil export & "Utsira"\n\n- Samleskinneforbindelser\n- Samleskinner på brytervogn samt bryter\n- Kabel og kontrollutrustning i lavspenningsfelt\n- Likerettere på innkommer\n- Vekselrettere med transformatorer knyttet til avganger på tavle\n- Transformatorer for Utsirapumper\n\n400 volts tavler og fordelinger\n\n230 volts fordelinger\n\nBatteriladere og likeretterskap med fordelinger.\n\nBatteribank for nødgeneratorer  brannpumper etc. Utføres under\nutladetest.\n\nAlle UPS''er med tilhørende batteribanker.\n\nGjennomføring av termografi.\nDet er viktig å ha normallast på utstyret når vi termograferer.\nTermografi av høyspenning skal bare gjennomføres gjennom termografi-\nvindu.\n\nForekommer det avvik på inngangsbrytere på 690 eller 400 volt tavler\nmå det vurderes å legge all last på den side som har avvik og ta ny\nmåling. Det samme gjelder for transformatorer som mater tavlene.\n\nTermografering av høyspenningstavler og 690 volts tavler.\nAlle kabelavganger skal termograferes og betingelsen er at\nutstyret er i drift. Utstyr som ikke er i drift må man forsøke å\nfå i-driftsatt og termografi utføres etter at utstyret har nådd\ndriftstemperatur.\nUtstyr som ikke kan idriftsettes under termografering registreres\npå KV jobb for å utføres på neste utkall.\n\n\n\n\nSN0400-0004 <H>Termografi lavspenning</>\n\nAnlegget termograferes med normal belastning eller høyere for å\navdekke begynnende eller faktiske feil.\n\nDet er lagt til grunn at det ikke skal åpnes kapslinger,\navskjerminger eller på annen måte operere utstyr ut over det som\nleverandøren av utstyret anbefaler som sikker betjening.\n\nTabellen under viser omfang av, og metode for, utførelse av\ntermografi av elektrisk utstyr i tavler/switchboard.\n\n400/440/660/690V TAVLER\n\n1. Kabelfelt\n   - Termograferes med åpen dør.\n\n2. Styrestrømsfelt\n   - Termograferes med åpen dør.\n     Plexiglass/tildekning som er tilrettelagt for fjerning i\n     forbindelse med termografering kan tas av.\n\n3. Styrestrømstrafo\n   - Termograferes med åpen dør.\n\n4. Samleskinne\n   - Samleskinneskjøter termograferes gjennom inspeksjonsvindu\n     eller der det er tilrettelagt for tilkomst.\n\n5. Avganger\n   - Termograferes ved mistanke om feil eller unormal tilstand\n     basert på utvendig overflatetemperatur, måling i\n     kabelfelt, lyd eller lignende. (Måle restvarme i\n     spenningsløs tilstand dersom sikker tilkomst ikke er mulig)\n\n230/400V OG UPS-FORDELINGER\n\n1. Sikringer, rekkeklemmer, jordfeilbrytere m.m.\n   - Termograferes med åpen dør.\n     Plexiglass/tildekning som er tilrettelagt for fjerning i\n     forbindelse med termografering kan tas av\n\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017186751','00000000','','00000','','42.0','H',' ',' ','42.0','H','0.000','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24385332','1004904675','','OR000024385332','1766-TERMOGRAFI');
