ERES.\n\n','','','','',NULL,NULL,'1','H4','0017186752','00000000','','00000','','9.0','H',' ',' ','9.0','H','0.000','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24385333','1004904676','','OR000024385333','1766-TERMOGRAFI');
