emperaturer!\n*  Måling på områder som ikke er tilgjengelig\n   -  IR- og digitalbilde, ved temperaturer over 200 grader C\n      må funn spesifiseres i repporten med referanse til\n      GA-tegning.\n\nRapportering:\n\n*  Rapport skal inneholde tidligere nevnte faktorer og\n   forutsetninger.\n*  Rapporten skal sendes D<(>&<)>V-leder på aktuell installasjon, som\n   har ansvar for eventuelle korrigerende tiltak.\n*  Kopi skal sendes Inspeksjonsavdeling og Teknisk Sikkerhets-\n   ansvarlig for aktuell installasjon.\n*  I tillegg skal rapporten legges inn på aktuell AO.\n\n\n\n\n\n\n\n\n','','','','',NULL,NULL,'1','H4','0017186758','00000000','','00000','','12.0','H',' ',' ','12.0','H','0.000','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24385334','1004904677','','OR000024385334','1766-TERMOGRAFI');
