e - OBS på høye temperaturer!\n- Måling på områder som ikke er tilgjengelig\n    - IR- og digitalbilde, ved temperaturer over 200 grader C\n      må funn spesifiseres i rapporten med referanse til\n      GA-tegning.\n\nRAPPORTERING\n- Rapport skal inneholde tidligere nevnte faktorer og\n  forutsetninger.\n- Rapporten skal sendes Drift og Vedlikeholds-leder på aktuell\n  installasjon, som har ansvar for eventuelle korrigerende\n  tiltak.\n- Kopi skal sendes Inspeksjonsavdeling og Teknisk Sikkerhets-\n  ansvarlig for aktuell installasjon.\n- I tillegg skal rapporten legges inn på aktuell AO.\n\n<H>-----------------------------------------------------------------</>\n\n\nForutsetninger:\n\n-  Eksoskanal må ha vært i normal drift i minimum 2 timer\n-  Noter værforhold, vidstyrke og- retning, samt temperatur\n-  Kartlegge status på nærliggende objekt som kan ha\n   betydning for resultatet (stråling fra nærliggende kanaler).\n   Ved repeterende inspeksjoner  må man ha like driftsforhold\n   fra gang til gang.  Eventuelle avvik må komme  fram i\n   rapporten.\n\nFysiske forhold:\n\n-  Kanalen må inndeles i områder som er tilgjengelige og kan\n   måles med kontakttermometer, og områder som ikke er\n   tilgjengelig og krever stillas dersom man skal måle med\n   kontakt termometer.  Dette må komme tydelig fram\n   i rapporten.\n\n*  Det skal tas både IR-og digitalbilde av de valgte områdene,\n   ref. GA-tegning.\n*  Avstand til objekt skal oppgis i rapporten for hvert enkel\n   måling.\n*  Måling på tilgjengelige områder:\n    -  IR- og digitalbilde, ved temperaturer over 200 grader C\n      skal det  utføres måling med  kontakttermometer.\n   -  Ved funn skal aktuelle områder merkes (med eksempelvis\n     Jotatemp 650) og spesifiseres  i rapporten med\n     referanse til GA-tegning.\n  -  Personbeskyttelse - OBS på høye temperaturer!\n*  Måling på områder som ikke er tilgjengelig\n   -  IR- og digitalbilde, ved temperaturer over 200 grader C\n      må funn spesifiseres i repporten med referanse til\n      GA-tegning.\n\nRapportering:\n\n*  Rapport skal inneholde tidligere nevnte faktorer og\n   forutsetninger.\n*  Rapporten skal sendes D<(>&<)>V-leder på aktuell installasjon, som\n   har ansvar for eventuelle korrigerende tiltak.\n*  Kopi skal sendes Inspeksjonsavdeling og Teknisk Sikkerhets-\n   ansvarlig for aktuell installasjon.\n*  I tillegg skal rapporten legges inn på aktuell AO.\n\n\n\n\n\n\n\n\n','','','','',NULL,NULL,'1','H4','0017186760','00000000','','00000','','12.0','H',' ',' ','12.0','H','0.000','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S','2018-10-16 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24385334','1004904677','','OR000024385334','1766-TERMOGRAFI');
