insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004904836','OV100490483600000002','00000002','9','2420','Operation Finally Confirmed (CNF)','PM01','','10007513','POMMEC','','','24M - Overhale PSV 651013','24M - Overhale PSV 651013\n\nVA1206-0001 <H>Utskiftning og sertifisering av forbruksventil</>\n\nFORMÅL\n- Verifisere gjennom testing at demontert ventil ville kunne\n  fungere som en barriere innenfor de angitte akseptkriteriene\n- Foreta sertifiseringstest av ny ventil\n\nTEST AV DEMONTERT VENTIL\nForurensinger og avleiringer som kan påvirke testresultatet skal\nikke fjernes fra demontert ventil før test.\n\nTest skal utføres i godkjent testbenk.\n\nTestmedium:\nVentiler som står i gass eller kondenserende service skal testes\nmed gass (luft/N2). Ventiler som står i væske service bør testes\nmed væske (vann), men kan testes med gass (luft/N2).\n\nFølgende punkter skal utføres:\n1. Registrer serienummer. Dersom ventilen ikke har serienummer\n   registreres ventilens modelltypenummer.\n2. Les av eventuell intern lekkasje ved 90% settrykk.\n3. Les av åpningstrykk.\n4. Registrer om ventilen stenger og ved hvilket trykk.\n\nAkseptkriterier:\nVentilen åpner innenfor +/- 5% av kaldt settpunkt («grønn»\ntest).\n\nDersom ventilen åpner innenfor +20% og mindre enn 50 barg av\nkaldt settpunkt under første test, er dette ansett som en\n«gul» test og er ikke definert som svikt.\n\nAkseptkriteriet for lekkasjetest er angitt i API 527.\n\nSVIKTDEFINISJON\nDersom åpningstrykk overstiger kaldt settpunkt med 20% eller\nmaksimalt 50 barg betraktes dette som "svikt".\n\n5. Kasser brukt ventil.\n6. Registrer serienummer til ny ventil i sertifikat.\n\nSERTIFISERINGSTEST AV NY VENTIL\nToleransekravet for settpunkt er +/- 3%.\n\n7. Juster blowdownring iht. leverandørens tabell.\n8. Les av eventuell intern lekkasje ved 90 % settrykk, og\n   kontroller at eventuell lekkasje ikke er større en\n   akseptkriteriet.\n9. Les av åpningstrykk.\n10. Baktrykk test: Trykksett utløp med 5 barg (eller det\n    trykket en eventuell belg er designet for) og hold trykket\n    i 1 minutt.\n11. Sjekk alle potensielle lekkasjekilder for eksternlekkasje\n    vha. såpevask/leak detector.\n12. Ventiler med belg sjekkes for lekkasje over belg.\n13. Utform rustfritt merkeskilt med følgende informasjon:\n    - Tag-nummer\n    - Settrykk\n    - Sertifiseringsdato\n14. Plomber justeringsskruen for settrykk og blowdownring.\n15. Plomber manuell utløser dersom denne er montert.\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017187357','00000002','','00000','','4.0','H',' ',' ','4.0','H','4.000','2018-10-10 08:00:00.0000000','PT08H00M00S','2018-10-10 11:42:13.0000000','PT11H42M13S','2018-10-09 15:17:47.0000000','PT15H17M47S','2018-10-09 19:00:00.0000000','PT19H00M00S','2018-10-07 18:40:56.0000000','PT18H40M56S','2018-10-07 18:43:06.0000000','PT18H43M06S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','4.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24385493','1004904836','10772184','OR000024385493','1766-PSV -65-1013');
