insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004957997','OV100495799700000001','00000001','9','1210','Operation Finally Confirmed (CNF)','PM01','','10007387','E00SPE','','','12M-Kontroll for fallende gjenstander','12M-Kontroll for fallende gjenstander\n\n\nVed hjelp av tilkomstteknikk skal det kontrolleres for fallende\ngjenstander Dvs. løst utstyr (lysarmaturer,radiopisker,etc.)<(>,<)>\nplater (lydplater, fasadeplater etc), gjenglemt verktøy<(>,<)>\netc, med potensiale for fall over 2m.\n\nVær spesielt oppmerksom på løsninger med pop-nagler og ensidige\nskrueforforbindelser.\n\nDersom det gjøres funn, skal objektene sikres, evt demonteres og\nfjernesetter avklaring med plattform.\n\nFunn som krever tiltak i etterkant, jobbsettes av plattformen.\nKlatrelag vil lage rapport inkl bilder og plassering av alle funn som\nkrever utbedring.\n\nKontrollen gjelder i utgangspunktet alle områder på plattformen, med\nunntak av de områder hvor boring har tilsvarende inspeksjon.\nMalen kan fokuseres/reduseres dersom ønskelig for ivareta spesifikke\ninstallasjonsbehov, og historikk fra tidligere fallende gjenstand\ninspeksjoner.\n\nM5 opprettes dersom det ønskes forandringer i malen mht omfang og/eller\nintervall.\n\nAnsvarlig for malen er plattform/operasjonsgruppe.\nFor bestilling av klatrelag referes det til rammeavtale med BOM, ref\nrammeavtalenr 4600011867 evt 2001246.\n\n2 stk tilleggs tjenester kan inngå i leverensen utover inspeksjon for\nfallende gjenstander. Det er forbedringsurvey og opplæring for å\nidentifisere fallende gjenstander.\n','','1001','700','',NULL,NULL,'1','H4','0017372685','00000001','','00000','','168.0','H',' ',' ','504.0','H','0.000','2018-10-01 15:45:41.0000000','PT15H45M41S','2018-10-19 09:45:41.0000000','PT09H45M41S','2018-10-01 15:45:41.0000000','PT15H45M41S','2018-10-19 09:45:41.0000000','PT09H45M41S','2018-10-04 11:31:52.0000000','PT11H31M52S','2018-10-04 11:31:52.0000000','PT11H31M52S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010154','2018-09-14 00:00:00.0000000','2018-10-04 00:00:00.0000000','24437655','1004957997','11436473','OR000024437655','1766-T00');
