insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004965759','OV100496575900000001','00000001',' ','0010','','PM01','','10007530','POMPRO','','','12M Pigging av K-linje','12M Pigging av K-linje\n\nPIGGEOPERASJON K-LINJE ,,\n ,,\nFORBEREDELSER (noen dager i forveien) ,,\n- Sjekk at antall pigger er kommet om bord + teknisk status ,,\n- Sjekk at vi har nok Biocid om bord event. bestill ny for\n          refylling ,,\n- Sjekk at vi har tilstrekkelig værneutstyr for personell ,,\n- Sjekk at vi rengjørings matriell om bord,,\n- Test ventiler og låsmekanisme på avsender og mottakersluse,,\n ,,\nFORAKTIVITET,,\n- Prejobb møte ,,\n ,,\nSTART PIGGEOPERASJON,,\n- Start metanolinjeksjon i linje 2-3t før nedkjøring,,\n- Nedkjøring av K-linje iht. Arbeidsbeskrivelse L-OSS-15658 ,,\n- Etabler metanol i K-11 og K-13,,\n- K-linje legges mot testseparator og trykkavlastes til 12 bar,,\n- Test av lekkasjerate på WI choke topside,,\n- WI -brønner på K-linje stenges ned ,,\n- Foreta trykkutligning mellom vanninjeksjon og oljeprod. K-linje\n(L-OSS-15658),,\n- Steng vanninjeksjon til plattformbrønner F-21 og F-31 -\nInjeksjon kjøres til F06 og F16,,\n- Åpne piggeventil HV-18-4008,,\n- K-linje oljeside fortrenges med vann til det kommer rent vann på\ntestseparator (max trykk på template 40barg),,\n\nPIGGEAKTIVITET NR 1,,\n- Klargjør motagersluse L-OSS-15634,,\n- Innlaste måle PIG 1 enkel modul  Bypass pigg (BI-DI),,\n- Etabler flow 175m3/h tilsvarende 1,29 m/sek (reduser flow til ca\n100m3/h ved mottak,,\n- Sende målepig nr 1  (BI-DI pig),,\n- Løpetid pig nr 1.  (6t),,\n- Laste inn rensepig nr 2 Dobbel modul børstepig,,\n- Klargjør for mottak av målepig nr 1,,\n- Observer om det kommer mye drit på prøvepunkt,,\n- Åpne mottaker sluse og ta ut målepig nr 1,,\n\nPIGGEAKTIVITET NR 2,,\n- Etabler flow 175m3/h tilsvarende 1,35 m/sek (reduser flow til ca\n100m3/h ved mottak),,\n- Start biocid kjøring  150 l/t time ,,\n- Sende rensepig nr 2 Dobbel modul børstepig ,,\n- Løpetid pig nr 2, ,,\n- Klargjør for mottak av rensepig nr 2 ,,\n- Observer om det kommer mye drit på prøvepunkt ,,\n- Åpne mottaker sluse og ta ut rensepig  nr 2,,\n- Ut fra en vurdering om hvor mye drit som kommer tilbake vurder å sende\nrensepig nr 3 Dobbel modul rensepig.,,\n\nPIGGEAKTIVITET NR 3,,\n- Bruk samme kjøre kriterier som for rensepig 2,,\n ,,\nETTERAKTIVITET,,\n- Info til OSF om forestående oppstart (m/metanol),,\n- Lekkasjetest Piggeventil K-linje,,\n- Klargjøring og oppkjøring av K-linje.  Utføres iht. L-OSS-- 15658/\nL-OSS-15634,,\n- Åpne opp WI-brønn K-linje + F-21 og F-31, ,,\n- Juster inn WI-brønner iht plan,,\n- Opprydding/vasking av pigsluseområde. Retur av pigger til base ,,\n- Oppdater/ferdigmeld WO,,\n','','','','',NULL,NULL,'1','H4','0017398967','00000000','','00000','','24.0','H',' ',' ','72.0','H','0.000','2018-10-25 00:00:00.0000000','PT00H00M00S','2018-11-10 00:00:00.0000000','PT00H00M00S','2018-10-25 00:00:00.0000000','PT00H00M00S','2018-11-10 00:00:00.0000000','PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24445236','1004965759','','OR000024445236','1766-S1801');
