insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004970705','OV100497070500000002','00000002','9','1201','Operation Finally Confirmed (CNF)','PM01','','10007465','POMAUT','','','12M Funksjonstest gassdetektor(P1101)','12M Funksjonstest gassdetektor(P1101)\n\nDD0200-0006 <H>Funksjonstest B<(>&<)>G</>\n\nFORMÅL\nVerifisere at Brann & Gass-logikk mottar alarmsignal fra\ndetektor gjennom fysisk eksponering av detektor for å avdekke\neventuelle skjulte feil, og at korrekt visning gis på\nalarm-/statuspanel (SKR samt andre relevante lokasjoner).\n\nAlle signalgivere, detektorer (innganger) skal testes.\n\nUTFØRELSE:\n1. For å avdekke udetekterbare feil testes systemet i\n   nåtilstand, det vil si før eventuell kalibrering og\n   rengjøring.\n2. Fastmontert utstyr (deksler, værbeskyttelse o.l.), som kan\n   være opphav til feilkilder, skal ikke demonteres under test.\n3. Inspiser feltutstyr visuelt. Sjekk forhold som dekningsområde\n   (retning og vinkel), mulig tildekning, ytre tilsmussing<(>,<)>\n   merking, skilting, innfesting, kabelinnføring, etc.\n4. Utfør fysisk eksponering (f.eks. gass, lys/magnet, varme<(>,<)>\n   røyk) av alle aktuelle signalgivere og detektorer.\n   Alle alarmnivåer aktiveres.\n5. Verifiser korrekt visning av signalgivers lokasjon og status\n   på operatørstasjon og alarmlister i sentralt kontrollrom.\n6. Verifiser at signalgiver opererer innenfor anleggets\n   definerte responstid.\n7. Verifiser at eksterne alarm-/aksjonspanel fungerer korrekt.\n\nTILBAKESTILLE ETTER TEST:\n8. Før tilbakestilling verifiseres det med kontrollrom at det\n   ikke er andre som benytter samme overbroinger og utkoblinger.\n9. Prosessverdier må være innenfor normalt område og alarmer\n   kvittert før Brann & Gass-systemet tilbakestilles.\n\nSVIKTDEFINISJON:\n- For flammedetektor, røykdetektor, varmedetektor og\n  manuelle meldere:\n  Dersom Brann & Gass-logikk ikke mottar alarmsignal ved bruk\n  av foreskrevet testmetode.\n- For gassdetektorer (IR, katalytisk, elektrokjemisk, akustisk):\n  Dersom Brann & Gass-logikk ikke mottar signal tilsvarende\n  øvre alarmgrense ved bruk av foreskrevet testmetode.\n\n<H>-----------------------------------------------------------------</>\n\nFunksjonstest - Responstid\n\nAkseptabel responstid for flamme. gass. røyk.varme detektorer er 10\nsekunder. Akseptabel responstid for manuelle meldere er 5 sekunder\n\nAlle responstider skal tilbakemeldes\n\n\nM2 Notifikasjon meldes på følgende mate:\n\nFunctionLocation    : TAG for brannmelder\nDetect Mthd         : 2   - ''ISO Functional testing''\nFailure Mode        : BRD - ''CST Breakdown''\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker under\n''Activity''-mappen på den same M2-notifikasjonen','','','','',NULL,NULL,'1','H4','0017409571','00000002','','00000','','3.0','H',' ',' ','3.0','H','4.000','2018-10-06 15:00:00.0000000','PT15H00M00S','2018-10-06 19:00:00.0000000','PT19H00M00S','2018-10-06 15:00:00.0000000','PT15H00M00S','2018-10-06 19:00:00.0000000','PT19H00M00S','2018-10-08 08:57:36.0000000','PT08H57M36S','2018-10-08 08:58:15.0000000','PT08H58M15S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','4.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24450202','1004970705','','OR000024450202','1766-D7005');
