,' ','10.0','H','0.000','2018-10-12 13:00:00.0000000','PT13H00M00S','2018-10-13 11:00:00.0000000','PT11H00M00S','2018-10-12 13:00:00.0000000','PT13H00M00S','2018-10-13 11:00:00.0000000','PT11H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24450205','1004970708','','OR000024450205','1766-D7005');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004970709','OV100497070900000001','00000001','9','2400','Operation Finally Confirmed (CNF)','PM01','','10007465','POMAUT','','','24M EX, DETALJERT INSPEKSJON','24M EX, DETALJERT INSPEKSJON\n\nTI0720-0003 <H>Ex, detaljert inspeksjon</>\n\nUtfør Ex detaljert inspeksjon.\n\nDEFINISJON AV DETALJERT INSPEKSJON:\n\nEn inspeksjon som avdekker feil som synliggjøres kun ved åpning\nav kapsling.\nFormålet med denne inspeksjonen er å avdekke om det er spesielle\nutstyrsvarianter eller miljøforhold som medvirker til uønsket\ndegradering av utstyr m/kapsling. Det anbefales derfor at utvalg\nav utstyr som skal kontrolleres baserer seg på plassering med\ntanke på omgivelser/miljø som vær, vibrasjon, temperatur, støv\nog smuss.\n\nOMFANG AV DETALJERT INSPEKSJON:\n\nDetaljert inspeksjon skal utføres på et prosentvis utvalg\nog kommer i tillegg til nærvisuell inspeksjon. Ved\nfunn/mistanke om feil skal det utføres ytterligere detaljert\ninspeksjon.\n\nEx-i: For utstyr i egensikker utførelse(Exi),utføres detaljert\ninspeksjon kun ved mistanke om mangler/feil avdekket ved\nutvendig inspeksjon.\n\n\nFor utfyllende informasjon, se dokument i SAP.\nTransaksjon i SAP: CV04N\nDokument:          1955874\n\n\n<H>-----------------------------------------------------------------</>\n\nTI0750-0003 <H>Ex, detaljert inspeksjon</>\n\nUtfør Ex detaljert inspeksjon.\n\nDEFINISJON AV DETALJERT INSPEKSJON:\n\nEn inspeksjon som avdekker feil som synliggjøres kun ved åpning\nav kapsling.\nFormålet med denne inspeksjonen er å avdekke om det er spesielle\nutstyrsvarianter eller miljøforhold som medvirker til uønsket\ndegradering av utstyr m/kapsling. Det anbefales derfor at utvalg\nav utstyr som skal kontrolleres baserer seg på plassering med\ntanke på omgivelser/miljø som vær, vibrasjon, temperatur, støv\nog smuss.\n\nOMFANG AV DETALJERT INSPEKSJON:\n\nDetaljert inspeksjon skal utføres på et prosentvis utvalg\nog kommer i tillegg til nærvisuell inspeksjon. Ved\nfunn/mistanke om feil skal det utføres ytterligere detaljert\ninspeksjon.\n\nEx-i: For utstyr i egensikker utførelse(Exi),utføres detaljert\ninspeksjon kun ved mistanke om mangler/feil avdekket ved\nutvendig inspeksjon.\n\n\nFor utfyllende informasjon, se dokument i SAP.\nTransaksjon i SAP: CV04N\nDokument:          1955874\n\n\n<H>-----------------------------------------------------------------</>\n\nTI0760-0003 <H>Ex, detaljert inspeksjon</>\n\nUtfør Ex detaljert inspeksjon.\n\nDEFINISJON AV DETALJERT INSPEKSJON:\n\nEn inspeksjon som avdekker feil som synliggjøres kun ved åpning\nav kapsling.\nFormålet med denne inspeksjonen er å avdekke om det er spesielle\nutstyrsvarianter eller miljøforhold som medvirker til uønsket\ndegradering av utstyr m/kapsling. Det anbefales derfor at utvalg\nav utstyr som skal kontrolleres baserer seg på plassering med\ntanke på omgivelser/miljø som vær, vibrasjon, temperatur, støv\nog smuss.\n\nOMFANG AV DETALJERT INSPEKSJON:\n\nDetaljert inspeksjon skal utføres på et prosentvis utvalg\nog kommer i tillegg til nærvisuell inspeksjon. Ved\nfunn/mistanke om feil skal det utføres ytterligere detaljert\ninspeksjon.\n\nEx-i: For utstyr i egensikker utførelse(Exi),utføres detaljert\ninspeksjon kun ved mistanke om mangler/feil avdekket ved\nutvendig inspeksjon.\n\n\nFor utfyllende informasjon, se dokument i SAP.\nTransaksjon i SAP: CV04N\nDokument:          1955874\n\n\n<H>-----------------------------------------------------------------</>\n\nTI0830-0003 <H>Ex, detaljert inspeksjon</>\n\nUtfør Ex detaljert inspeksjon.\n\nDEFINISJON AV DETALJERT INSPEKSJON:\n\nEn inspeksjon som avdekker feil som synliggjøres kun ved åpning\nav kapsling.\nFormålet med denne inspeksjonen er å avdekke om det er spesielle\nutstyrsvarianter eller miljøforhold som medvirker til uønsket\ndegradering av utstyr m/kapsling. Det anbefales derfor at utvalg\nav utstyr som skal kontrolleres baserer seg på plassering med\ntanke på omgivelser/miljø som vær, vibrasjon, temperatur, støv\nog smuss.\n\nOMFANG AV DETALJERT INSPEKSJON:\n\nDetaljert inspeksjon skal utføres på et prosentvis utvalg\nog kommer i tillegg til nærvisuell inspeksjon. Ved\nfunn/mistanke om feil skal det utføres ytterligere detaljert\ninspeksjon.\n\nEx-i: For utstyr i egensikker utførelse(Exi),utføres detaljert\ninspeksjon kun ved mistanke om mangler/feil avdekket ved\nutvendig inspeksjon.\n\n\nFor utfyllende informasjon, se dokument i SAP.\nTransaksjon i SAP: CV04N\nDokument:          1955874\n\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017409587','00000002','','00000','','4.0','H',' ',' ','4.0','H','7.000','2018-10-18 11:00:00.0000000','PT11H00M00S','2018-10-18 15:00:00.0000000','PT15H00M00S','2018-10-18 11:00:00.0000000','PT11H00M00S','2018-10-18 15:00:00.0000000','PT15H00M00S','2018-10-07 17:31:31.0000000','PT17H31M31S','2018-10-07 17:39:51.0000000','PT17H39M51S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','7.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24450206','1004970709','','OR000024450206','1766-C12');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004970709','OV100497070900000002','00000002','9','0600','Operation Finally Confirmed (CNF)','PM01','','10007465','POMAUT','','','06M OMRÅDEKONTROLL, FELTINSTRUMENT','06M OMRÅDEKONTROLL, FELTINSTRUMENT\n\nVed Nærvisuell kontroll av feltinstrument skal utstyr i det skisserte\nområdet kontrolleres. Dette inkluderer alle konsepter i det skisserte\nområdet.\nKan gjelde følgende utstyr : Transmitter, bryter, push-buttons,\nindikator, analysator, prober osv.\n\n\nVed visuell kontroll av tubing, og prosesstilkoblinger skal HC førende\nsystemer primært kontrolleres.\n\n\nTI0720-0001 <H>Nærvisuell kontroll - Feltinstrumentering</>\n\nKontroller:\n- Mekanisk tilstand/supportering\n- At alle deksler og kabelinnføringer er tilskrudd\n- At tagskilt/merkeskilt er montert og leselig\n- Prosesstilkobling og uisolert instrumenttubing for;\n    - mekaniske skader\n    - lekkasjer (vurder bruk av gassmåler)\n    - korrosjonsskader (spot sjekk under tubingklammer)\n    - korrosjon (pitting på tubing)\n    - supportering/vibrasjon\n- At nødvendig isolasjon er til stede og i god stand\n- Varmekabel/varmeelement\n- Tilstand på værhus (låser, pakninger, hengsler\n  og oppheng)\n- At alle avstengingsventiler er låst i riktig posisjon\n\n<H>-----------------------------------------------------------------</>\n\nTI0750-0001 <H>Nærvisuell kontroll - Feltinstrumentering</>\n\nKontroller:\n- Mekanisk tilstand/supportering\n- At alle deksler og kabelinnføringer er tilskrudd\n- At tagskilt/merkeskilt er montert og leselig\n- Prosesstilkobling og uisolert instrumenttubing for;\n    - mekaniske skader\n    - lekkasjer (vurder bruk av gassmåler)\n    - korrosjonsskader (spot sjekk under tubingklammer)\n    - korrosjon (pitting på tubing)\n    - supportering/vibrasjon\n- At nødvendig isolasjon er til stede og i god stand\n- Varmekabel/varmeelement\n- Tilstand på værhus (låser, pakninger, hengsler\n  og oppheng)\n- At alle avstengingsventiler er låst i riktig posisjon\n<H> </>\n<H>-----------------------------------------------------------------</>\n\nTI0760-0001 <H>Nærvisuell kontroll, feltinstrument, kort</>\n\nKontroller:\n- Mekanisk tilstand/supportering\n- At alle deksler og kabelinnføringer er tilskrudd\n- At tagskilt/merkeskilt er montert og leselig\n\n<H>-----------------------------------------------------------------</>\n\nTI0830-0001 <H>Nærvisuell kontroll - Feltinstrumentering</>\n\nKontroller:\n- Mekanisk tilstand/supportering\n- At alle deksler og kabelinnføringer er tilskrudd\n- At tagskilt/merkeskilt er montert og leselig\n- Prosesstilkobling og uisolert instrumenttubing for;\n    - mekaniske skader\n    - lekkasjer (vurder bruk av gassmåler)\n    - korrosjonsskader (spot sjekk under tubingklammer)\n    - korrosjon (pitting på tubing)\n    - supportering/vibrasjon\n- At nødvendig isolasjon er til stede og i god stand\n- Varmekabel/varmeelement\n- Tilstand på værhus (låser, pakninger, hengsler\n  og oppheng)\n- At alle avstengingsventiler er låst i riktig posisjon\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017409588','00000002','','00000','','4.0','H',' ',' ','4.0','H','7.000','2018-10-18 07:00:00.0000000','PT07H00M00S','2018-10-18 11:00:00.0000000','PT11H00M00S','2018-10-18 07:00:00.0000000','PT07H00M00S','2018-10-18 11:00:00.0000000','PT11H00