------------</>\n\n','','','','',NULL,NULL,'1','H4','0017463258','00000002','','00000','','2.0','H',' ',' ','2.0','H','2.000','2018-09-27 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT24H00M00S','2018-09-27 00:00:00.0000000','PT00H00M00S','2018-10-29 00:00:00.0000000','PT24H00M00S','2018-09-30 15:22:16.0000000','PT15H22M16S','2018-09-30 15:28:46.0000000','PT15H28M46S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','2.0','1','','','PLAN','0010010154','2018-09-14 00:00:00.0000000','2018-10-04 00:00:00.0000000','24464830','1004985573','','OR000024464830','1766-T0012');
