insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004985581','OV100498558100000001','00000001',' ','0020','','PM01','','10007433','IMOTEL','','','12M NÆRVIS.KONTR./KONTR.MÅLING/FUNK.TEST','12M NÆRVIS.KONTR./KONTR.MÅLING/FUNK.TEST\n\n\nRB0201-0001 <H>Nærvisuell kontroll Stasjonære UHF radioer</>\n\n - Rengjør, kontroller radio, antenner, mikrofon og\n   nøklingsutstyr for eventuell skade/slitasje og korrosjon.\n\n<H>-----------------------------------------------------------------</>\nRB0201-0002 <H>Kontrollmåling Stasjonære UHF radioer</>\n\n1. Utfør følgende kontrollmålinger:\n   - DC spenningstilførsel\n   - Sendereffekt (nivå bærebølge)\n   - Reflektert effekt fra antenne (<10%)\n   - På kabler over 10m: TDR-måling på antenne/kabel(krever\n   spesialinstrument).\n   - Senderfrekvens og -avvik.\n   - Modulasjon (tale-/datainformasjonens styrke <5 kHz)\n   - Mottaker squelch åpning (når mottaker åpner)\n   - Mottakerfølsomhet (squelch må være av)\n\nSjekk teamsite/G-disk for eventuelle lokale tillegg\n(målebeskrivelse/info. med  tilhørende måleprotokoller).\n\n<H>-----------------------------------------------------------------</>\nRB0201-0003 <H>Funksjonstest Stasjonære UHF radioer</>\n\n1. Utfør funksjonstest\n\n2. Avslutt med å sette radio inn på korrekt\n   brukerfrekvens/kanal.\n\n<H>-----------------------------------------------------------------</>\n\n','','','','',