insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004985601','OV100498560100000003','00000003','9','0040','Operation Finally Confirmed (CNF)','PM01','','10007433','IMOTEL','','','12M - Kontrollmålinger på baseradioer','12M - Kontrollmålinger på baseradioer\n\nRB0100-0005 <H>Kontrollmålinger på alle baseradioer</>\n\nNB!\n- Målingene må utføres når kun en base nøkles!\n- Måling av DTF krever spesial-instrument\n\n1. Utfør følgende kontrollmålinger på alle baseradioene:\n   - DC spenningstilførsel (gjelder ikke PAGER)\n   - Sender effekt (nivå bærebølge)\n\n2. Utfør DTF (Distance to fault)/RL (Return Loss)-måling på\n   alle antennekabler. For utstyr med combiner-system må\n   denne utføres under pkt. B\n\nA. Mål:\n   - Reflektert effekt/SWR (<10%)\n   - Sender frekvens og avvik\n   - Modulasjon\n   - Mottaker squelch åpning (når mottaker åpner)\n   - Mottaker følsomhet (squelch må være av)\n\nB. COMBINERSYSTEMET/ANTENNER/LEAKY FEEDER\n   Koble fra hver utgang på antenne-siden av\n   combiner-systemet og mål:\n   - Nivå (uteffekt) på alle utganger. (Ut-effekt skal være\n     max 1 watt på leaky feeder).\n   - Reflektert effekt på hver sløyfe (<10%).\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017463370','00000002','','00000','','4.0','H',' ',' ','4.0','H','5.000','2018-09-27 00:00:00.0000000','PT00H00M00S','2018-