insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993588','OV100499358800000001','00000001',' ','3601','','PM01','','10007475','POMELE','','','36M Ex, detaljert kontroll varmeelement','36M Ex, detaljert kontroll varmeelement\n\nFE-630003A er isolert i EN840001A.21IK.\nFE-630003B er isolert i EN840001B.18IK.\n\nBG0220-0004 <H>Ex, detaljert inspeksjon</>\n\nUtfør Ex detaljert inspeksjon.\n\nDEFINISJON AV DETALJERT INSPEKSJON:\n\nEn inspeksjon som avdekker feil som synliggjøres kun ved åpning\nav kapsling.\nFormålet med denne inspeksjonen er å avdekke om det er spesielle\nutstyrsvarianter eller miljøforhold som medvirker til uønsket\ndegradering av utstyr m/kapsling. Det anbefales derfor at utvalg\nav utstyr som skal kontrolleres baserer seg på plassering med\ntanke på omgivelser/miljø som vær, vibrasjon, temperatur, støv\nog smuss.\n\nOMFANG AV DETALJERT INSPEKSJON:\n\nDetaljert inspeksjon skal utføres på et prosentvis utvalg\nog kommer i tillegg til nærvisuell inspeksjon. Ved\nfunn/mistanke om feil skal det utføres ytterligere detaljert\ninspeksjon.\n\nEx-i: For utstyr i egensikker utførelse(Exi),utføres detaljert\ninspeksjon kun ved mistanke om mangler/feil avdekket ved\nutvendig inspeksjon.\n\n\nFor utfyllende informasjon, se dokument i SAP.\nTransaksjon i SAP: CV04N\nDokument:          1955874\n\n\n<H>-----------------------------------------------------------------</>\n\nKONTROLL AV STARTER / STARTERSKUFF\n\nEL0523\n\n1. KONTROLLER STARTER MED HENBLIKK På BRENTE KONTAKTER\n   OG SPOR ETTER VARMEUTVIKLING.\n\n2. KONTROLLER TOLERANSER/KONTAKTTRYKK PÅ\n   STARTERSKUFFENS HUNKONTAKTER.KONTROLLER HAN/HUNKONTAKTENE\n   MED HENBLIKK PÅ SPOR ETTER VARMEUTVIKLING.\n\n3. RENGJØR STARTERSKUFFEN VED BEHOV, OG SMØR BEVEGELIGE\n   DELER  MED CRC2-26.\n\n4. FUNKSJONSTEST STARTER INKL.NØDSTOPPBRYTER .\n\n5. KONTROLLER INDIKATORLYS.\n\n6. KONTROLLER AT VERNINSTILLINGER ER I HENHOLD TIL DATA FOR\n   RELESETTING.\n\n7. TEST JORDFEILVERN.\n   (TEST AV OVERSTRØMSVERN ER LAGT TIL EGEN RUTINE).\n\n8. FORETA ISOLASJONSTEST AV NØDSTOPPBRYTER INKLUSIVE KABEL.\n   BRUK 500 V MEGGER.','','','','',NULL,NULL,'1','H4','0017491527','00000000','','00000','','4.0','H',' ',' ','4.0','H','0.000','2018-10-10 11:00:00.0000000','PT11H00M00S','2018-10-10 15:00:00.0000000','PT15H00M00S','2018-10-10 11:00:00.0000000','PT11H00M00S','2018-10-10 15:00:00.0000000','PT15H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472705','1004993588','','OR000024472705','1766-S6303A');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993588','OV100499358800000002','00000002',' ','3600','','PM01','','10007475','POMELE','','','36M Kontroll av varmeelement EEx','36M Kontroll av varmeelement EEx\n\n\nKONTROLL AV VARMEELEMENT\nEL0623\n\n1. KONTROLLER AT KABELMERKINGEN OG MERKESKILT\n   ER På PLASS OG ER LESELIGE.\n\n2. KONTROLLER VISUELT KOBLINGSHUS OG ELEMENT\n   M.H.P.SKADE,KORROSJON,SPOR ETTER\n   VARMEUTVIKLING,PAKNINGSTILSTAND,MANGLENDE SKRUER<(>,<)>\n   KABELINNFØRING,O.L.\n   PåFØR EVENTUELL PAKNING SYREFRI VASELIN/STL.\n\n3. KONTROLLER AT TILKOBLINGENE ER TILTRUKKET.\n\n4. FUNKSJONSPRØV EVENTUELLE TERMOSTATER.\n\n5. MåL ISOLASJONSMOTSTANDEN FOR VARMEELEMENTET OG TILHØRENDE\n   KABLER.\n   MINVERDI: 230V; 0,7 M0HM, 440V; 1,2 MOHM. 690V; 2,0 MOHM\n   (KALD VERDI)\n   MERK!!! VED MEGGING AV VARMEELEMENT I VARM TILSTAND<(>,<)>\n            SE FORSKRIFTENE (FEM) PARA.1250 PKT.2\n\n6. KONTROLLER AT VARMEELEMENTET ER I ORDEN VED Å FORETA\n   STRØMMÅLING.\n\n7. RENGJØR VARMEELEMENTER OG KOBLINGSBOKSER, BRUK PRESERVERENDE\n  RENGJØRINGSMIDDEL SOM 5-56 ELLER TILSVARENDE.\n\n','','','','',NULL,NULL,'1','H4','0017491528','00000000','','00000','','4.0','H',' ',' ','4.0','H','0.000','2018-10-10 07:00:00.0000000','PT07H00M00S','2018-10-10 11:00:00.0000000','PT11H00M00S','2018-10-10 07:00:00.0000000','PT07H00M00S','2018-10-10 11:00:00.0000000','PT11H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472705','1004993588','','OR000024472705','1766-S6303A');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993589','OV100499358900000001','00000001',' ','2400','','PM01','','10007475','POMELE','','','24M Kontroll av nødstopp','24M Kontroll av nødstopp\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>EEx(d)-KAPSLING/flammespalte:</>\nRutinen inneholder kriterier for grundig og visuell inspeksjon.\n\nDokument: SSS-23-530\nTittel  : Ex-utstyr\n--------------------------------------------------------------\n\n1.     Exd-UTSTYR\n\n1.1    DEFINISJON AV EX-BARRIERESVIKT\n\n1.1.1  At det er skader i kapslingen, i flammespalter, kabel-\n       innføringer eventuelt at det er monteringsfeil.\n\n       Skader i flammespalter som ikke klart har betydning for\n       spaltens funksjon skal ikke rapporteres som Ex-\n       barriere-svikt.\n\n1.1.2  At ikke alle skruer / muttere i kapslingen er på plass\n       og tilskrudd. At eventuelle blindplugger mangler eller\n       ikke er tilskrudd.\n\n1.1.3  Dersom det er tvil om utstyrets tilstand, skal\n       assistanse fra spesialistpersonell rekvireres.\n\n1.2    ARBEIDSBESKRIVELSE FOR TEST / MÅLING AV EX-\n       BARRIERESVIKT\n\n1.2.1  Kontroller utstyret inklusive kabler og\n       kabelinnføringer med hensyn på skade og korrosjon.\n\n1.2.2  Rengjør og kontroller flammespalter for skader og\n       korrosjon. Bruk rensemidler som ikke er korrosive\n       og / eller "ikke-metallisk" skrape.\n\n       Unntatt fra rengjøring og kontroll av flammespalter\n       er utstyr som ikke er beregnet på demontering eller\n       hvor leverandøren fraråder åpning.\n\n1.2.3  Kontroller at data- og Ex-skilt er på plass og lesbare.\n       Manglende merking skal ikke rapporteres som brudd på\n       Ex-barriere dersom Ex-klassifiseringen kan\n       dokumenteres,men det skal initieres en KV-jobb.\n\n1.2.4  Kontroller for korrosjon rundt nipler og\n       sammenføyninger,samt kontroller kablene mot skader og\n       at strekkavlastninger ved innføringer er i orden.\n\nPå Exd motorer er enkelte flammespalter vanskelig / umulig\nå kontrollere i felt. Der bør sammenlignbare flammespalter\nbrukes for vurdering.\nSammenlignbare flammespalter er f.eks. flammespalter på\nkoblingsbokser, koblingsbokser / statorhus.\n\nSe på ytterkant på flammespalter om det er rustutslag.\nDersom det er tydelige rustutslag kan dette bety at flamme-\nspalten innenfor er angrepet.\nSpesialistassistanse må rekvireres, alternativt sendes\nmotor til autorisert verksted. Inntil tilstand er avklart\ner dette ikke å betrakte som en Ex-barrieresvikt.\n\n1.2.5  Kontroller at kapslinger, glass og pakninger evt.\n       innstøpningsmassen er tilfredsstillende.\n\n1.2.6  Kontroller at alle skruer / muttere i kapslingen er\n       på plass og tilskrudd. Påse at eventuelle blindplugge\n       er på plass og tilskrudd.\n\n1.2.7  På stikkontakter kontrolleres forriglingsbryterens\n       tilstand og funksjon. Kontroller at kontaktelementer/\n       innstikk er rene og fri for korrosjon.\n\n1.3    VEDLIKEHOLD\n\n1.3.1  Rengjør innvendig og utvendig etter behov.\n\n1.3.2  Kontroller for eventuelle spor etter varmgang.\n\n1.3.3  Påfør eventuelle pakninger / O-ringer et tynt lag\n       syrefri vaselin / STL el. lignende.\n\n1.3.4  Påfør flammespalter et tynt lag korrosjonshindrende\n       grease.\n\n1.3.5  Smør skruer og gjenger.\n\n1.3.6  Før montering:  Kontroller at flammespaltene er rene\n       og fri for partikler. Spesielt på sylindriske\n       flammespalter må det kontrolleres at det ikke er\n       metallspon, sand eller grader som kan gi riper i\n       flammespalter under montering.\n\n1.3.7  Flammespaltene kan beskyttes utvendig med et lag\n       densotape.\n       Dette gjelder kun for utstyr i områder med IIA-gasser.\n\n2.     Exp-UTSTYR\n\n2.1    DEFINISJON AV EX-BARRIERESVIKT\n\nAt en eksplosiv gassblanding kan komme inn i utstyret under\ndrift eller at utstyret kan inneholde en eksplosiv gass-\nblanding ved innkobling.\n\n2.2    ARBEIDSBESKRIVELSE FOR TEST / MÅLING AV EX-\n       BARRIERESVIKT\n\n2.2.1  Kontroller at data - og Ex-skilt er på plass og\n       lesbare.\n       Manglende merking skal ikke rapporteres som brudd på\n       Ex-barriere dersom Ex-klassifiseringen kan\n       dokumenteres, men det skal initieres en KV-jobb.\n\n2.2.2  Kontroller at eventuelle inspeksjonsluker er\n       forsvarlig festet, at låser og eventuelle "interlocks"\n       virker tilfredsstillende.\n\n2.2.3  Ved oppstart kontrolleres at "purging" foregår med\n       riktig trykk og mengde og at innkobling ikke kan\n       foretas før komplett "purging" er utført.\n\n2.2.4  Kontrolleres for lekkasje. Kontroller at pakninger er\n       hele og uten skader.\n\n2.2.5  Kontroller at trykk- og / eller strømningsindikatorer<(>,<)>\n       alarmer og blokkeringer viser riktig verdi og opererer\n       på riktig grenseverdi.\n\n2.2.6  På utstyr med kanaler med gjennomstrømning av luft\n       kontrolleres pakninger for lekkasje og skader.\n       Kontroller at gnist- og partikkelfangere for utslipp av\n       gass i eksplosjonsfarlige områder er uten skader.\n\n2.2.7  På utstyr med kanaler kontrolleres spesielt skjøter med\n       belger grundig.\n\n2.2.8  Kontroller jordinger / ekvipotensialforbindelser.\n\n2.3    VEDLIKEHOLD\n\n2.3.1  Smør pakninger, hvis nødvendig, med et tynt lag med\n       syrefri vaselin, STL eller tilsvarende.\n\n2.3.2  Rengjør innvendig og utvendig etter behov.\n\n\n3.     Exe- / Exn-UTSTYR\n\n3.1    DEFINISJON AV EX-BARRIERESVIKT\n\nAt det er feil i tilkoblinger eller utstyret har manglende\ntetthet (jfr IP-grad) som kan medføre at det oppstår\nhøye temperaturer, gnister eller lysbuer.\n\n3.2    ARBEIDSBESKRIVELSE FOR TEST / MÅLING AV EX-\n       BARRIERESVIKT\n\n3.2.1  ExnA kontrolleres som for Exe.\n\nExnC er en beskyttelsesart som kan bygge på Exd eller\nExm-prisipp. Vurdering mhp. Ex-barrieresvikt må derfor\nforetas ihht. utstyrets dokumentasjon.\n\nExnL-utstyr kontrolleres som for Exi.\n\nExnR-utstyr kontrolleres mht tetthet.\n\n3.2.2  Kontroller utstyret med hensyn til skader og korrosjon.\n\n3.2.3  Kontroller at data- og Ex-skilt er på plass og lesbare.\n       Manglende merking skal ikke rapporteres som brudd på\n       Ex-barriere dersom Ex-klassifiseringen kan\n       dokumenteres,men det skal initieres en KV-jobb.\n\n3.2.4  Kontroller kablene for skader ved innføringer.\n\n3.2.5  Alt utstyr skal åpnes og kontrolleres for fuktighet og\n       skader på pakninger.\n\nUnntatt er utstyr som ikke er beregnet på demontering\neller hvor leverandøren fraråder åpning.\n\n3.2.6  Kontroller tilkoblinger, rekkeklemmer og ledere for\n       skader eller tegn ti varmgang.\n\n3.2.7  For kapslinger med begrenset ventilasjon er pakningenes\n       tilstand / kapslingens gasstetthet vital for å opprett-\n       holde Ex-beskyttelsen (ExnR-utstyr, typisk lyskastere).\n\n3.2.8  På lysarmaturer kontrolleres forriglingsbryterens\n       tilstand og funksjon.\n\n3.3    VEDLIKEHOLD\n\n3.3.1  Eventuelle skadede pakninger skiftes. Kun originale /\n       godkjente pakninger må benyttes.\n\n3.3.2  Rengjør innvendig og utvendig etter behov.\n\n3.3.3  Smør pakninger med et tynt lag syrefri vaselin, STL\n       el. liknende.\n\n3.3.4  Smør skruer / gjenger og kontroller at alle skruer<(>,<)>\n       blindplugger etc. er på plass og tilskrudd.\n\n3.3.5  TEST AV MOTORVERN FOR Exe-MOTOR\n\nFunksjonstest og innstilling av motorvern er beskrevet\ni standardrutine knyttet til motorstarter.\n\n4.     Exo-UTSTYR\n\n4.1    DEFINISJON AV EX-BARRIERESVIKT\n\nAt eksplosiv gass kommer i kontakt med tennkilder.\n\n4.2    ARBEIDSBESKRIVELSE FOR TEST / MÅLING AV EX-\n       BARRIERESVIKT\n\n4.2.1  Kontroller utstyret med hensyn på skader og korrosjon.\n\n4.2.2  Kontroller at data- og Ex-skilt er på plass og lesbare.\n       Manglende merking skal ikke rapporteres som brudd på\n       Ex-barriere dersom Ex-klassifiseringen kan\n       dokumenteres, men det skal initieres en KV-jobb.\n\n4.2.3  Kontroller for oljelekkasje.\n\n4.2.4  Kontroller at oljenivå er innenfor min/max verdier.\n\n4.3    VEDLIKEHOLD\n\nIkke relevant.\n\n5.     Exm-UTSTYR\n\n5.1    DEFINISJON AV EX-BARRIERESVIKT\n\nAt utstyret har fysiske skader (f.eks. sprekker) som kan\nmedføre at gass kommer i kontakt med varme eller gnist-\ndannende komponenter.\n\n5.2    ARBEIDSBESKRIVELSE FOR TEST / MÅLING AV EX-\n       BARRIERESVIKT\n\nKontroller utstyret med hensyn på skader.\n\n5.3    VEDLIKEHOLD\n\nIkke relevant.\n\n6.     Exq-UTSTYR\n\n6.1    DEFINISJON AV EX-BARRIERESVIKT\n\nAt det eksisterer fysiske skader på den sandfylte\nkapslingen som kan medføre at sanden lekker ut og at\ngass kommer i kontakt med varme eller gnistdannende\nkomponenter.\n\n6.2    ARBEIDSBESKRIVELSE FOR TEST / MÅLING AV EX-\n       BARRIERESVIKT\n\n6.2.1  Kontroller utstyret med hensyn på skader.\n\n6.3    VEDLIKEHOLD\n\nIkke relevant.\n\n7.     Exs-UTSTYR\n\n7.1    DEFINISJON AV EX-BARRIERESVIKT\n\nExs er en sikkerhetsart som ikke bygger på noen av de\nspesifiserte standarder for Ex-typer. Vurdering mhp. Ex-\nbarrieresvikt må derfor foretas iht. produsentens bruker-\ndokumentasjon, evt. må spesialist-personell konsulteres.\n\n7.2    ARBEIDSBESKRIVELSE FOR TEST / MÅLING AV EX-\n       BARRIERESVIKT\n\nMå vurderes og utføres ihht. produsentens brukerdokumentasjon<(>,<)>\nevt. av spesialist-personell.\n\n7.3    VEDLIKEHOLD\n\nMå vurderes og utføres ihht. produsentens brukerdokumentasjon<(>,<)>\nevt. av spesialist-personell.\n\n8.     Exi-UTSTYR\n\n8.1    DEFINISJON AV EX-BARRIERESVIKT\n\nAt barrierekort / -rele / galvanisk skille feiler og\nmedfører funksjonssvikt.\n\n8.2    ARBEIDSBESKRIVELSE FOR MÅLING AV EX-BARRIERESVIKT\n\n8.2.1  Ikke relevant. Feil medfører sikker tilstand.\n\n8.3    VEDLIKEHOLD\n\nikke relevant.\n\n8.4    TILBAKEMELDING . SEND M5/PM05\n\nExi-utstyr skal ikke ha Ex-vedlikehold.\nDersom SSS-23-530-rutinen er knyttet til Exi-utstyr skal det\nsendes inn en M5/PM05 for å få fjernet denne rutinen for det\naktuelle tag.\n\n9.     VISUELL KONTROLL AV FELTINSTUMENTERING\n\n9.1    Innledning\n\nEn del utstyr som høyttalere, PA-lys, gassdetektorsensorer\nog lignende har erfaringsmessig lite feil på Ex-delen av\nutstyret. PA-høyttalere har dessuten en Exd-del som ikke kan\nkontrolleres. Det er foretatt feltundersøkelse av utvalgt\nutstyr i overnevnte kategorier i de mest utsatte områdene på\nvår eldste installasjon offshore. På bakgrunn av denne\nundersøkelsen, samt at det i henhold til Europanorm\nEN 60079-17 gis anledning til visuell inspeksjon, anbefales\ndet at den vedlagte rutine, Visuell inspeksjon. anvendes hvor\ndette er relevant. Altså på utstyr som er knyttet til\nSSS-23-530 og som er nevnt nedenfor.\n\nVed gjennomføring av visuell kontroll kan intervallene for\nen grundig Ex-kontroll i henhold til SSS-23-530 økes. Ut\nfra tilstand på utstyret, skal behovet for sistnevnte\nkontroll vurderes fortløpende under utførelse av den\nvisuelle inspeksjonen.\n\n\n9.2    Visuell inspeksjon.\n\nVisuell inspeksjon skal identifisere, uten bruk av verktøy<(>,<)>\nsynlige feil som løse/manglende bolter, løse nipler, løse\neller manglende blindnipler, defekte glass, pakninger og\ninnstøpningsmasse, mekaniske skader, korrosjon etc.\n\nVisuell inspeksjon skal benyttes for utstyr hvor dette er\nDen vedlikeholdsmetode som utstyrsprodusenten anbefaler<(>,<)>\ntypisk er utstyr som ikke er beregnet på å bli åpnet.\n\nVisuell inspeksjon kan benyttes på feltinstrumentering hvor\ndet erfaringsmessig viser seg lite eller ingen forringelse\nav utstyrets ex-sikkerhet. Ved inspeksjon må man ha\nkjennskap til utstyrets konstruksjon og ha kjennskap til hva\nsom må vektlegges.\n\nTypisk utstyr hvor denne type kontroll er aktuell:\n\n9.3    Høyttalere.\nEx-klassifisering: Exdems/ Exdem.\n\nGenerell informasjon:\nLydhodet, som utgjør Exd-delen er sintret/porøst metall, og\nikke tilgjengelig for vedlikehold. Ved visuell inspeksjon\nkontrolleres om det er store tæringer i\nhøyttalerens lydhode. Ved store tæringer kan det være fare for\nat exd-beskyttelsen blir svekket.\nVidere må inspeksjonen basere seg på at det ikke er\nmekaniske skader eller tegn på at det kan være lekkasje til\nkoblingshus.\n\n\n9.4    PA-lys.\nEx-klassifisering: Exde.\n\nGenerell informasjon:\nFlammespalter er gjenger og en gjennomføring mellom Exd og\nExe-del.\nPa-lys utført i rustfritt stål har en kvalitet som gir liten\nsannsynlighet for korrosjonsskader i flammespalter.\nGjenger, som utgjør flammespalter, for feste av glass er limt\nog ikke beregnet for åpning.\n\nVisuell inspeksjon kan begrenses til mekaniske skader eller\nutvendig rust i enden av gjengepartiet, mot elektronikk.\n\n\n9.5    Magnetventiler.\nEx-klassifisering: Exme II T4.\n\nGenerell informasjon:\nMagnetventilenes elektriske del er innstøpt og ikke\ntilgjengelig for kontroll.\nInspeksjonen kan begrenses til utvendig kontroll av\nkoblingshus samt mekaniske skader generelt.\n\n9.6    Gassdetektorhoder/Gassdetektorer.\nEx-klassifisering: Exde.\n\nGenerell informasjon:\nFlammespaltene er i flensen på sensorhode/sensor og i\ngitteret på sensorhodet.\nGitteret i sensorhodet er sintret metall og kun tilgjengelig\nfor utvendig visuell kontroll mht korrosjon.\nInspeksjonen kan begrense seg til utvendig kontroll av\ngitteret og festeskruer på sensorhodet, og spesielt mot rust\npå skruene som kan forplante seg til flammespaltene.\n\n9.7    Gassdetektorer.\n\nGenerell informasjon:\nKontroller sensorene for skade og påse at ikke smuss/skitt\nhindrer gass fra å komme inn i detektoren.\nKontroller e-delen for lekkasjer\n\n9.8    CCTV kameraer\nEx-klassifisering: Exde\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nGenerell informasjon:\nKontrolleres for skade og korrosjon.\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for aktuel EX-utstyr\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>DEX</> - ''CST Defective EX Protection''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017491529','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-11 07:00:00.0000000','PT07H00M00S','2018-10-11 08:00:00.0000000','PT08H00M00S','2018-10-11 07:00:00.0000000','PT07H00M00S','2018-10-11 08:00:00.0000000','PT08H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472706','1004993589','','OR000024472706','1766-S6303A');
