KANTER OG SKADE PÅ\n    ISOLASJONEN.\n\n3.2 KONTROLLER AT KABELMERKINGEN ER PÅ PLASS OG AT DEN ER\n    LESELIG.\n\n3.3 KONTROLLER AT LOKKENE På KABELKANALENE ER PÅ PLASS.\n\n3.4 KONTROLLER AT BERØRINGSBESKYTTELSE ER PÅ PLASS\n    (OVER TILKOBLINGER FOR INN- OG UTGÅENDE KABLER<(>,<)>\n    INSTRUMENTER, ETC.).\n\n4.1 SJEKK TILKOBLINGER (VISUELT).INGEN ETTERTREKKING AV\n    TILKOBLINGER BORTSETT FRA VED 1. GANGS FV.','','','','',NULL,NULL,'1','H4','0017491598','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-22 07:00:00.0000000','PT07H00M00S','2018-10-22 08:36:00.0000000','PT08H36M00S','2018-10-22 07:00:00.0000000','PT07H00M00S','2018-10-22 08:36:00.0000000','PT08H36M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','','',NULL,NULL,'24472771','1004993634','','OR000024472771','1766-S8503');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993634','OV100499363400000002','00000002',' ','1202','','PM01','','10007387','E00SPE','1766-U','Utstyrsstopp','12M Funksjonstest av UPS BC0250','12M Funksjonstest av UPS BC0250\n\nBC0250-0005 <H>Hovedkontroll og funksjonstest UPS</>\n\nUtføres iht. produsents anbefaling.\nNormalt omfatter dette:\n- Renhold\n- Generell vurdering av tilstand\n- Oppdatering av software\n- Utskiftning av enkeltkomponenter ut fra levetid\n- Funksjonstest\n- Kontroll av alarmgrenser\n\n\n<H>-----------------------------------------------------------------</>\n\n','','1001','700','',NULL,NULL,'1','H4','0017491599','00000000','','00000','','12.0','H',' ',' ','12.0','H','0.000','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-23 12:24:00.0000000','PT12H24M00S','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-23 12:24:00.0000000','PT12H24M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','','',NULL,NULL,'24472771','1004993634','','OR000024472771','1766-S8503');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993634','OV100499363400000003','00000003',' ','1204','','PM01','','10008254','IMOMECTM','','','12M Termografi BC0250','12M Termografi BC0250\n\nTERMOGRAFI AV ELEKTRISK UTSTYR\n\nOS0047\n\nHensikt:\n\nTermografi av elektrisk utstyr skal foregå som en del av det\nforebyggende vedlikehold på Oseberg Sør.\nHensikten med termografi er å forebygge og avdekke feil på et\ntidlig tidspunkt slik at alvorlige feil kan unngåes.\nPå denne måten kan en avverge nedstengning av utstyr  svikt i\nkrafttilførsel  produksjonstap og store følgeskader.\n\nPlanlegging:\n\nDet er viktig med god planlegging av termografiarbeidet.\nForskrifter for El. anlegg  FSL og FSH må alltid følges.\nAlle tag som skal termograferes listes i "Object list".\n\nDet bør alltid være en elektriker med under termografering  hans\nviktigste oppgave er å påse at sikkerheten ivaretaes. Elektriker\nskal fjerne pleksiglassplater  deksler etc. for nødvendig tilkomst.\nHan skal videre påse at det benyttes personlig verneutsyr  vurdere\nbehov for avskjerming/avsperring ihht.FSH og FSL. I tillegg\nutføres det som kan utføres der og da. Dersom det oppdages avvik\nsom ikke kan rettes på stedet lages aktiviteter i SAP for\nutbedring.\n\nIntervaller:\n\nI utgangspunktet utføre termografi årlig. Det må vurderes om det\ner hensiktsmessig å dele anlegget i to  da det kan være vanskelig\nå få tilkomst til alt utstyr samtidig  utkall vil da bli 6 mnd.\nIntervallene må midlertid vurderes kontinuerlig på bakgrunn av de\nobservasjoner og erfaringer som gjøres.\n\nUtstyr som skal termograferes.\n\nHoved og nødgeneratorer. (Kabeltilkoblinger).\n\nHøyspenningstransformatorer.\n- Primær og sekundær side\n- Tilkoblinger for 0-punkt.\n\nTavler for nødgeneratorer\nFrekvensomformere for brannpumper\n\n690 volts tavler og fordelinger.\n\n690/400 volt transformatorer\n- Primær og sekundær side\n- Tilkoblinger for 0-punkt.\n\nSCR.MUD DRILL OG SCR DRILL TAVLER 690 volt.\n\n- Samleskinneforbindelser\n- Samleskinner på brytervogn samt bryter\n- Kabel og kontrollutrustning i lavspenningsfelt\n- Styrte likerettere knyttet til tavlene\n\nVSD for oil export & "Utsira"\n\n- Samleskinneforbindelser\n- Samleskinner på brytervogn samt bryter\n- Kabel og kontrollutrustning i lavspenningsfelt\n- Likerettere på innkommer\n- Vekselrettere med transformatorer knyttet til avganger på tavle\n- Transformatorer for Utsirapumper\n\n400 volts tavler og fordelinger\n\n230 volts fordelinger\n\nBatteriladere og likeretterskap med fordelinger.\n\nBatteribank for nødgeneratorer  brannpumper etc. Utføres under\nutladetest.\n\nAlle UPS''er med tilhørende batteribanker.\n\nGjennomføring av termografi.\nDet er viktig å ha normallast på utstyret når vi termograferer.\nTermografi av høyspenning skal bare gjennomføres gjennom termografi-\nvindu.\n\nForekommer det avvik på inngangsbrytere på 690 eller 400 volt tavler\nmå det vurderes å legge all last på den side som har avvik og ta ny\nmåling. Det samme gjelder for transformatorer som mater tavlene.\n\nTermografering av høyspenningstavler og 690 volts tavler.\nAlle kabelavganger skal termograferes og betingelsen er at\nutstyret er i drift. Utstyr som ikke er i drift må man forsøke å\nfå i-driftsatt og termografi utføres etter at utstyret har nådd\ndriftstemperatur.\nUtstyr som ikke kan idriftsettes under termografering registreres\npå KV jobb for å utføres på neste utkall.\n\n','','','','',NULL,NULL,'1','H4','0017491600','00000000','','00000','','3.0','H',' ',' ','3.0','H','0.000','2018-10-23 12:24:00.0000000','PT12H24M00S','2018-10-23 15:24:00.0000000','PT15H24M00S','2018-10-23 12:24:00.0000000','PT12H24M00S','2018-10-23 15:24:00.0000000','PT15H24M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','','',NULL,NULL,'24472771','1004993634','','OR000024472771','1766-S8503');
