insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993634','OV100499363400000005','00000005',' ','1201','','PM01','','10007475','POMELE','','','12M Forb. Utkall leverandør funk.test','12M Forb. Utkall leverandør funk.test\n\nUtføres god tid i forkant av plandato\n\nBC0250-0004 <H>Forberedelse av utkall serviceing./funksjonst. UPS</>\n\nForeta i samarbeid med Teknisk Fagansvarlig:\n- Gjennomgang av erfaringer for utstyret\n- PO-beskrivelse av jobbomfang og type/produsent som leverandør\n  skal gjennomføre FV for\n- Vurder behov for software-oppdatering\n- Forbered innkjøp av deler basert på levetid\n- Styre FV-aktivitet mot rett planperiode\n- Vurder antall UPS-anlegg det skal gjennomføres FV på\n\n\n<H>-----------------------------------------------------------------</>\n\n','','','','',NULL,NULL,'1','H4','0017491602','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-22 08:36:00.0000000','PT08H36M00S','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-22 08:36:00.0000000','PT08H36M00S','2018-10-22 09:24:00.0000000','PT09H24M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','','',NULL,NULL,'24472771','1004993634','','OR000024472771','1766-S8503');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993635','OV100499363500000001','00000001',' ','0600','','PM01','','10007475','POMELE','','','06M Nærvisuell inspeksjon, renhold','06M Nærvisuell inspeksjon, renhold\n\nBC0105-0006 <H>Nærvisuell inspeksjon - Renhold batteribank</>\n\nUtførelse:\n1. Generelt\n   a) Rengjør batteri og stativer. Benytt fille som fuktes i\n      rent vann. Bruk av annen væske kan skade kapsling.\n   b) Sjekk for lekkasjer.\n   c) Kontroller kabler og tilkoblinger.\n   d) For isolerte stativ, sjekk stativ for skade.\n   e) For jordete stativ, sjekk jordingsforbindelser.\n   f) Sjekk for deformering/sprekker.\n   g) Påfør syrefri vaselin på polene hvis nødvendig.\n   h) Kontroller væskenivå på åpne batterier.\n      Etterfyll destillert vann når væskenivå nærmer seg\n      minimum.\n\n2. Tillegg, spesielt for blybaserte batterier:\n   a) Mål cellespenning i henhold til datablad og kontroller\n      polaritet. (Celle med brudd vil ha motsatt polaritet).\n   b) Kontroller om batteribanken eller enkeltceller har vært\n      utsatt for dyputlading (under 1,6v/c).\n   c) Kontroller om cellespenning avviker med +0,1v/c eller\n      -0,05v/c ut fra normalladespenningen.\n      Slike variasjoner kan bl.a. forekomme dersom batteribanken\n      har fått ufullstendig lading.\n      Merk at dersom nye celler er satt inn i batteribank, må en\n      akseptere noe høyere avvik på cellespenningen. I slike\n      tilfeller vil det ikke ha så mye for seg med\n      utjevningslading.\n   d) Dersom dyputlading som omtalt i b) eller avvik på\n      cellespenning som omtalt i c), foreta da utjevningslading\n      av hele banken, med 2,35 - 2,37 v/c i 75 timer.\n\n\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017491603','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-16 07:00:00.0000000','PT07H00M00S','2018-10-16 08:36:00.0000000','PT08H36M00S','2018-10-16 07:00:00.0000000','PT07H00M00S','2018-10-16 08:36:00.0000000','PT08H36M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472772','1004993635','','OR000024472772','1766-S9310');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993635','OV100499363500000002','00000002',' ','1200','','PM03','','10007387','E00SPE','','','12M Utladetest batteribank','12M Utladetest batteribank\n\nBC0105-0002 <H>Utladetest inkl. termografering</>\n\nFormål\nVerifisere om batteribanken har kapasitet over 80% av\nmerkeytelse.\n\nMerk:\nKapasiteten på batteribanken regnes ut i %, og sammenlignes mot\nteoretisk kapasitet gitt fra leverandør og tidligere\nutladetester. Når kapasiteten på batteribanken nærmer seg 80%\nskal batteribank skiftes ut.\n\nDersom enkeltceller viser tendens til dårlig kapasitet i slutten\nav levetiden bør en vurderes å skifte ut hele batteribanken.\n\nUtførelse:\n1. Gjennomfør utladetest. Det anbefales en 5-timers utladetest\n   med konstant strøm iht. tabell fra batterileverandør.\n\n2. Registrer minimum 3 cellemålinger på standard logg-skjema\n   gjennom hele utladetesten.\n\n3. Termografer i siste halvdel av utladetesten. Sjekk temperatur\n   både på batteriblokk og tilkoblinger. Løse tilkoblinger\n   festes ved først å koble fra for deretter å trekkes til med\n   riktig moment.\n   Foreta ny termografering.\n   Foreta også termografering av hovedstrømveiene i UPS samt\n   fordeling.\n\n4. Avslutt testen når tiden er utløpt eller når spenningen har\n   falt til 1,8V i snitt per celle.\n\n5. Avslutt også testen dersom enkeltceller går under 1,6V.\n   a) Gjennomfør da bytte av battericelle.\n      Cellen bør lades før den settes inn i bank.\n   b) Planlegg med ny utladetest.\n\nSviktdefinisjon:\nBatteribanken har kapasitet under 80% av merkeytelse.\n\n<H>-----------------------------------------------------------------</>','','1001','700','3.01.12',NULL,NULL,'1','H4','0017491604','00000000','1003898701','00010','','12.0','H',' ',' ','12.0','H','0.000','2018-10-16 08:36:00.0000000','PT08H36M00S','2018-10-17 11:36:00.0000000','PT11H36M00S','2018-10-16 08:36:00.0000000','PT08H36M00S','2018-10-17 11:36:00.0000000','PT11H36M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472772','1004993635','','OR000024472772','1766-S9310');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993636','OV100499363600000001','00000001',' ','1201','','PM01','','10007475','POMELE','1766-U','Utstyrsstopp','12M Nærvisuell kontroll/renhold BC0255','12M Nærvisuell kontroll/renhold BC0255\n\nBC0255-0001 <H>Nærvisuell inspeksjon/renhold UPS</>\n\nKontroller:\n- renhold og for støv i kabinettene\n- at elektronikkort sitter som det skal\n- at plugg for serial link (kommunikasjon) sitter som den skal\n- tilførsler og avganger\n- sikringer og kontaktorer\n- at kjøling fungerer\n- kabelfelt, inklusive kabelinnføringer, kabelfester og\n  kabelstrips\n- status jordfeildeteksjon\n- jordingsforbindelse\n- for ulyder\n- at NAS nøkkel/overbroingsbryter er iht. NAS-filosofi\n- instrumenter og måleparametre i display\n- alarmlogg og status i frontdisplay, inklusiv lampe-test dersom\n  relevant\n- driftstilstand og belastning\n- klokke og evt. juster sommer/vintertid\n- at oppdatert kursfortegnelse er tilgjengelig i hovedfordeling\n  og at denne stemmer\n- at betjeningsprosedyre er tilgjengelig i UPS-kabinett\n\nSjekk at alle dører i skap lukket.\n\n\n<H>-----------------------------------------------------------------</>\n\n','','','','',NULL,NULL,'1','H4','0017491605','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-16 07:00:00.0000000','PT07H00M00S','2018-10-16 08:36:00.0000000','PT08H36M00S','2018-10-18 17:24:00.0000000','PT17H24M00S','2018-10-18 19:00:00.0000000','PT19H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472773','1004993636','','OR000024472773','1766-S9310');
