insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993639','OV100499363900000002','00000002',' ','1200','','PM01','','10007387','E00SPE','','','12M Utladetest batteribank','12M Utladetest batteribank\n\nBC0105-0002 <H>Utladetest inkl. termografering</>\n\nFormål\nVerifisere om batteribanken har kapasitet over 80% av\nmerkeytelse.\n\nMerk:\nKapasiteten på batteribanken regnes ut i %, og sammenlignes mot\nteoretisk kapasitet gitt fra leverandør og tidligere\nutladetester. Når kapasiteten på batteribanken nærmer seg 80%\nskal batteribank skiftes ut.\n\nDersom enkeltceller viser tendens til dårlig kapasitet i slutten\nav levetiden bør en vurderes å skifte ut hele batteribanken.\n\nUtførelse:\n1. Gjennomfør utladetest. Det anbefales en 5-timers utladetest\n   med konstant strøm iht. tabell fra batterileverandør.\n\n2. Registrer minimum 3 cellemålinger på standard logg-skjema\n   gjennom hele utladetesten.\n\n3. Termografer i siste halvdel av utladetesten. Sjekk temperatur\n   både på batteriblokk og tilkoblinger. Løse tilkoblinger\n   festes ved først å koble fra for deretter å trekkes til med\n   riktig moment.\n   Foreta ny termografering.\n   Foreta også termografering av hovedstrømveiene i UPS samt\n   fordeling.\n\n4. Avslutt testen når tiden er utløpt eller når spenningen har\n   falt til 1,8V i snitt per celle.\n\n5. Avslutt også testen dersom enkeltceller går under 1,6V.\n   a) Gjennomfør da bytte av battericelle.\n      Cellen bør lades før den settes inn i bank.\n   b) Planlegg med ny utladetest.\n\nSviktdefinisjon:\nBatteribanken har kapasitet under 80% av merkeytelse.\n\n<H>-----------------------------------------------------------------</>\n','','1001','700','',NULL,NULL,'1','H4','0017491619','00000000','','00000','','6.0','H',' ',' ','6.0','H','0.000','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-22 16:54:00.0000000','PT16H54M00S','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-22 16:54:00.0000000','PT16H54M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472776','1004993639','','OR000024472776','1766-S8501');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993639','OV100499363900000003','00000003',' ','0600','','PM01','','10007475','POMELE','','','06M Nærvisuell inspeksjon, renhold','06M Nærvisuell inspeksjon, renhold\n\nBC0105-0006 <H>Nærvisuell inspeksjon - Renhold batteribank</>\n\nUtførelse:\n1. Generelt\n   a) Rengjør batteri og stativer. Benytt fille som fuktes i\n      rent vann. Bruk av annen væske kan skade kapsling.\n   b) Sjekk for lekkasjer.\n   c) Kontroller kabler og tilkoblinger.\n   d) For isolerte stativ, sjekk stativ for skade.\n   e) For jordete stativ, sjekk jordingsforbindelser.\n   f) Sjekk for deformering/sprekker.\n   g) Påfør syrefri vaselin på polene hvis nødvendig.\n   h) Kontroller væskenivå på åpne batterier.\n      Etterfyll destillert vann når væskenivå nærmer seg\n      minimum.\n\n2. Tillegg, spesielt for blybaserte batterier:\n   a) Mål cellespenning i henhold til datablad og kontroller\n      polaritet. (Celle med brudd vil ha motsatt polaritet).\n   b) Kontroller om batteribanken eller enkeltceller har vært\n      utsatt for dyputlading (under 1,6v/c).\n   c) Kontroller om cellespenning avviker med +0,1v/c eller\n      -0,05v/c ut fra normalladespenningen.\n      Slike variasjoner kan bl.a. forekomme dersom batteribanken\n      har fått ufullstendig lading.\n      Merk at dersom nye celler er satt inn i batteribank, må en\n      akseptere noe høyere avvik på cellespenningen. I slike\n      tilfeller vil det ikke ha så mye for seg med\n      utjevningslading.\n   d) Dersom dyputlading som omtalt i b) eller avvik på\n      cellespenning som omtalt i c), foreta da utjevningslading\n      av hele banken, med 2,35 - 2,37 v/c i 75 timer.\n\n\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017491620','00000000','','00000','','3.0','H',' ',' ','3.0','H','0.000','2018-10-22 07:00:00.0000000','PT07H00M00S','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-22 07:00:00.0000000','PT07H00M00S','2018-10-22 09:24:00.0000000','PT09H24M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24472776','1004993639','','OR000024472776','1766-S8501');
