insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004993640','OV100499364000000002','00000002',' ','1202','','PM01','','10007387','E00SPE','1766-U','Utstyrsstopp','12M Funksjonstest av UPS BC0250','12M Funksjonstest av UPS BC0250\n\nBC0250-0005 <H>Hovedkontroll og funksjonstest UPS</>\n\nUtføres iht. produsents anbefaling.\nNormalt omfatter dette:\n- Renhold\n- Generell vurdering av tilstand\n- Oppdatering av software\n- Utskiftning av enkeltkomponenter ut fra levetid\n- Funksjonstest\n- Kontroll av alarmgrenser\n\n\n<H>-----------------------------------------------------------------</>','','1001','700','',NULL,NULL,'1','H4','0017491622','00000000','','00000','','12.0','H',' ',' ','12.0','H','0.000','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-23 12:24:00.0000000','PT12H24M00S','2018-10-22 09:24:00.0000000','PT09H24M00S','2018-10-23 12:24:00.0000000','PT12H24M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','','',NULL,NULL,'24472777','1004993640','','OR000024472777','1766-S8501');
