insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998160','OV100499816000000001','00000001',' ','0010','','PM01','','10007465','POMAUT','','','1M - Retur av defekte elektroniske kort','1M - Retur av defekte elektroniske kort\n\n\n\nSendes til Mongstad Base, Inspeksjon og Vedlikeholdsleder,\nPer Karsten Njøten.\n\n\n\nAPOS K-17605 - Retur av defekte elektroniske komponenter / kort\n\nAlle defekte elektroniske komponenter og kretskort som inngår i\nproduksjons/sikkerhets-kritiske system skal sendes til land.\nHver måned så oppretter vedlikeholdsleder en WO for returleveranse\nav alle defekte komponenter og kretskort i perioden.\nKomponenter og kretskort pakkes og merkes med WO som de ble byttet på\n(Ref. VE03.01). Siste virkedag i hver måned så sendes returleveransen\nmed de ulike komponent- og kretskortpakkene til land\nfor videre behandling, og WO for ny returleveranse opprettes.\n\n\nWork Order skal merkes med revisjonskode "DEFKORT"\nRetur av defekte elektroniske komponente','','','','',NULL,NULL,'1','H4','0017507721','00000000','','00000','','6.0','H',' ',' ','6.0','H','0.000','2018-10-07 07:00:00.0000000','PT07H00M00S','2018-10-07 15:00:00.0000000','PT15H00M00S','2018-10-07 07:00:00.0000000','PT07H00M00S','2018-10-07 15:00:00.0000000','PT15H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24477217','1004998160','','OR000024477217','1766-69');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998168','OV100499816800000001','00000001','9','0601','Operation Finally Confirmed (CNF)','PM01','','10007530','POMPRO','1766-L','Land Teknisk Saksbehandling','06M - NAS/PAS-ventiler - reaksjonstid','06M - NAS/PAS-ventiler - reaksjonstid\n\nVA1770-0003 <H>Funksjonstest NAS/PAS  ESD ventil</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon innen den sikkerhetskritisk tid angitt\n  i relevant dokumentasjon\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nMERK:\n- For ventiler med både NAS og PAS solenoid skal hver av disse\n  aktiveringsfunksjonene testes, men det er da tilstrekkelig at\n  operasjon av aktuator og ventil gjøres en gang.\n\nBETINGELSER FØR TEST\n- Ventilen må være i normal posisjon. Se også merknad over.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST\n1. Ventilen blir testet ved å aktivere aktuelt\n   nedstengningsnivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n   Eventuelt, dersom både NAS og PAS testes og ventil var i\n   sikker posisjon før test, verifiser da at NAS solenoiden ble\n   aktivert.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid, eller\n- NAS solenoid ble ikke aktivert\n- PAS solenoid ble ikke aktivert\n\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017507736','00000002','','00000','','2.0','H',' ',' ','2.0','H','2.000','2018-10-06 07:00:00.0000000','PT07H00M00S','2018-10-06 09:00:00.0000000','PT09H00M00S','2018-10-06 07:00:00.0000000','PT07H00M00S','2018-10-06 09:00:00.0000000','PT09H00M00S','2018-10-06 07:37:23.0000000','PT07H37M23S','2018-10-06 07:37:28.0000000','PT07H37M28S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','2.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24477225','1004998168','','OR000024477225','1766-S2103');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998169','OV100499816900000001','00000001','9','0610','Operation Finally Confirmed (CNF)','PM01','','10007530','POMPRO','','','06M Funksjonstest','06M Funksjonstest\n\nInfo:\nDet er krav til at gangtid på NAS/PAS ventiler skal måles/logges 12\nmånedlig (ref GL0114) når ventilen funksjonstestes (se TR3138, kap\n3.6.1).\n\nFV programmet skal spesifisere akseptabel lukketid på ventilen (evt.\nåpningstid hvis relevant).\n\nRef TR3003 blowdown-ventiler: Maksimum gangtid for blowdown-ventiler\nskal spesifiseres til 2 sekunder/tomme. Lenger gangtid ved testing kan\nvære akseptabelt, men gangtiden skal ikke påvirke trykkavlastningstiden.\nVentiler som vandrer jevnt men langsomt til full åpen posisjon er\nakseptable, men gangtiden skal ikke overstige 45-60 sekunder. Hvis\nventilen beveger seg ujevnt må ventilen overhales selv om gangtiden ikke\ngår over 45-60 sekunder.\n\nUtførelse:\nDenne jobben skal utføres av operasjonsgruppen Oseberg Sør på Sandsli.\nVedlikeholdsgruppen OSS skal ta ut rapport fra OPIS.\n\n1. Ta ut rapport fra OPIS en gang hver 6. måned og sorter ut ventiler\nmed feilfunksjon. Rapport skal omhandle alle ventiler i henhold til\nobjektliste i FV-programmet (EV og HZV-ventiler).\n\n2. Informer unit ved fagansvarlig drift og lag nødvendige KV-jobber.\n\n3. Lagre rapporten i minst 1 år.\n\nFør KV-jobber opprettes må følgende vurderes:\nHar ventilen vært ute av drift eller kjørt vedlikehold på siste periode?\nI så fall kvitteres denne ut som ok og en skriver en forklaring på\ndette.\n\nVA1600-0003 <H>Funksjonstest NAS/PAS  ESD ventil</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon innen den sikkerhetskritisk tid angitt\n  i relevant dokumentasjon\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nMERK:\n- For ventiler med både NAS og PAS solenoid skal hver av disse\n  aktiveringsfunksjonene testes, men det er da tilstrekkelig at\n  operasjon av aktuator og ventil gjøres en gang.\n\nBETINGELSER FØR TEST\n- Ventilen må være i normal posisjon. Se også merknad over.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST\n1. Ventilen blir testet ved å aktivere aktuelt\n   nedstengningsnivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n   Eventuelt, dersom både NAS og PAS testes og ventil var i\n   sikker posisjon før test, verifiser da at NAS solenoiden ble\n   aktivert.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid, eller\n- NAS solenoid ble ikke aktivert\n- PAS solenoid ble ikke aktivert\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017507737','00000002','','00000','','2.0','H',' ',' ','2.0','H','2.000','2018-10-07 07:00:00.0000000','PT07H00M00S','2018-10-07 09:00:00.0000000','PT09H00M00S','2018-10-07 07:00:00.0000000','PT07H00M00S','2018-10-07 09:00:00.0000000','PT09H00M00S','2018-10-05 13:49:18.0000000','PT13H49M18S','2018-10-05 13:49:22.0000000','PT13H49M22S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','2.0','1','','','PLAN','0010010154','2018-09-14 00:00:00.0000000','2018-10-04 00:00:00.0000000','24477226','1004998169','','OR000024477226','1766-S2002');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998170','OV100499817000000001','00000001',' ','0601','','PM01','','10007530','POMPRO','','','06M - Funksjonstest','06M - Funksjonstest\n\nArbeidsgang for testing og registrering av reaksjonstid for\nNAS/PAS-ventiler er spesiell, og for å få en god oversikt over\nflyten, henvises det til prosessbeskrivelse i APOS. Oppsummert skal\narbeidsgangen være som beskrevet nedenfor:\n\n1.,,<U>Saksbehandling på land:</>\n,,FV-mal kommer opp med landkode og saksbehandles på land i\n,,operasjonsgruppen. OPIS-utskrift skal gjennomgåes og gangtid for\n,,alle ventiler som har vært funksjonert i den aktuelle perioden\n,,skal registreres i SAP. Det skal hakes av for testet og ev.\n,,feilet i tilbakemeldingsbildet for ordren i SAP.\n2.,,<U>Ventiler som krever utstyrstopp:</>\n,,WO for RS-ventiler avsluttes når OPIS-data er registrert og disse\n,,ev. er avviksbehandlet. Ventiler som ikke har vært funksjonert i\n,,perioden skal testes ifm. neste NAS-test.\n,,Arbeidsordre for ventiler som kan testes ifm. vannvask (redusert\n,,produksjon) skal testes i neste vannvask-stopp, og FV-ordre\n,,legges for utførelse offshore.\n3.,,<U>Ventiler som kan testes i drift:</>\n,,Ventiler som ikke er operert i løpet av de siste 6 månedene (ihht.\n,,OPIS-data eller NAS-test) skal testes individuelt ihht.\n,,plattformens rutiner.\n4.,,<U>Arbeidsordren sendes til land:</>\n,,WO sendes til land for bearbeiding av resultatene etter at test\n,,er utført offshore. Det skal opprettes KV for ventiler som ikke\n,,er testet (unntatt RS-ventiler), nødvendige avvik etableres og FV\n,,ferdigmeldes i SAP. Se prosess i APOS for SSS-23-070 Reaksjonstid\n,,(i prosessen "Spesielt vedlikehold").\n5.,,<U>NAS-test:</>\n,,Utvalgte ventilers reaksjonstid skal registreres i forbindelse\n,,med NAS-test ihht. den enkelte installasjons plan for NAS-test\n,,(minimum RS-ventiler). Resultatene behandles av NAS-test teamet\n,,og tilbakemeldes på vanlig måte for element SSS-23-070 i SAP.\n\n\nVA1570-0003 <H>Funksjonstest PAS  PSD ventil</>\n\nFORMÅL:\nVerifisere gjennom en test at ventilen går til sikker posisjon\ninnen den sikkerhetskritisk tid angitt i relevant dokumentasjon\nved aktivering av PAS.\n\nSIKKERHETSKRITISK TID:\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nGANGTID:\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nBETINGELSER FØR TEST:\n- Ventilen må være i normal posisjon\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test\n\nFUNKSJONSTEST:\n1. Ventilen blir testet ved å aktivere aktuelt PAS nivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n\nSVIKTDEFINISJON:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid\n\n<H>-----------------------------------------------------------------</>\nVA1600-0003 <H>Funksjonstest NAS/PAS  ESD ventil</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon innen den sikkerhetskritisk tid angitt\n  i relevant dokumentasjon\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nMERK:\n- For ventiler med både NAS og PAS solenoid skal hver av disse\n  aktiveringsfunksjonene testes, men det er da tilstrekkelig at\n  operasjon av aktuator og ventil gjøres en gang.\n\nBETINGELSER FØR TEST\n- Ventilen må være i normal posisjon. Se også merknad over.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST\n1. Ventilen blir testet ved å aktivere aktuelt\n   nedstengningsnivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n   Eventuelt, dersom både NAS og PAS testes og ventil var i\n   sikker posisjon før test, verifiser da at NAS solenoiden ble\n   aktivert.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid, eller\n- NAS solenoid ble ikke aktivert\n- PAS solenoid ble ikke aktivert\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017507738','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-07 07:00:00.0000000','PT07H00M00S','2018-10-07 09:00:00.0000000','PT09H00M00S','2018-10-07 07:00:00.0000000','PT07H00M00S','2018-10-07 09:00:00.0000000','PT09H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24477227','1004998170','','OR000024477227','1766-S2002');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998170','OV100499817000000002','00000002',' ','1200','','PM01','','10007530','POMPRO','1766-PS','Planlagt stopp','12M - Lekkasjetest ventil','12M - Lekkasjetest ventil\n\nVentil må testes under nedkjøring til RS.\n\nEtter at ventilen er testet skal resultatene sendes Kjell Solli\npå mail med WO nr., slik at han kan legge inn verdiene og\nvurdere om noe må gjøres umiddelbart. Testresultatene skal Legges inn i\nSAP.\n\n\nME0521\n\n1.  Steng EV-ventil, husk å koble ut LL-bryter.\n\n2.  Trykkavlast og drener rørsystem mellom EV-ventil og nærmeste\n    avstengningsventiler (alle ventiler som skal stenges er beskrevet\n    i langtekst på fv-aktiviteten for gjeldende ev-ventil)\n\n3.  Steng av det trykkavlastede og drenerte området nedstrøms EV,\n    og merk av på P&ID. Lekkasjetesten kan begynne.\n\n4.  Registrer trykkene oppstrøms og nedstrøms.\n\n5.  Noter starttidspunkt for testen (dato, klokkeslett).\n\n6.  Start logging av testdata/testforløp.\n\n7.  Testen skal vare i minst 30 minutter, (det må sikres nok data).\n\n8.  Avslutt logg av testdata, noter slutt-trykk og klokkeslett.\n\n9.  Ta ut trend av opp-og nedstrømstrykk i OPIS.\n\n10. Resultater: Skriv inn testresultatene i notifikasjonen\n    (timer legges inn og wo legges mot land for beregning av\n    resultater, beregningsvolumet må da ligge i langtekst på\n    fv-aktivitet for gjeldende EV-ventil).\nLekkasjetest av EV-ventiler (trykksettin\n\nVA1600-0004 <H>On/off ventil - Lekkasjetest</>\n\nFORMÅL\nHensikten med lekkasjetest er å avklare om ventilen har en\nlekkasjerate som ligger innenfor det som er definert som\nsikkerhetsmessig akseptabel for driften av anlegget.\n\nMerk:\na) Utførelsen under beskriver en generell testmetode hvor man er\n   i stand til å isolere et kjent volum nedstrøms ventilen og\n   måler trykkoppbygging i dette som et uttrykk for\n   lekkasjeraten.\n   Dersom dette ikke er mulig, slik som for ventiler mot\n   eksempelvis stigerør og rørledninger, beskriver TR3138\n   Appendix C. 3 alternative testmetoder, eksempelvis basert på\n   måling av lekkasjerater inn i ventilhus.\n\nb) Akseptkriteriet kan ligge som en tilleggsinformasjon knyttet\n   til denne aktiviteten.\n\nUTFØRELSE, generell, se merknad over:\n1. Oppretthold normalt operasjonstrykk oppstrøms lukket ventil.\n\n2. Trykkavlast nedstrøms ventil til så nær\n   atmosfærisk/fakkeltrykk som praktisk mulig.\n\n3. Tilbakestill trykkavlasting (lukket volum nedstrøms).\n\n4. Hold trykk og temperatur oppstrøms ventilen stabilt i minimum\n   15 minutter.\n\n5. Registrer trykkoppbygging i lukket volum nedstrøms ventilen.\n\n6. Sammenlign målt trykkoppbygging med akseptkriteriet.\n\nSviktdefinisjon:\nLekkasjerate er over akseptkriteriet, enten:\n- Anleggsspesifikk for spesifikk ventil, eller\n- Generelt gitt av TR3138, Appendix B2, tabell 3\n\nVær oppmerksom på at flere ventiler i samme segment må dele\ndette kravet.\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017507739','00000000','','00000','','5.0','H',' ',' ','5.0','H','0.000','2018-10-07 09:00:00.0000000','PT09H00M00S','2018-10-07 14:00:00.0000000','PT14H00M00S','2018-10-07 09:00:00.0000000','PT09H00M00S','2018-10-07 14:00:00.0000000','PT14H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24477227','1004998170','','OR000024477227','1766-S2002');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998171','OV100499817100000001','00000001','9','0601','Operation Finally Confirmed (CNF)','PM01','','10007530','POMPRO','1766-L','Land Teknisk Saksbehandling','06M - NAS/PAS-ventiler - reaksjonstid','06M - NAS/PAS-ventiler - reaksjonstid\n\nInfo:\nDet er krav til at gangtid på NAS/PAS ventiler skal måles/logges 12\nmånedlig (ref GL0114) når ventilen funksjonstestes (se TR3138, kap\n3.6.1).\n\nFV programmet skal spesifisere akseptabel lukketid på ventilen (evt.\nåpningstid hvis relevant).\n\nRef TR3003 blowdown-ventiler: Maksimum gangtid for blowdown-ventiler\nskal spesifiseres til 2 sekunder/tomme. Lenger gangtid ved testing kan\nvære akseptabelt, men gangtiden skal ikke påvirke trykkavlastningstiden.\nVentiler som vandrer jevnt men langsomt til full åpen posisjon er\nakseptable, men gangtiden skal ikke overstige 45-60 sekunder. Hvis\nventilen beveger seg ujevnt må ventilen overhales selv om gangtiden ikke\ngår over 45-60 sekunder.\n\nUtførelse:\nDenne jobben skal utføres av operasjonsgruppen Oseberg Sør på Sandsli.\nVedlikeholdsgruppen OSS skal ta ut rapport fra OPIS.\n\n1. Ta ut rapport fra OPIS en gang hver 6. måned og sorter ut ventiler\nmed feilfunksjon. Rapport skal omhandle alle ventiler i henhold til\nobjektliste i FV-programmet (EV og HZV-ventiler).\n\n2. Informer unit ved fagansvarlig drift og lag nødvendige KV-jobber.\n\n3. Lagre rapporten i minst 1 år.\n\nFør KV-jobber opprettes må følgende vurderes:\nHar ventilen vært ute av drift eller kjørt vedlikehold på siste periode?\nI så fall kvitteres denne ut som ok og en skriver en forklaring på\ndette.\n\nVA1600-0003 <H>Funksjonstest NAS/PAS  ESD ventil</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon innen den sikkerhetskritisk tid angitt\n  i relevant dokumentasjon\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nMERK:\n- For ventiler med både NAS og PAS solenoid skal hver av disse\n  aktiveringsfunksjonene testes, men det er da tilstrekkelig at\n  operasjon av aktuator og ventil gjøres en gang.\n\nBETINGELSER FØR TEST\n- Ventilen må være i normal posisjon. Se også merknad over.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST\n1. Ventilen blir testet ved å aktivere aktuelt\n   nedstengningsnivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n   Eventuelt, dersom både NAS og PAS testes og ventil var i\n   sikker posisjon før test, verifiser da at NAS solenoiden ble\n   aktivert.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid, eller\n- NAS solenoid ble ikke aktivert\n- PAS solenoid ble ikke aktivert\n\n<H>-----------------------------------------------------------------</>\nVA1765-0003 <H>Funksjonstest trykkavlastningsventil (NAS)</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon, dvs. åpner for trykkavlastning<(>,<)>\n  innen den sikkerhetskritisk tid angitt i relevant\n  dokumentasjon ved aktivering av NAS\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nBETINGELSER FØR TEST\n- Ventilen må være i stengt posisjon.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST:\n1. Ventilen blir testet ved å aktivere aktuelt NAS nivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid\n\n\n\n<H>-----------------------------------------------------------------</>\nVA1571-0003 <H>Funksjonstest NAS/PAS  ESD ventil</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon innen den sikkerhetskritisk tid angitt\n  i relevant dokumentasjon\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nMERK:\n- For ventiler med både NAS og PAS solenoid skal hver av disse\n  aktiveringsfunksjonene testes, men det er da tilstrekkelig at\n  operasjon av aktuator og ventil gjøres en gang.\n\nBETINGELSER FØR TEST\n- Ventilen må være i normal posisjon. Se også merknad over.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST\n1. Ventilen blir testet ved å aktivere aktuelt\n   nedstengningsnivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n   Eventuelt, dersom både NAS og PAS testes og ventil var i\n   sikker posisjon før test, verifiser da at NAS solenoiden ble\n   aktivert.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid, eller\n- NAS solenoid ble ikke aktivert\n- PAS solenoid ble ikke aktivert\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017507740','00000002','','00000','','1.0','H',' ',' ','1.0','H','1.000','2018-10-06 07:00:00.0000000','PT07H00M00S','2018-10-06 08:00:00.0000000','PT08H00M00S','2018-10-06 07:00:00.0000000','PT07H00M00S','2018-10-06 08:00:00.0000000','PT08H00M00S','2018-10-06 07:40:46.0000000','PT07H40M46S','2018-10-06 07:40:50.0000000','PT07H40M50S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','1.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24477228','1004998171','','OR000024477228','1766-S1301');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998172','OV100499817200000001','00000001',' ','0601','','PM01','','10007530','POMPRO','1766-U','Utstyrsstopp','06M Funksjonstest','06M Funksjonstest\n\nArbeidsgang for testing og registrering av reaksjonstid for\nNAS/PAS-ventiler er spesiell, og for å få en god oversikt over\nflyten, henvises det til prosessbeskrivelse i APOS. Oppsummert skal\narbeidsgangen være som beskrevet nedenfor:\n\n1.,,<U>Saksbehandling på land:</>\n,,FV-mal kommer opp med landkode og saksbehandles på land i\n,,operasjonsgruppen. OPIS-utskrift skal gjennomgåes og gangtid for\n,,alle ventiler som har vært funksjonert i den aktuelle perioden\n,,skal registreres i SAP. Det skal hakes av for testet og ev.\n,,feilet i tilbakemeldingsbildet for ordren i SAP.\n2.,,<U>Ventiler som krever utstyrstopp:</>\n,,WO for RS-ventiler avsluttes når OPIS-data er registrert og disse\n,,ev. er avviksbehandlet. Ventiler som ikke har vært funksjonert i\n,,perioden skal testes ifm. neste NAS-test.\n,,Arbeidsordre for ventiler som kan testes ifm. vannvask (redusert\n,,produksjon) skal testes i neste vannvask-stopp, og FV-ordre\n,,legges for utførelse offshore.\n3.,,<U>Ventiler som kan testes i drift:</>\n,,Ventiler som ikke er operert i løpet av de siste 6 månedene (ihht.\n,,OPIS-data eller NAS-test) skal testes individuelt ihht.\n,,plattformens rutiner.\n4.,,<U>Arbeidsordren sendes til land:</>\n,,WO sendes til land for bearbeiding av resultatene etter at test\n,,er utført offshore. Det skal opprettes KV for ventiler som ikke\n,,er testet (unntatt RS-ventiler), nødvendige avvik etableres og FV\n,,ferdigmeldes i SAP. Se prosess i APOS for SSS-23-070 Reaksjonstid\n,,(i prosessen "Spesielt vedlikehold").\n5.,,<U>NAS-test:</>\n,,Utvalgte ventilers reaksjonstid skal registreres i forbindelse\n,,med NAS-test ihht. den enkelte installasjons plan for NAS-test\n,,(minimum RS-ventiler). Resultatene behandles av NAS-test teamet\n,,og tilbakemeldes på vanlig måte for element SSS-23-070 i SAP.\n\n\nVA1570-0003 <H>Funksjonstest PAS  PSD ventil</>\n\nFORMÅL:\nVerifisere gjennom en test at ventilen går til sikker posisjon\ninnen den sikkerhetskritisk tid angitt i relevant dokumentasjon\nved aktivering av PAS.\n\nSIKKERHETSKRITISK TID:\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nGANGTID:\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nBETINGELSER FØR TEST:\n- Ventilen må være i normal posisjon\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test\n\nFUNKSJONSTEST:\n1. Ventilen blir testet ved å aktivere aktuelt PAS nivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n\nSVIKTDEFINISJON:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017507741','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-08 07:00:00.0000000','PT07H00M00S','2018-10-08 08:00:00.0000000','PT08H00M00S','2018-10-08 07:00:00.0000000','PT07H00M00S','2018-10-08 08:00:00.0000000','PT08H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','','',NULL,NULL,'24477229','1004998172','','OR000024477229','1766-S1301');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1004998172','OV100499817200000002','00000002',' ','1210','','PM01','','10007530','POMPRO','1766-PS','Planlagt stopp','12M Lekkasjetest ventil','12M Lekkasjetest ventil\n\n\nME0521\n\n1.  Steng EV-ventil, husk å koble ut LL-bryter.\n\n2.  Trykkavlast og drener rørsystem mellom EV-ventil og nærmeste\n    avstengningsventiler (alle ventiler som skal stenges er beskrevet\n    i langtekst på fv-aktiviteten for gjeldende ev-ventil)\n\n3.  Steng av det trykkavlastede og drenerte området nedstrøms EV,\n    og merk av på P&ID. Lekkasjetesten kan begynne.\n\n4.  Registrer trykkene oppstrøms og nedstrøms.\n\n5.  Noter starttidspunkt for testen (dato, klokkeslett).\n\n6.  Start logging av testdata/testforløp.\n\n7.  Testen skal vare i minst 30 minutter, (det må sikres nok data).\n\n8.  Avslutt logg av testdata, noter slutt-trykk og klokkeslett.\n\n9.  Ta ut trend av opp-og nedstrømstrykk i OPIS.\n\n10. Resultater: Skriv inn testresultatene i notifikasjonen\n    (timer legges inn og wo legges mot land for beregning av\n    resultater, beregningsvolumet må da ligge i langtekst på\n    fv-aktivitet for gjeldende EV-ventil).\nLekkasjetest av EV-ventiler (trykksettin\n\nVA1600-0004 <H>On/off ventil - Lekkasjetest</>\n\nFORMÅL\nHensikten med lekkasjetest er å avklare om ventilen har en\nlekkasjerate som ligger innenfor det som er definert som\nsikkerhetsmessig akseptabel for driften av anlegget.\n\nMerk:\na) Utførelsen under beskriver en generell testmetode hvor man er\n   i stand til å isolere et kjent volum nedstrøms ventilen og\n   måler trykkoppbygging i dette som et uttrykk for\n   lekkasjeraten.\n   Dersom dette ikke er mulig, slik som for ventiler mot\n   eksempelvis stigerør og rørledninger, beskriver TR3138\n   Appendix C. 3 alternative testmetoder, eksempelvis basert på\n   måling av lekkasjerater inn i ventilhus.\n\nb) Akseptkriteriet kan ligge som en tilleggsinformasjon knyttet\n   til denne aktiviteten.\n\nUTFØRELSE, generell, se merknad over:\n1. Oppretthold normalt operasjonstrykk oppstrøms lukket ventil.\n\n2. Trykkavlast nedstrøms ventil til så nær\n   atmosfærisk/fakkeltrykk som praktisk mulig.\n\n3. Tilbakestill trykkavlasting (lukket volum nedstrøms).\n\n4. Hold trykk og temperatur oppstrøms ventilen stabilt i minimum\n   15 minutter.\n\n5. Registrer trykkoppbygging i lukket volum nedstrøms ventilen.\n\n6. Sammenlign målt trykkoppbygging med akseptkriteriet.\n\nSviktdefinisjon:\nLekkasjerate er over akseptkriteriet, enten:\n- Anleggsspesifikk for spesifikk ventil, eller\n- Generelt gitt av TR3138, Appendix B2, tabell 3\n\nVær oppmerksom på at flere ventiler i samme segment må dele\ndette kravet.\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017507742','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-08 08:00:00.0000000','PT08H00M00S','2018-10-08 10:00:00.0000000','PT10H00M00S','2018-10-08 08:00:00.0000000','PT08H00M00S','2018-10-08 10:00:00.0000000','PT10H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','','',NULL,NULL,'24477229','1004998172','','OR000024477229','1766-S1301');
