8-10-10 15:41:14.0000000','PT15H41M14S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','3.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24483429','1005004492','','OR000024483429','1766-S1322');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005004498','OV100500449800000001','00000001','9','0601','Operation Finally Confirmed (CNF)','PM01','','10007530','POMPRO','1766-L','Land Teknisk Saksbehandling','06M - NAS/PAS-ventiler - reaksjonstid','06M - NAS/PAS-ventiler - reaksjonstid\n\nInfo:\nDet er krav til at gangtid på NAS/PAS ventiler skal måles/logges 12\nmånedlig (ref GL0114) når ventilen funksjonstestes (se TR3138, kap\n3.6.1).\n\nFV programmet skal spesifisere akseptabel lukketid på ventilen (evt.\nåpningstid hvis relevant).\n\nRef TR3003 blowdown-ventiler: Maksimum gangtid for blowdown-ventiler\nskal spesifiseres til 2 sekunder/tomme. Lenger gangtid ved testing kan\nvære akseptabelt, men gangtiden skal ikke påvirke trykkavlastningstiden.\nVentiler som vandrer jevnt men langsomt til full åpen posisjon er\nakseptable, men gangtiden skal ikke overstige 45-60 sekunder. Hvis\nventilen beveger seg ujevnt må ventilen overhales selv om gangtiden ikke\ngår over 45-60 sekunder.\n\nUtførelse:\nDenne jobben skal utføres av operasjonsgruppen Oseberg Sør på Sandsli.\nVedlikeholdsgruppen OSS skal ta ut rapport fra OPIS.\n\n1. Ta ut rapport fra OPIS en gang hver 6. måned og sorter ut ventiler\nmed feilfunksjon. Rapport skal omhandle alle ventiler i henhold til\nobjektliste i FV-programmet (EV og HZV-ventiler).\n\n2. Informer unit ved fagansvarlig drift og lag nødvendige KV-jobber.\n\n3. Lagre rapporten i minst 1 år.\n\nFør KV-jobber opprettes må følgende vurderes:\nHar ventilen vært ute av drift eller kjørt vedlikehold på siste periode?\nI så fall kvitteres denne ut som ok og en skriver en forklaring på\ndette.\n\nVA1571-0003 <H>Funksjonstest NAS/PAS  ESD ventil</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon innen den sikkerhetskritisk tid angitt\n  i relevant dokumentasjon\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nMERK:\n- For ventiler med både NAS og PAS solenoid skal hver av disse\n  aktiveringsfunksjonene testes, men det er da tilstrekkelig at\n  operasjon av aktuator og ventil gjøres en gang.\n\nBETINGELSER FØR TEST\n- Ventilen må være i normal posisjon. Se også merknad over.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST\n1. Ventilen blir testet ved å aktivere aktuelt\n   nedstengningsnivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n   Eventuelt, dersom både NAS og PAS testes og ventil var i\n   sikker posisjon før test, verifiser da at NAS solenoiden ble\n   aktivert.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid, eller\n- NAS solenoid ble ikke aktivert\n- PAS solenoid ble ikke aktivert\n\n<H>-----------------------------------------------------------------</>\nVA1765-0003 <H>Funksjonstest trykkavlastningsventil (NAS)</>\n\nFORMÅL\nVerifisere gjennom en test at ventilen:\n- går til sikker posisjon, dvs. åpner for trykkavlastning<(>,<)>\n  innen den sikkerhetskritisk tid angitt i relevant\n  dokumentasjon ved aktivering av NAS\n\nSIKKERHETSKRITISK TID\nDen tid som er etablert for den enkelte ventil på anlegget iht.\nforhåndsdefinerte lister.\n\nGANGTID\nDen tid det tar fra initiering av ventil aksjon via aktuator til\nbekreftet tilhørende posisjonstilbakemelding fra ventil.\n\nDer ventilen har vært aktivert med suksess og akseptabel ytelse\ni siste halvdel av FV intervallet, kan dokumentasjon fra\naktiveringen brukes som alternativ til gjennomføring av denne\nfunksjonstesten.\n\nBETINGELSER FØR TEST\n- Ventilen må være i stengt posisjon.\n- Ventilen skal ikke rengjøres, smøres eller opereres. Dette\n  gjøres etter test.\n- Dersom det er flere solenoider mot samme ventil, sørge for at\n  det er NAS solenoiden som vil aktivere ventil eksempelvis\n  gjennom midlertidig blokkering i logikk av andre solenoider\n  såfremt det ikke eksisterer en tidsforsinkelse på andre\n  kaskadeaksjoner med dette som formål.\n\nFUNKSJONSTEST:\n1. Ventilen blir testet ved å aktivere aktuelt NAS nivå.\n\n2. Sjekk at ventilen går til sikker posisjon, og registrer\n   samtidig gangtid/reaksjonstid. Ta hensyn til programmerte\n   tidsforsinkelser.\n\nSviktdefinisjon:\n- Ventil når ikke forventet posisjon, eller\n- Ventil har gangtid i sikker retning utover det som er definert\n  som sikkerhetskritisk tid\n\n\n\n<H>-----------------------------------------------------------------</>','','','','',NULL,NULL,'1','H4','0017528831','00000002','','00000','','1.0','H',' ',' ','1.0','H','1.000','2018-10-05 07:00:00.0000000','PT07H00M00S','2018-10-05 08:00:00.0000000','PT08H00M00S','2018-10-05 07:00:00.0000000','PT07H00M00S','2018-10-05 08:00:00.0000000','PT08H00M00S','2018-10-05 13:40:52.0000000','PT13H40M52S','2018-10-05 13:40:56.0000000','PT13H40M56S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','1.0','1','','','','',NULL,NULL,'24483435','1005004498','','OR000024483435','1766-S2001');
