insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005004498','OV100500449800000003','00000003',' ','1201','','PM01','','10007465','POMAUT','','','Visuell kontroll av bryter','Visuell kontroll av bryter\n\nNØDSTOPP OG MANUELT OPERERT BRYTERE\nAU0045\n\n\nNØDSTOPP OG ANDRE MANUELT OPERERTE BRYTERE\n\n\n1.  KONTROLL I DRIFT\n\nGENERELT: I SERTIFISERT OMRÅDE MÅ GASSMÅLING VÆRE UTFØRT FØR\n          KAPSLING BLIR ÅPNET.\n\n1.1 KONTROLLER OM UTSTYRET HAR MEKANISK SKADE ELLER ER\n    ANGREPET AV KORROSJON.\n\n1.2 KONTROLLER KABLENE FOR SKADE, OG SJEKK AT STREKK-\n    AVLASTNINGEN ER OK.\n\n1.3 KONTROLLER AT KABELNIPLER OG -TETNINGER ER HELE OG\n    TETTER GODT RUNDT KABLENE.\n\n1.4 KONTROLLER AT MERKESKILT ER PÅ PLASS OG LESELIGE,\n    SPESIELLT SKILT SOM VISER EX-SERTIFISERING.\n\n\n2.  KONTROLL VED SPENNINGSLØS TILSTAND\n\n2.1 UTFØRT KONTROLL IHHT. KAPITTEL 1.\n\n2.2 ÅPNE UTSTYRET OG KONTROLLER AT REKKEKLEMMENE ER HELE.\n    RENGJØR OM NØDVENDIG. SJEKK FOR LØSE FORBINDELSER.\n\n2.3 SE ETTER SPOR AV VARMEUTVIKLING.\n\n2.4 SE ETTER FUKTIGHET ELLER SPOR AV LEKKASJE, BYTT UT EVENTUELL\n    CORTEC ELLER SILICA GEL.\n','','','','',NULL,NULL,'1','H4','0017528833','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-05 10:00:00.0000000','PT10H00M00S','2018-10-05 11:00:00.0000000','PT11H00M00S','2018-10-05 10:00:00.0000000','PT10H00M00S','2018-10-05 11:00:00.0000000','PT11H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24483435','1005004498','','OR000024483435','1766-S2001');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005004501','OV100500450100000001','00000001',' ','0306','','PM01','','10007513','POMMEC','','','03M Kontr. av ladetrykk akk.blokkventil','03M Kontr. av ladetrykk akk.blokkventil\n\n\nME0487\n\nA. KONTROLLER AT DET IKKE ER PLANLAGT VIRKSOMHET SOM KREVER\n   TESTENHETENS KAPASITET.\n\nB. KONTROLLER AT TESTEN IKKE STENGER NED SYSTEMER SOM\n   PÅVIRKER SIKKERHET OG PRODUKSJON.\n\nC. KONTROLLER AT TRYKK OG KAPASITET PÅ RELADESYSTEMET (N2)\n   ER I HENHOLD TIL DRIFTSMANUALDATASHEET.\n\nD. NOTER DRIFTSMANUALENS MAX-MIN GRENSE, ANBEFALT LADETRYKK\n   OG METODE FOR KONTROLL AV AKKUMULATORENS TRYKKSETTING.\n\n1. START HYDRAULIKK SYSTEMET SOM SKAL TESTES, KONTROLLER AT\n   TRYKKET ER NORMALT.\n\n2. STENG VENTILEN/VENTILER MELLOM AKKUMULATOR OG HYDRAULIKK-\n   PUMPE.\n\n3. KONTROLLER AT FYLLEVENTILEN ER STENGT.\n\n4. TRYKKET I AKKUMULATOREN SENKES VED HJELP AV MANUELL ELLER\n   TVANGSOPNING AV AUT. DRAINVENTIL.\n\n5. AKKUMULATORENS AKTUELLE LADETRYKK KAN AVLESES VISUELT VED\n   HJELP AV LOKALT MANOMETER.\n\n   ER DET TVIL OM AKTUELT LADETRYKKSPUNKT, ÅPNES FYLLEVENTIL\n   TIL AKKUMULATORTRYKKET ER NORMALT, OG PROSEDYREN FRA\n   PUNKT 3-5 GJENTAES.\n\n   FØLG DRIFTSMANUALENS FORESKREVNE METODE FOR AVLESNING AV\n   AKTUELT LADETRYKK.\n\n6. LIGGER AVLESTE VERDIER UTENFOR MAX-MIN GRENSEN, JUSTERES\n   DETTE I HENHOLD TIL ANBEFALTE NORMALVERDI.\n\n7. RESETT AKKUMULATORKRETSEN SOM FORESKREVET I DRIFTSMANUALEN\n\n   LOGGFØR ALLE AVLESTE TRYKK\n\n\nDERSOM N2 TRYKK ER FOR LAVT, FORETA LEKKTEST AV ACCUMULATOREN\nSOM FØLGENDE:\n\n1. STENG VENTILEN/VENTILER MELLOM AKKUMULATOR OG\n   HYDRAULIKKPUMPE/SYSTEM.\n\n2. DRENER AV TRYKKET MELLOM AVSTENGINGSVENTIL OG\n   AKKUMULATOR.\n\n3. DEMONTER HYDRAULIKKRØRET MELLOM AKKUMULATOR OG STENGE-\n   VENTIL, DERSOM TESTVENTILER IKKE ER MONTERT. LEKKASJE FRA\n   HYDRAULIKKSIDEN MÅ UTELUKKES.\n\n4. MONTER, VANNSØYLE ELLER TEST BALLONG PÅ AKKUMULATORENS\n   HYDRAULIKKTILKOBLING.\n\n5. SETT LADETRYKKET SOM FORESKREVET I INSTRUKSJONSMANUALEN.\n   PÅ AKKUMULATORER MED INDIKATOR, KONTROLLERES AT STEMPELET\n   ER HELT NEDE.\n\n6. KONTROLLER FOR UTVENDIG LEKKASJE PÅ N2 SYSTEM, BRUK SÅPEVANN.\n   PÅ RØR OG FORBINDELSER.\n\n7. KONTROLLER EVENTUELL INNVENDIG LEKKASJE PR./TIDSENHET, VED\n   Å SJEKKE ENDRING I VANNSØYLE ELLER BALLONG.\n\n   VED EVENTUELL LEKKASJE TREFFES KORREKTIVE TILTAK.\n\n\n\n\nKONTR. LADETRYKK AV HYDR. AKKUMULATORER','','','','',NULL,NULL,'1','H4','0017528836','00000000','','00000','','8.0','H',' ',' ','8.0','H','0.000','2018-10-09 08:30:00.0000000','PT08H30M00S','2018-10-09 16:30:00.0000000','PT16H30M00S','2018-10-09 08:30:00.0000000','PT08H30M00S','2018-10-09 16:30:00.0000000','PT16H30M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24483438','1005004501','','OR000024483438','1766-S2901B');
