insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005014772','OV100501477200000001','00000001','9','0010','Operation Finally Confirmed (CNF)','PM01','','10007465','POMAUT','','','01M Kontroll av navigasjonsutstyr Livbåt','01M Kontroll av navigasjonsutstyr Livbåt\n\n9 TESTPROSEDYRE  NORSK OVERSETTELSE\nFor å verifisere systemets operabilitet foreslår Scanmatic at\nLNA-systemet testes\njevnlig i henhold til testprosedyrene som blir beskrevet i dette\nkapitlet.\nHvis feil oppdages under testprosedyrene, sjekk systemet for løse\nkonnektorer og\nkabelbrudd.\nDersom ingen løsning blir funnet; kontakt Scanmatic.\n\n9.1 Rutinetesting  ukentlig intervall\n\n9.1.1 LNA hovedenhet og LNA retningsdisplay\nMotivasjon:\n- En enkel sjekk for å verifisere at systemet starter opp som forventet.\nForutsetninger:\n- Den relevante strømkursen må være på (vanligvis «lysbryteren» ved\nlivbåtens inngangsdør).\n\nTest:\n\n1. Når LNA hovedenheten får strøm startes en initialiseringsprosess.\nDette vises på LNA retningsdisplayet ved blinking av LED-lysene.\n\na.\nFørst lyser en etter en av de ytre LED-lysene opp, spaserende mot\nklokken i 8 sekunder.\n\nb.\nDen venstre og høyre pilen veksler deretter på å lyse i 8 sekunder\nog deretter lyser pilen rett frem.\n\nc.\nPilen rett frem skal lyse og forbli i den samme posisjonen så lenge\net dropp/sjøsetting ikke er registrert.\n\n\n9.1.2 Verifikasjon av gyrokalibrering\nMotivasjon:\n- En sjekk av gyroens kalibreringsparametre10\nForutsetninger:\n- LNA hovedenheten og LNA retningsdisplayet er i normaltilstanden\netter oppstart.\n- Livbåtens retning bør være mer eller mindre konstant under testen for\nat det skal være mulig å skille en signifikant gyrodrift fra en faktisk\nrotasjon av livbåten.\n\nTest:\n1. Trykk og hold «Test»-knappen («Lock Direction»-knappen på\nlårelivbåter) i 5 sekunder (til pilen rett frem lyser igjen), deretter\nslipp knappen. Dette simulerer et dropp/sjøsetting.\n\na.\n«Direction Locked»-LEDen lyser grønt for å indikere at et\ndropp/sjøsetting er initiert.\n\nb.\nNoter den initielle posisjonen på LED-lyset som indikerer trygg\nrømningsretning.\n\n2.\nObserver retningsavviket når LED-lysene begynner å blinke etter 9\nminutter. Gitt at livbåtens kurs ikke har endret seg, bør ikke den\nindikerte retningen ha flyttet seg mer enn «en prikk» fra den\nopprinnelige startposisjonen.\n\na.\nHvis driften er større enn dette (mao. to prikker eller mer) anbefales\ndet at gyroen rekalibreres. Se kapittel 10.1.1.\n\n3. Trykk og hold «Test»-knappen («Lock Direction»-knappen på\nlårelivbåter) i\n16 sekunder; til fire LED-lys lyser, to på hver side. Deretter slipp\nknappen.\nDette vil resette LNA hovedenheten og klargjøre den for «black box\nflight\nrecorder»-logging.\na.\nDisplayet kan nå være blinkende. Dette normaliseres etter en\ntoggling av den relevante strømbryteren.\n\n\n10 VEDLIKEHOLD  NORSK OVERSETTELSE\n\n10.1 LNA hovedenhet og LNA retningsdisplay\nSiden det ikke er noen bevegelige deler i disse enhetene vil slitasje\nkun oppstå i kontakt med annet utstyr eller personell. Periodisk\nvedlikehold er derfor ikke nødvendig. Det er imidlertid anbefalt at\nsystemet årlig blir undersøkt for skade på kabler og at kontakter sitter\nskikkelig.\nUtstyret har IP-grad 56. Det betyr at det tåler vannsprut men bør ikke\nvære i kontinuerlig kontakt med vann.\n\n10.1.1 Gyro-kalibrering\nTreghetssensoren i LNA hovedenheten blir kalibrert av Scanmatic før\nleveranse.\nDenne kalibreringsprosessen måler gyroens offset-faktorer (bias) over en\n90 sekunders periode hvor enheten ligger helt i ro.\nTreghetssensoren vil imidlertid over tid kunne endre seg slik at de\nprogrammerte offset-faktorene ikke lenger er korrekte. Derfor anbefales\nen jevnlig sjekk av validiteten til kalibreringen ved å observere drift\ni retningsanvisningen ved et simulert dropp/sjøsetting. Denne\ntestprosedyren er beskrevet i kapittel\n9.1.2.\nSiden LNA-systemet er et nyttt produkt i offshore-markedet anbefales det\nat denne verrifiseringen foretas ukentlig (eller hver 14. dag). Dersom\ndet etter en lengre tid med testing (f.eks. ett år) viser seg at\nre-kalibrering veldig sjeldent må utføres, kan test-intervallet endres\ntil hver måned.\nDenne prosedyren forutsetter at enheten er i ro, uten å rotere rundt\nnoen akser.\nDet vil si at det forutsettes at re-kalibrering utføres under gode\nværforhold på\nflyterigger og helst når skip er i havn.\nGyro-kalibreringsprosedyre:\nForutsetninger:\n- Prosedyren kan kun utføres dersom livbåten ikke er i bevegelse.\n- LNA hovedenheten og LNA retningsdisplayet er i normaltilstanden\netter oppstart.\nTest:\n\n1. Hold nede «AES ON/OFF»-knappen på LNA retningsdisplayet i 12\nsekunder, til den høyre pilen er på linje med den ytre LEDen «klokken\ntre», og slipp knappen. Pilen spretter tilbake til rett frem og\ningenting\nannet synlig skjer.\n\n2. Etter 90 sekunder vil nye kalibreringsfaktorer lagres og LNA\nhovedenheten restartes. Dette vises på vanlig vis ved at LED-lysene\nvandrer på LNA retningsdisplayet.\n\n3. Gjenta testen i kapittel 1 for å verifisere de nye offset-faktorene.','','','','',NULL,NULL,'1','H4','0017559503','00000002','','00000','','5.0','H',' ',' ','5.0','H','5.000','2018-10-19 07:00:00.0000000','PT07H00M00S','2018-10-19 12:00:00.0000000','PT12H00M00S','2018-10-19 07:00:00.0000000','PT07H00M00S','2018-10-19 12:00:00.0000000','PT12H00M00S','2018-10-05 10:47:01.0000000','PT10H47M01S','2018-10-05 10:47:04.0000000','PT10H47M04S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','5.0','1','','','','',NULL,NULL,'24493669','1005014772','','OR000024493669','1766-76');
