insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005016829','OV100501682900000001','00000001',' ','0110','','PM01','','10007530','POMPRO','','','01M - OMRÅDEBASERT LEKK.SØKING W-OMR.','01M - OMRÅDEBASERT LEKK.SØKING W-OMR.\n\n\n---------------------------------------\nOMRÅDEBASERT LEKKASJESØKING FOR W-OMRÅDET (BRØNNOMRÅDET)\n\nLEKKASJETEST UTFØRES I OMRÅDER BESKREVET I VEDLEGG SOM OPPBEVARES\nI PERM PÅ DRIFTLEDERKONTOR.\n\nDET SKAL "SNIFFES" MED RIKEN GASSMÅLER ELLER TILSVARENDE<(>,<)>\nSAMTIDIG SOM MAN SER, LYTTER OG LUKTER.\nSPESIELL OPPMERKSOMHET RETTES MOT: INSTRUMENTERING, PAKKBOKSER<(>,<)>\nVENTILER OG PLUGGER PÅ VENTILER.\nI UTGANGSPUNKTET SKAL DET IKKE "SNIFFES" INNE I ISOLASJON, MED MINDRE\nDET OPPDAGES GASS I AKTUELT OMRÅDE.\nVED PÅVISNING AV GASSLEKKASJE, SKAL DENNE IDENTIFISERES OG REGISTRERES\nSOM EN HENDELSE I "SYNERGI".\nI BESKRIVELSEN PÅ HENDELSESRAPPORTEN SKAL ORDLYDEN "OMRÅDEBASERT\nLEKKASJESØKING" FREMKOMME.\n\nWORKORDERS LEGGES INN FOR UTBEDRING AV LEKKASJE DER DETTE ER VURDERT\nNØDVENDIG. WO NUMMER SKRIVES INN PÅ HISTORIKKEN FØR MALEN FORELØPIG\nFERDIGMELDES.\n\nRUTINER FOR SKIFTFORMANN:\nFØR FV-MAL FOR OMRÅDEBASERT LEKKASJESØKING FERDIGMELDES, SKAL FA\nSJEKKE OM DER ER REGISTRERT WO MOT GASSLEKKASJE BASERT PÅ FV-MAL.\n\n\nSPESIELT FOR PAKKBOKSER:\n------------------------\nHER ER DET AKSEPTERT EN BEGRENSET LEKKASJE SLIK AT FUNN INNENFOR DET\nSOM ER "NORMALT" IKKE SKAL RAPPORTERES.\n','','','','',NULL,NULL,'1','H4','0017566194','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-10 07:00:00.0000000','PT07H00M00S','2018-10-10 09:00:00.0000000','PT09H00M00S','2018-10-10 07:00:00.0000000','PT07H00M00S','2018-10-10 09:00:00.0000000','PT09H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24495706','1005016829','','OR000024495706','1766-13');
