insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005016876','OV100501687600000004','00000004',' ','1202','','PM01','','10007513','POMMEC','','','12M Kontr. ladetrykk membranakkumulator','12M Kontr. ladetrykk membranakkumulator\n\n\nIsoler akkumulatoren fra systemet og reduser væsketrykket til null\nvia drainventil.\nFjern beskyttelsesmoffen fra testpunktet og monter kontrollutstyr\ni henhold til utstyrsspesifikasjon.\nKontroller at forladetrykket er korrekt. Ved avvik justeres\ntrykket i henhold til prosedyre for utstyret.\nDemonter kontrollutstyr og klargjør akkumulatoren for service.\nLoggfør avleste trykk.\n','','','','',NULL,NULL,'1','H4','0017566369','00000000','','00000','','3.0','H',' ',' ','3.0','H','0.000','2018-10-10 13:00:00.0000000','PT13H00M00S','2018-10-10 16:00:00.0000000','PT16H00M00S','2018-10-10 13:00:00.0000000','PT13H00M00S','2018-10-10 16:00:00.0000000','PT16H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24495753','1005016876','','OR000024495753','1766-S4215');
