insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005016877','OV100501687700000002','00000002',' ','1201','','PM01','','10007513','POMMEC','1766-U','Utstyrsstopp','12M Bytte filter hydraul. Kontrollenhet','12M Bytte filter hydraul. Kontrollenhet\n\nBYTTE FILTER På HYDRAULISK KONTROLLENHET\nME0144\n\n1. STENG VENTILEN TIL AKKUMULATOR, HVIS RELEVANT.\n\n2. KONTROLLER FORLADETRYKKM PÅ AKKUMULATOR, HVIS RELEVANT.\n\n3. STENG HYDRAULISK SUPPLY OG RETUR.\n\n4. VENTILER HYDRAULIKKOLJE GJENNOM VENTILASJONSVENTILEN På MANOMETERET.\n\n   OBS !! VæR FORSIKTIG ! åPNE FORSIKTIG, OG STENG DERSOM DET KOMMER\n          MYE OLJE, I Så FALL: AVSLUTT ARBEIDET: STENG\n          VENTILASJONSVENTILEN, åPNE SUPPLY OG RETUR, SKRIV\n          KORREKTIV ARBEIDSORDRE På REPERASJON.\n\n5. SJEKK MANOMETERET OG FORSIKRE DEG OM AT FILTERET ER TRYKKLøST.\n\n6. åPNE FILTER, RENGJøR FILTERHUS OG FILTERSKåL, BYTT FILTERELEMENT OG\n   O-RINGER, SETT SAMMEN FILTER.\n\n7. åPNE VENTILASJONSVENTILEN På MANOMETERET.\n\n8. åPNE HYDRAULIKKSUPPLY-VENTILEN FORSIKTIG !!\n   LUFT GJENNOM VENTILASJONSVENTILEN På MANOMETERET.\n\n9. STENG VENTILASJONSVENTILEN På MANOMETERET.\n\n10.åPNE SUPPLY, RETUR OG VENTIL TIL AKKUMULATOR.','','','','',NULL,NULL,'1','H4','0017566372','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-10 08:00:00.0000000','PT08H00M00S','2018-10-10 09:00:00.0000000','PT09H00M00S','2018-10-10 08:00:00.0000000','PT08H00M00S','2018-10-10 09:00:00.0000000','PT09H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24495754','1005016877','','OR000024495754','1766-S4213');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005016877','OV100501687700000003','00000003',' ','1202','','PM01','','10007513','POMMEC','','','12M Oljeskift på doseringspumpe','12M Oljeskift på doseringspumpe\n\nOLJESKIFT\nME0029\n\n1.0  OLJESKIFT\n\n     SKIFTE AV IDENSTISKE OLJER. DERSOM DET SKAL SKIFTES\n     OLJETYPE GJELDER SPESIELLE RUTINER.\n     OLJESKIFT IVERSETTES IHHT. PERIODISKE FV MALER ELLER PÅ\n     BAKGRUNN AV AVVIK IDENTIFISERT I OLJEANALYSER.\n\n1.1  DERSOM OLJEPRØVE SKAL TAS, SKAL DETTE GJØRES FØR\n     DRENERING OG IHHT GJELDENDE RUTINE, ME0027.\n\n1.2  BENYTT KORREKT SIKKERHETSUTSTYR.\n\n1.3  VED OLJESKIFT PÅ GIR BØR OLJEN SKIFTES ETTER OLJESYSTEMET\n     ER VARMKJØRT TIL NORMAL DRIFTSTEMPERATUR. FOR AT ANNET\n     UTSTYR KAN OLJEN SKIFTES UTEN VARMKJØRING.\n\n1.4  DRENER BRUKT OLJE FRA LAVESTE PUNKT I SYSTEMET. NORMALT\n     SKAL DETTE VÆRE FRA BUNNPLUGG I TANK, EVT. VED HJELP AV\n     EGEN PUMPE.\n\n1.5  NÅR DET ER MONTERT MAGNETPLUGGER I SUMPEN/TANKEN, SKAL\n     DISSE TAS UT OG KONTROLLERES. PARTIKLER SOM OPPDAGES\n     SKAL SENDES TIL ANALYSE.\n\n1.6  FØR PÅFYLLING AV NY OLJE SKAL OLJESUMPEN/SYSTEMTANKEN\n     RENGJØRES INNVENDIG (NÅR OLJEN ER MEGET FORURENSET). TANKEN\n     BØR RENGJØRES MED VARM SYSTEMOLJE, F.EKS. VED BRUK AV EGET\n     FILTERAGGREGAT. SPYL FRA TOPP AV VEGGER NED MOT\n     TANKBUNN/SUMP.\n     DRENER TANKEN/SUMPEN OG TØRK OPP EVT. RESTER MED LOFRIE\n     FILLER. UNNGÅ ENTRING AV TANK. PÅSE AT FILLER IKKE BLIR\n     GJENGLEMT.\n\n1.7  KONTROLLER TANK/SUMP VISUELT INNDENDIG MED TANKE PÅ\n     FUNKSJONSMESSIGE DEFEKTER. ALLE FILTRENE SOM HAR VÆRT I\n     BRUK I SYSTEMET SKAL SKIFTES SAMTIDIG SOM OLJEN SKIFTES.\n     HUSK OGSÅ Å SKIFTE PUSTE-/PÅFYLLINGSFILTER.\n\n1.8  ALL NY OLJE SKAL FILTERES INN PÅ TANK/SUMP. DETTE KAN\n     GJØRES VHA. EGET FILTAGGREGAT, ELLER VIA SYSTEMETS EGET\n     RETURFILTER. FILTERAGGTREGATET MÅ VÆRE BRUKT TIL SAMME\n     OLJETYPE, EVT. RENGJØRES FØR BRUK.\n     OBS!  VED FYLLING GJENNOM EGET PÅFYLLINGSFILTER MÅ DET\n           KONTROLLERES AT DETTE HAR TILSTREKKELIG FILTRERINGS-\n           GRAD (TILSVARENDE 3 MIKRON ABSOLUTT FILTRERING).\n\n1.9  FØR OPPSTART BØR FILTERAGGREGATET KOPLES TIL RESERVOAR OG\n     OMLØPSFILTRERING FORETAS. OPPSTART BØR IKKE FORETAS FØR\n     TILSTREKKELIG RENHET ER OPPNÅDD.\n\n1.10 TØRK OPP EVT. OLJESØL.\n\n1.11 OPPDATER DATABASE (SAP) MED VEDLIKEHOLDSHISTORIKK.\n','','','','',NULL,NULL,'1','H4','0017566373','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-10 09:00:00.0000000','PT09H00M00S','2018-10-10 11:00:00.0000000','PT11H00M00S','2018-10-10 09:00:00.0000000','PT09H00M00S','2018-10-10 11:00:00.0000000','PT11H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24495754','1005016877','','OR000024495754','1766-S4213');
