insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005016878','OV100501687800000001','00000001',' ','0600','','PM01','','10007465','POMAUT','','','06M Åpne/lukketest av brannspjeld D40','06M Åpne/lukketest av brannspjeld D40\n\n<U>Åpne/Lukketest av brannspjeld</>\n\nAktiviser brannspjeld ved å åpne/stenge spjeld fra SKR eller fra lokalt\ntestpanel.\n\nSviktdefinisjon/ Kravdefinisjon:\n-,,Dersom brannspjeld ikke lukker helt ved signal innen\n    spesifisert tid ved test.\n-,,Krav til lukketid er maksimum 3 sekund på 1. forsøk.\n\nSviktrapportering:\n-,,Enhver svikt oppdaget ved utførelse av FV-testing skal\n    rapporteres på en notifikasjon i SAP med følgende parametre:\no,,FunctLocation: Functional location (Tag) for brannspjeld\no,,Detect Mthd  :   2 - ''ISO Functional testing''\no,,Failure Mode :   FTC - ''ISO Failure to close on demand''\no,,Failure Impact:  D  Dead eller S  Seriously ill\n\n-,,Rapportering utføres fra «Technical Feedback» under\n    folder «Enhancemnt» på arbeidsordre.\n\n\nNEW-PAGE PAGE\n\n<H>***************** FØLGENDE SKAL IKKE UTFØRES *********************</>\n\n<H>«Arbeidsbeskrivelsen under refererer til opprinnelig HVAC-konsept\nDA0300 eller DA0310 «Funksjonstest 1 HVAC spjeld». Det skal ikke\nutføres, men er kun for informasjon.»</>\n\n\nDA0300-0005 <H>Funksjonstest 1 HVAC B<(>&<)>G spjeld</>\n\nFormål:\nVed testing verifisere om spjeldet møter kravet til lukketid.\n\nMerk: Vurder om vifte/varmebatteri må stanses under denne\n      funksjonstesten.\n\n1. Lukk spjeld fra lokal testventil/testbryter, eller eventuelt\n   fra kontrollsystemet der hvor man ikke har installert lokal\n   testventil/testbryter.\n\n2. Verifiser at spjeld går til stengt posisjon via skjerm/panel\n   eller indikatorpil, og mål lukketiden.\n   Sammenlign lukketid med krav:\n   - For spjeld i luftinntak og luftavkast skal lukketid være\n     maks 3 sekunder på 1. forsøk.\n   - For øvrige spjeld skal lukketid være maks 6 sekunder\n     på 1. forsøk.\n\n3. Sjekk via indikatorpil at spjeldblad er i åpen posisjon.\n\n4. Dersom krav til lukketid ikke er oppnådd:\n   - Rapporter i SAP på notifikasjon.\n   - Kontroller mot historikk om utskifting eller overhaling er\n     nødvendig.\n   - Kjør åpne-lukke sekvens 3 ganger etter funksjonstest.\n   - Resett eventuelle signaler i kontrollsystem.\n\nSviktdefinisjon:\nSpjeldet møter ikke kravet til lukketid.\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017566375','00000000','','00000','','3.0','H',' ',' ','6.0','H','0.000','2018-10-14 07:00:00.0000000','PT07H00M00S','2018-10-14 10:00:00.0000000','PT10H00M00S','2018-10-14 07:00:00.0000000','PT07H00M00S','2018-10-14 10:00:00.0000000','PT10H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24495755','1005016878','','OR000024495755','1766-S7702');
