insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005016879','OV100501687900000001','00000001',' ','0301','','PM01','','10007513','POMMEC','','','03M - KONTROLL AV PUSTELUFTSKVALITET','03M - KONTROLL AV PUSTELUFTSKVALITET\n\n\n1)kontroller pusteluftkval.med målepatroner som oppbevares i koffert so\nstår i brannstasjon\n1. SJEKK TEMPERATUR ... GRADER. OG LUFTFUKTIGHET ...%\n\n*2. KONTROLLER LUFTKVALITETEN FOR FØLGENDE FORURENSNINGER:\n    KARBONMONOKSYD (CO)    10...PPM\n    KARBONDIOKSYD  (CO2)   500..PPM\n    OLJE                   1....MG/KUBIKKMETER\n    VANNDAMP (H2O)         30...MG/KUBIKKMETER\nO2-INNHOLD SKAL VÆRE        21%  +/-0,5%\n\n    MåLINGENE Må IKKE OVERSKRIDE DE VERDIER SOM ARBEIDSTILSYNETS\nFORSKRIFTER  NR.441 SETTER SOM ØVRE GRENSE.\n\n    KONTROLLEN UTFØRES ETTER "DREAGER''S BRUKSANVISNINGER":\n\n    CO            = NR.6728511\n    CO2           = NR.6728521\n    VANNDAMP      = NR.8103061\n    OLJE          = NR.CH28371\n\n2)kontroller at triplex cartrige (oljeutskiller)er skiftet skal skiftes\netter 65 flaskefyllinger (se log bok i brannstasjon)matr.nr.på filter\n3000152165 o-ringer 3000139903 + 3000139902\nkontroller at logføringsbok for vedlikehold er korekt utfylt\n\n3)Kontroler sm.olje nivå på kompressor og visuell kontroll av slanger\n\n4)kontroll av ryddighet rundt kompressor og kompressorhus\n\n','','','','',NULL,NULL,'1','H4','0017566380','0000000