insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005016879','OV100501687900000002','00000002',' ','1201','','PM01','','10007513','POMMEC','1766-U','Utstyrsstopp','12M - KONTROLL/OLJESKIFT PUSTELUFTKOMPR.','12M - KONTROLL/OLJESKIFT PUSTELUFTKOMPR.\n\n\n1) skift luftinntaksfilter med o-ring matr.nr.3000097250\n\n2) ta ut og såpevask filter i vanntskiller mellom 2 og 3 trinn\n\n3) skift olje matr. nr.3000239915 kapasitet 1,4 liter\n   (Viktig å ikke ha for mye olje på kompressor da brennes ventilene)\n\netter 65 flaskefyllinger (300 bar) skal Triplex cartrige filter\n   (Oljeutskiller filter)skiftes matr.nr.3000152165 +o-ringer matr.nr\n    3000139903 og 3000139903 se side 165/166 instr..manual 06007\n\n4)Kontroller at loggføringsbok for vedlikehold er korekt utfylt\n  Er du i tvil om pusteluftfilter bør skiftes eller ikke,foreta en\nlufttest,eller mål vekten på filteret.Vekt på mettet filter står på\nfilteret(ca 190g)\n\n5)Skru ratt på sikkerhetsventil halveis ned for funksjonstest.når venti\nblåser kan ratt åpnes til full stilling.Dette er kun en funksjonstest\n,IKKE trykket sikkerhetsventilen normalt blåser på.\n','','','','',NULL,NULL,'1','H4','0017566381','00000000','','00000','','3.0','H',' ',' ','3.0','H','0.000','2018-10-15 10:00:00.0000000','PT10H00M00S','2018-10-15 13:00:00.0000000','PT13H00M00S','2018-10-15 10:00:00.0000000','PT10H00M00S','2018-10-15 13:00:00.0000000'