 i SAP.\nTransaksjon i SAP : CV04N\nDokument :          1955874\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017582301','00000000','','00000','','10.0','H',' ',' ','10.0','H','0.000','2018-10-19 07:00:00.0000000','PT07H00M00S','2018-10-19 17:00:00.0000000','PT17H00M00S','2018-10-19 07:00:00.0000000','PT07H00M00S','2018-10-19 17:00:00.0000000','PT17H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24500705','1005021868','','OR000024500705','1766-70');
