insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005021872','OV100502187200000001','00000001',' ','1201','','PM01','','10007513','POMMEC','1766-U','Utstyrsstopp','Oljeskift raw diesel pump PA620004','Oljeskift raw diesel pump PA620004\n\nOLJESKIFT\nME0029\n\n1.0  OLJESKIFT\n\n     SKIFTE AV IDENSTISKE OLJER. DERSOM DET SKAL SKIFTES\n     OLJETYPE GJELDER SPESIELLE RUTINER.\n     OLJESKIFT IVERSETTES IHHT. PERIODISKE FV MALER ELLER PÅ\n     BAKGRUNN AV AVVIK IDENTIFISERT I OLJEANALYSER.\n\n1.1  DERSOM OLJEPRØVE SKAL TAS, SKAL DETTE GJØRES FØR\n     DRENERING OG IHHT GJELDENDE RUTINE, ME0027.\n\n1.2  BENYTT KORREKT SIKKERHETSUTSTYR.\n\n1.3  VED OLJESKIFT PÅ GIR BØR OLJEN SKIFTES ETTER OLJESYSTEMET\n     ER VARMKJØRT TIL NORMAL DRIFTSTEMPERATUR. FOR AT ANNET\n     UTSTYR KAN OLJEN SKIFTES UTEN VARMKJØRING.\n\n1.4  DRENER BRUKT OLJE FRA LAVESTE PUNKT I SYSTEMET. NORMALT\n     SKAL DETTE VÆRE FRA BUNNPLUGG I TANK, EVT. VED HJELP AV\n     EGEN PUMPE.\n\n1.5  NÅR DET ER MONTERT MAGNETPLUGGER I SUMPEN/TANKEN, SKAL\n     DISSE TAS UT OG KONTROLLERES. PARTIKLER SOM OPPDAGES\n     SKAL SENDES TIL ANALYSE.\n\n1.6  FØR PÅFYLLING AV NY OLJE SKAL OLJESUMPEN/SYSTEMTANKEN\n     RENGJØRES INNVENDIG (NÅR OLJEN ER MEGET FORURENSET). TANKEN\n     BØR RENGJØRES MED VARM SYSTEMOLJE, F.EKS. VED BRUK AV EGET\n     FILTERAGGREGAT. SPYL FRA TOPP AV VEGGER NED MOT\n     TANKBUNN/SUMP.\n     DRENER TANKEN/SUMPEN OG TØRK OPP EVT. RESTER MED LOFRIE\n     FILLER. UNNGÅ ENTRING AV TANK. PÅSE AT FILLER IKKE BLIR\n     GJENGLEMT.\n\n1.7  KONTROLLER TANK/SUMP VISUELT INNDENDIG MED TANKE PÅ\n     FUNKSJONSMESSIGE DEFEKTER. ALLE FILTRENE SOM HAR VÆRT I\n     BRUK I SYSTEMET SKAL SKIFTES SAMTIDIG SOM OLJEN SKIFTES.\n     HUSK OGSÅ Å SKIFTE PUSTE-/PÅFYLLINGSFILTER.\n\n1.8  ALL NY OLJE SKAL FILTERES INN PÅ TANK/SUMP. DETTE KAN\n     GJØRES VHA. EGET FILTAGGREGAT, ELLER VIA SYSTEMETS EGET\n     RETURFILTER. FILTERAGGTREGATET MÅ VÆRE BRUKT TIL SAMME\n     OLJETYPE, EVT. RENGJØRES FØR BRUK.\n     OBS!  VED FYLLING GJENNOM EGET PÅFYLLINGSFILTER MÅ DET\n           KONTROLLERES AT DETTE HAR TILSTREKKELIG FILTRERINGS-\n           GRAD (TILSVARENDE 3 MIKRON ABSOLUTT FILTRERING).\n\n1.9  FØR OPPSTART BØR FILTERAGGREGATET KOPLES TIL RESERVOAR OG\n     OMLØPSFILTRERING FORETAS. OPPSTART BØR IKKE FORETAS FØR\n     TILSTREKKELIG RENHET ER OPPNÅDD.\n\n1.10 TØRK OPP EVT. OLJESØL.\n\n1.11 OPPDATER DATABASE (SAP) MED VEDLIKEHOLDSHISTORIKK.\n','','','','',NULL,NULL,'1','H4','0017582310','00000001','','00000','','2.0','H',' ',' ','2.0','H','4.000','2018-10-19 07:00:00.0000000','PT07H00M00S','2018-10-19 09:00:00.0000000','PT09H00M00S','2018-10-19 07:00:00.0000000','PT07H00M00S','2018-10-19 09:00:00.0000000','PT09H00M00S','2018-10-12 10:39:16.0000000','PT10H39M16S','2018-10-12 10:39:16.0000000','PT10H39M16S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','4.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24500709','1005021872','','OR000024500709','1766-S6201');
