IKK På\n    STREKKAVLASTNING BØYERADIUS, SKARPE KANTER OG SKADE PÅ\n    ISOLASJONEN.\n\n3.2 KONTROLLER AT KABELMERKINGEN ER PÅ PLASS OG AT DEN ER\n    LESELIG.\n\n3.3 KONTROLLER AT LOKKENE På KABELKANALENE ER PÅ PLASS.\n\n3.4 KONTROLLER AT BERØRINGSBESKYTTELSE ER PÅ PLASS\n    (OVER TILKOBLINGER FOR INN- OG UTGÅENDE KABLER<(>,<)>\n    INSTRUMENTER, ETC.).\n\n4.1 SJEKK TILKOBLINGER (VISUELT).INGEN ETTERTREKKING AV\n    TILKOBLINGER BORTSETT FRA VED 1. GANGS FV.','','','','',NULL,NULL,'1','H4','0017582311','00000001','','00000','','1.0','H',' ',' ','1.0','H','3.000','2018-10-19 09:00:00.0000000','PT09H00M00S','2018-10-19 10:00:00.0000000','PT10H00M00S','2018-10-19 09:00:00.0000000','PT09H00M00S','2018-10-19 10:00:00.0000000','PT10H00M00S','2018-10-12 11:21:28.0000000','PT11H21M28S','2018-10-12 11:21:28.0000000','PT11H21M28S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','3.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24500709','1005021872','','OR000024500709','1766-S6201');
