insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005021875','OV100502187500000001','00000001',' ','0101','','PM01','','10007475','POMELE','','','Kontroll av navigasjonsutstyr','Kontroll av navigasjonsutstyr\n\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>Sentral batteribank</>\nTittel   : UPS nødlys og navigasjon\n\n\n\nA) DEFINISJON AV KOMPONENTSVIKT\nUPS opprettholder ikke avbruddsfri strømforsyning ved utfall av\nhovedkraft, og/eller batteriene har ikke nødvendig kapasitet for\nå opprettholde strømforsyningen i foreskreven tid.\nKrav: minimum 30 min.\n\nB) ARBEIDSBESKRIVELSE FOR TEST/MÅLING AV KOMPONENTSVIKT\n1.,,Funksjonstest UPS''en ved å koble ut tilførsel til likeretter\n2.,,Utfør kapasitetstest iht foreskreven rutine for batteriet.\n\nC) ETTER UTFØRT TEST:\n\n1.,,UPS kobles tilbake til normal driftsposisjon.\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for batteribank\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>FOV</> - ''ISO Faulty output voltage''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.\n\n1M - Kontr. av navigasjonslys og tåkelur\n\nOS0041\n\nDokument      : OSS-1MND-KONTROLL-NAVAID\nType          : Arbeidsbeskrivelse\nTittel        : KONTROLL AV NAVIGASJONSLYS OG TÅKELUR\n\nBrukermanual: PO nr:  11-3A-KE-B34-04007\n(Perm nr. 165 i dokumentsenter.)\n1 mnd. kontroll kan utføres på grønn arbeidstillatelse  ved feil\npå utstyr ute må rød benyttes.\n\n1  KONTROLL AV NAVIGASJONSLYS\n\nRef. Tegn. Nr: 11-3AK-E56-00001 og Perm nr 41 i "Arkiv høyspentrom".\n\n\n1.1 Gjør en funksjonskontroll av navigasjonslys  samt visuell kontroll i\nfelt. Kontroller for vanninntrenging og mekanisk brekkasje. Kontroller\nfesteanordninger for enhetene og klemmeanordninger for sammenkobling av\nlanternenes enkelte deler. Utbedre eventuelle mangler.\n\n1.2 Kontroller at alle lampeglass og lyskilder er operative  rene og\nuten skader.\nUtbedre eventuelle skader  skift eventelt utbrente lyskilder\nog reingjør lampeglass innvendig/utvendig om nødvendig.\n\n1.3 Kontroller at lanternene blinker med riktig kode. Dette er\ninternasjonalt morsetegn "U".\n(to korte  en lang) sekvensen gjentas med 15 sekunders mellomrom.\n\n1.4 Sjekk ved hjelp av "vaterlibellen" at lanternene er montert i rett\nplan både på hoved og sekundærlyset. Reguler om nødvendig.\n\n1.5 Sjekk ved hjelp av fokuseringsmerkene på linseglasset at lanterne-\nlampen er riktig montert. (Hold f. eks et hvitt papir bak det utvendige\nfokusmerket formet som et kryss. Titt inn i lanternen fra motsatt side.\nHer er fokusmerket en ring. Krysset skal sees midt inne i ringen og\nsamtidig skal glødetråden i lampen være i plan med "linjen" mellom\nkrysset og ringen. Juster lampen om nødvendig.)\n\n\n2  KONTROLL AV TÅKELUR\nRef. Tegn. Nr: 11-3-AK-E56-0001 og Perm nr. 41 i "Arkiv høyspentrom."\nFunksjonstesten kan aktiveres i EC-85-0003 (SKR) eller i lokalt panel\nEC-85-0002 (prosess tavlerom C12).\n\n2.1 Gjør en funksjonskontroll av tåkelur  samt visuell kontroll i felt.\nKontroller for mekanisk brekkasje. Kontroller festeanordninger og\nutbedre eventuelle feil.\n\n2.2 Kontroller at tåkelurene sender ut riktig kodet lydsignal. Dette\nskal være internasjonalt morsetegn "U" (to korte  en lang) sekvensen\nskal gjentas med 30 sekunders mellomrom.\nTest må gjøres etter klokken.1700  og etter avtale med SKR.\n\n\n3  KONTROLL AV BATTERILADER OG LOKALE PANEL\n\n3.1 Sjekk at kontrollpanel EC-85-0001 (prosesstavlerom C12) og ORGA\nbatterilader ikke ligger med alarmtilstand.\n\n3.2 Aktiviser lampetest på sentralt kontrollpanel EC-85-0001\n(prosesstav lerom C12) og  fjernkontrollpanel EC-85-003\nfor å sjekke at alle signallys fungerer.\nBryter "Lanterns on/off/auto" settes til "on" for å få tent lanternene\ni dagslys. En kan også beholde bryteren i "auto" og tildekke fotocellen.\nDa får man også testet denne. Fotocellen (EH-85-0050) er plassert ved\ntåkelur og lanterne på plattformens sørvestre hjørne.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n','','','','',NULL,NULL,'1','H4','0017582316','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-21 07:00:00.0000000','PT07H00M00S','2018-10-21 08:00:00.0000000','PT08H00M00S','2018-10-21 07:00:00.0000000','PT07H00M00S','2018-10-21 08:00:00.0000000','PT08H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24500712','1005021875','','OR000024500712','1766-S8504');
