insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005021877','OV100502187700000001','00000001',' ','0601','','PM01','','10007497','POMLOG','','','Kontr.av brannhydr. og brann-/skumhydr.','Kontr.av brannhydr. og brann-/skumhydr.\n\n\nKobl opp test slange m/stråle munnstykke, åpn opp stenge ventil(er) i\nhydrantskap og spyl gjennom med brannvann inntil en ikke kjenner lukt\nfra H2S gass.\nSteng ventil(er) kobl fra test slange.\n\n\nKONTR. AV BRANNHYDR. OG BRANN-/SKUMHYDRA\nOS0019\n\n\n1. SJEKK AT SKAPET ER RYDDIG  RENT OG AT DET IKKE ER KORRODERT.\n\n2. HENGSLER OG LåSEANORDNINGER SMøRES OG BEVEGES SLIK AT DE\nGÅR LETT.\n\n3. SJEKK AT INSTRUKSJONER  MERKING OG ANNEN TEKST ER LESBAR\nBÅDE PÅ NORSK OG ENGELSK.\n\n4. SJEKK INNHOLDET I SKAPET.\n\n5. SJEKK BETJENINGSMEKANISMEN På STRåLEPISTOLEN VED å åPNE OG\nSTENGE 4-5 GANGER OG SJEKK REGULERINGEN AV MUNNSTYKKET.\n\n6. SJEKK AT LåSERINGEN I SLANGEKOBLINGEN IKKE ER IRRET FAST.\nSETT RINGENE INN MED SYREFRI VASELIN.\n\n7. SMØR ALLE KOBLINGER MED SYREFRI VASELIN\n\n8. SJEKK AT BRANNVANNSVENTILEN ER åPEN OG AT SKUMVENTILEN ER\nSTENGT.\n\n9. OPERER ALLE VENTILER. SMØR HVIS NøDVENDIG.\n\n10. SJEKK AT VARMEKABLENE VIRKER.\n\n11.FEIL ELLER MANGLER SOM ENKELT KAN UTBEDRES GJøRES  ANNET RAPPORTERES\nTIL OMRåDEANSVARLIG.','','','','',NULL,NULL,'1','H4','0017582320','00000000','','00000','','40.0','H',' ',' ','40.0','H','0.000','2018-10-18 07:00:00.0000000','PT07H00M00S','2018-10-22 12:20:00.0000000','PT12H20M00S','2018-10-18 07:00:00.0000000','PT07H00M00S','2018-10-22 12:20:00.0000000','PT12H20M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24500714','1005021877','','OR000024500714','1766-S7107');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005021878','OV100502187800000001','00000001',' ','0601','','PM01','','10007497','POMLOG','','','Kontroll av brannslangeskap','Kontroll av brannslangeskap\n\n\nÅpne stengeventil inn til slangetrommel.\nÅpne stråle munnstykke på slange, spyl gjennom slange inntil en ikke\nkjenner lukt fra H2S.\n(Dersom mulig strekkes slange ut fra inne områder, ellers benyttes\nsluk/bad/vask/bøtte, etc)\nSteng stengeventil inn til slangetromme.\nSteng stråle munnstykke.\nRull inn slange.\nTørk opp evnt. vannsøl i slangeskap.\n\n\n\nDokument : UUU-SIKSM01A-01A\nType     : STD    (Standardrutine)\nTittel   : KONTROLL AV BRANNSLANGE SKAP\n\n\n1. Hensikt\n\nHensikten med standardrutinen er å sikre  funksjonaliteten\ntilutstyret\n\n\n2. HMS avklaringer\n\nIngen\nIkke krav til arbeidstillatelse\nHusk info til områdeansvarlig\n\n\n3. Spesielle tiltak før arbeidet starter\n\nIngen spesielle.\n\n\n4. Beskrivelse av arbeidet\n\n1.  Sjekk at skapet er ryddig, rent og at det ikke er skadet\n    eller korrodert.\n2.  Hengsler og låseanordninger smøres og beveges slik at de går\n    lett.\n3.  Sjekk at instruksjoner, merking og annen tekst er leselig\n    både på Norsk og Engelsk.\n4.  Sving utslangetrommel og sjekk at trommelen sviver. Trekk ut\n    hele slangen og trykksett på følgende måte:\n    - Strålerør i åpen stilling.\n    - Åpne ventil til brannslange forsiktig slik at væskeplugg\n      unngås. (Dette kan føre til at trommel løsner fra svingarm)\n    - Sjekk betjeningsmekanismen på strålerør ved å åpne og stenge\n      4-5 ganger, og sjekk reguleringen av munnstykket.\n5.  Kontroller at strålerør dyse er fri for fremmedlegeme, og\n    turbin (hvis slik finnes) er ubeskadiget og roterer.\n6.  Smør opp trommel og strålerør slik at de går lett. (syrefri\n    vaselin).\n7.  Kontroller at slangen er ubeskadiget, fri for sprekker, og\n    kontroller for lekkasjer.\n8.  Ved innrulling av slangen må strålerør stå åpen slik at\n    vannet blir drenert ut.\n9.  Sjekk at varmekabler virker.(hvis slik finnes).\n10. Sett på utfylt kontrolletikett, den skal ikke tildekke\n    orginaletiketter.\n11. Feil eller mangler som enkelt kan utbedres gjøres, annet\n    rapporteres til områdeansvarlig.\n12. Lag en korrektiv notifikasjon ved behov for utbedringer.\n\n\n5. Tilbakestilling\n\nIngen spesielle\n\n\n6. Oppdatering / erfaringsoverføring\n\nTeknisk historikk i SAP\nOm nødvendig\nOppdatering av standardrutinen\nKONTROLL AV BRANNSLANGE SKAP','','','','',NULL,NULL,'1','H4','0017582321','00000000','','00000','','47.0','H',' ',' ','47.0','H','0.000','2018-10-18 07:00:00.0000000','PT07H00M00S','2018-10-23 09:40:00.0000000','PT09H40M00S','2018-10-18 07:00:00.0000000','PT07H00M00S','2018-10-23 09:40:00.0000000','PT09H40M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24500715','1005021878','','OR000024500715','1766-S7107');
