insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005050909','OV100505090900000007','00000007',' ','0070','','PM01','','10007303','C02AUT','1766-R','Revisjonstans','Montere hydraulikk','Montere hydraulikk\nDet er bestillt inn komplett hook up sett med fittings og slanger fra\nFramo.\n\nSe vedlagte hook-up tegninger i kapittel 6:\n11-3A-AK-I60-05151-0001  Multibundle Protection Head\n11-3A-HM-I63-00021       XMT Hook-Up Hydraulic Supply and Return\n11-3A-HM-I63-00012       XMT Hook-Up ASV, SCSSV Hydr. (Brønn F02har ikke\nASV settelinje)\n\n\n01.,,Sikkerhetsdatablad for hydraulikkolje Mobil SHC 524\ner vedlagt i kapittel 6. Bruk egnet\n,,verneutstyr.\n\n02.,,Sjekk at systemet er trykkløst før arbeidet starter.\n,,Ta med bøtte og fille ved åpning av hydr. retur linje, her kan det\n,,komme en del ut.\n\n03.,,Slanger og tilkoblingspunkter er plugget for å være rene.\n,,Vær påpasselig ved installasjon for å ivareta renheten.\n,,Demonter blindplugger fra hydraulikkslanger og multibundle boks.\n\n04.,,Installer jumperslangene mellom multibundle boks og bulkheadplate\npå\n,,panel IP-13-0102B. Følgende slange kobles:\n,,\n,,TRSCSSV,,EV  -13-0961\n,,\n05.,,Installer nye slanger fra bulkheadplate på IP-13-0102B til exit\n,,blokk. Ta kontakt med boring / Cameron for rotasjons-skisse som\n,,bekrefter orientering av exit blokker for å sikre tilkobling til\n,,korrekt exit blokk.\n\n,,TRSCSSV,,EV  -13-0961\n,,\n,,Monter tag skilt for nåleventil WN-13-0030 for TRSCSSV /SCSSV.\n,,\n\n,,Fyll ut MCCR\n','','','','',NULL,NULL,'1','X4','0017825395','00000000','','00000','','6.0','H',' ',' ','12.0','H','0.000','2018-10-15 16:33:48.0000000','PT16H33M48S','2018-10-16 10:33:48.0000000','PT10H33M48S','2018-10-15 16:33:48.0000000','PT16H33M48S','2018-10-16 10:33:48.0000000','PT10H33M48S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S','0.0','1','','','','',NULL,NULL,'24529410','1005050909','','OR000024529410','');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005050909','OV100505090900000008','00000008',' ','0080','','PM01','','10007303','C02AUT','1766-R','Revisjonstans','montere tubing','montere tubing\n\nTubing og fittings leveres med hook-up settene fra FRAMO.\nKapittel 6 inneholder alle hook-up tegninger.\n\n1.,,Monter SWAB trykkindikator PI -13-1968 på toppen av brønntreet.\n,,Se tegning 11-3A-HM-I63-00022. Heng på tag skiltet som ligger inne i\n,,koblingsboksen på treet.\n\n2.,,Annulus A, PIT-13-0962: Det skal monteres preisolert heattracet\n,,Hasteloy C tubing 6 meters lengder fra Teamtrade. Leggingen av denne\n,,kan gjøres i samarbeid med elektro i AO 24550960. Tubingen forlenges\n,,med deler fra hook up settet fra Framo. Heatrace kabel som fulgte\nmed den preisolerte tubingen skal være lang nok til at også denne kan,,\nforlenges.\n\n3.,,Annulus B, PIT-13-0964: Det skal monteres preisolert heattracet\n,,Hasteloy C tubing 6 meters lengde fra Teamtrade. Leggingen av denne\n,,kan gjøres i samarbeid med elektro i AO 24550960. Tubingen forlenges\n,,med deler fra hook up settet fra Framo. Heatrace kabel som fulgte\nmed den preisolerte tubingen skal være lang nok til at også denne kan,,\nforlenges.\n\n4.,,Annulus C, PIT-13-0965: Det skal monteres preisolert heattracet\n,,Hasteloy C tubing 6 meters lengde fra Teamtrade. Leggingen av denne\n,,kan gjøres i samarbeid med elektro i AO 24550960. Tubingen forlenges\n,,med deler fra hook up settet fra Framo. Heatrace kabel som fulgte\nmed den preisolerte tubingen skal være lang nok til at også denne kan,,\nforlenges.\n\n\n5.,,10 3/4" Seal port, PI-13-1971: Monter 316 impulstubing 12x2mm<(>,<)>\n,,ned til 10 3,4" seal port. Ihht tegning 11-3A-HM-I63-00036\n\n\n\nFyll ut MCCR.\n\n','','','','',NULL,NULL,'1','X4','0017825396','00000000','','00000','','30.0','H',' ',' ','60.0','H','0.000','2018-10-16 10:33:48.0000000','PT10H33M48S','2018-10-18 16:33:48.0000000','PT16H33M48S','2018-10-16 10:33:48.0000000','PT10H33M48S','2018-10-18 16:33:48.0000000','PT16H33M48S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S','0.0','1','','','','',NULL,NULL,'24529410','1005050909','','OR000024529410','');
