insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005055176','OV100505517600000006','00000006','9','0203','Operation Finally Confirmed (CNF)','PM01','','10007475','POMELE','','','02W Innfasing av nødgenerator A/B','02W Innfasing av nødgenerator A/B\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>NØDGENERATOR/Startfeil:</>\nTittel   : Innfasing av nødgenerator\n\n\nA) DEFINISJON AV KOMPONENTSVIKT\nGeneratoren leverer ikke spenning og effekt til akseptable verdier.\n\nB) ARBEIDSBESKRIVELSE FOR TEST/MÅLING AV KOMPONENTSVIKT\nInnfasing av nødgenerator utføres sammen med start av nødgenerator.\n1.,,Ifm. annenhver startrutine skal generatoren fases inn på\n,,nettet og kjøres med belastning etter etablerte rutiner.\n2.,,Etter testkjøring kobles nødgenerator tilbake til normal\n,,"stand by" modus.\n\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for generatorpakke\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>BRD</> - ''ISO Breakdown''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017690213','00000002','','00000','','2.0','H',' ',' ','2.0','H','2.000','2018-10-08 15:00:00.0000000','PT15H00M00S','2018-10-08 17:00:00.0000000','PT17H00M00S','2018-10-08 15:00:00.0000000','PT15H00M00S','2018-10-08 17:00:00.0000000','PT17H00M00S','2018-10-08 17:50:03.0000000','PT17H50M03S','2018-10-08 17:50:07.0000000','PT17H50M07S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','2.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24533513','1005055176','','OR000024533513','1766-71');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005055176','OV100505517600000007','00000007','9','0204','Operation Finally Confirmed (CNF)','PM01','','10007475','POMELE','','','02W Start nødgenerator A/B','02W Start nødgenerator A/B\n\n\nDa kortslutningsnivået er for høyt med parallellkjøring (2\nhovedkraftmaskiner og nødkraftmaskiner), kan innfasing gjøres i de\nperioder hvor kun en hovedkraft er i drift, f.eks under vannvask eller\nat den bare er stoppet. Dvs. at\nnødkraft kun må fases inn mot 1 hovedkraftmaskin i drift.\n\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>NØDGENERATOR/Startfeil:</>\nTittel   : Start nødgenerator\n\n\nA) DEFINISJON AV KOMPONENTSVIKT\nGeneratorsettene starter ikke.\n\nB) ARBEIDSBESKRIVELSE FOR TEST\n\n1. For nødgeneratorer med uavhengige startsystemer, velg det\nsekundære startsystemet.\n2. Drivmotor startes i manuell/test mode ved hjelp av det sekundære\nstartsystemet.\n3. Registrer feil dersom maskinen ikke starter på første forsøk.\n4. Kontroller instrumentering for motor og generator og påse at\ndet ikke er kritiske alarmtilstander.\n5. Sjekk for lekkasjer samt smøreolje- og kjølevannsnivå og\netterfyll om nødvendig\n6. Etter testkjøring kobles tilbake til normal "stand by" modus.\n\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for generatorpakke\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>BRD</> - ''ISO Breakdown''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017690214','00000002','','00000','','2.0','H',' ',' ','2.0','H','2.000','2018-10-08 17:00:00.0000000','PT17H00M00S','2018-10-08 19:00:00.0000000','PT19H00M00S','2018-10-08 17:00:00.0000000','PT17H00M00S','2018-10-08 19:00:00.0000000','PT19H00M00S','2018-10-08 17:50:13.0000000','PT17H50M13S','2018-10-08 17:50:17.0000000','PT17H50M17S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','2.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24533513','1005055176','','OR000024533513','1766-71');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005055176','OV100505517600000008','00000008','9','0400','Operation Finally Confirmed (CNF)','PM01','','10007530','POMPRO','','','04W Kontroll og innsaml.av tilstandsdata','04W Kontroll og innsaml.av tilstandsdata\n\nMD0550-0005 <H>Funksjonstest av brannvannspumpe</>\n\nFormål:\nVerifisere at brannpumpen starter på første forsøk og leverer\nvann kontinuerlig under hele testen.\n\nNB!\nDet skal ikke utføres noen form for vedlikehold eller\nklargjøring før drivenhet og pumpe startes.\n\nUtførelse:\n1. Start brannpumpen.\n2. Verifiser om den leverer vann.\n\nSviktdefinisjon:\nBrannpumpen starter ikke på første forsøk eller leverer ikke\nvann kontinuerlig under hele testen.\n<H>-----------------------------------------------------------------</>\n\n\nME0478\n\nKONTROLL OG INNSAMLING AV DATA FOR BRANNPUMPE\n\nMÅNEDLIG FUNKSJONSTEST AV BRANNPUMPE MED DIESELGENERATOR\n\nPUMPEN SOM SKAL TESTES LEGGES OVER I TESTMODUS OG TESTES I\nHENHOLD TIL ARBEIDSBESKRIVELSE (ARB) UTARBEIDET FOR HVER\nENKELT INSTALLASJON.\n\nRESULTATER FRA TESTEN REGISTRERES I EGET LOGGSKJEMA SOM\nLIGGER ELEKTRONISK I SAP.\n\n--------------------------------------------------------------\n\nSKJEMAET MÅ LAGES FOR HVER INSTALLASJON SIDEN VI BØR HA MED\nTAGNUMMERE FOR Å SIKRE KORREKT AVLESNING OG FOR Å FANGE OPP\nLOKALE MULIGHETER FOR Å FÅ TAK I DATA. AKSEPTKRITERIER\n(NORMALVERDIER) OG EV. OK AVVVIK BØR LIGGE I SKJEMAET (SETTES\nUT FRA ERFARING OG I SAMARBEID MED LEVERANDØR) OG ENHETER\nFOR AVLESTE VERDIER MÅ SPESIFISERES. VERDIER LESES AV ETTER\n15, 30 OG 45 MINUTTER. DATAENE VIL GJENNOM BRUK AV ELEKTRONISK\nSKJEMA BEVARES I SAP OG VIL BENYTTES TIL Å GÅ TILBAKE I\nHISTORIKKEN.\n\nSKJEMAET BØR INNEHOLDE FØLGENDE MED OPPGITTE TAGNUMMMER:\n\nLEVERINGSTRYKK BRANNVANN\nLEVERINGSMENGDE BRANNVANN\nTURTALL\nTIMER\nAFFF TRYKK\n\nKJØLEVANN TEMPERATUR\nKJØLEVANN TRYKK\nLUFTINNTAK TEMPERATUR\nEKSOSTEMPERATUR\nSMØREOLJE TEMPERATUR\nDIESELTRYKK\nLADELUFTTRYKK\n\nSTRØM (A)\nKONTROLL OG INNS. AV DATA FOR BRANNPUMPE\n','','','','',NULL,NULL,'1','H4','0017690215','00000002','','00000','','3.0','H',' ',' ','3.0','H','3.000','2018-10-09 12:00:00.0000000','PT12H00M00S','2018-10-09 15:00:00.0000000','PT15H00M00S','2018-10-09 12:00:00.0000000','PT12H00M00S','2018-10-09 15:00:00.0000000','PT15H00M00S','2018-10-08 17:47:53.0000000','PT17H47M53S','2018-10-08 17:48:03.0000000','PT17H48M03S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','3.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24533513','1005055176','','OR000024533513','1766-71');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005055176','OV100505517600000009','00000009','9','0410','Operation Finally Confirmed (CNF)','PM01','','10007530','POMPRO','','','04W Visuell ktr. utv. forbrenningsmotor','04W Visuell ktr. utv. forbrenningsmotor\n\nMD0400-0002 <H>Visuell kontroll - Utvendig forbrenningsmotor</>\n\nUtvendig sjekk med hensyn til:\n- lekkasjer (brennstoff, kjølevann, eksos, smøreolje)\n- urenheter\n- vibrasjoner\n- ulyder\n- skader\n- løse bolter/muttere/koblinger\n- gnag og skader på slanger og rør\n- merking og andre uregelmessigheter\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017690216','00000002','','00000','','1.0','H',' ',' ','1.0','H','1.000','2018-10-09 15:00:00.0000000','PT15H00M00S','2018-10-09 16:00:00.0000000','PT16H00M00S','2018-10-09 15:00:00.0000000','PT15H00M00S','2018-10-09 16:00:00.0000000','PT16H00M00S','2018-10-08 17:48:19.0000000','PT17H48M19S','2018-10-08 17:48:23.0000000','PT17H48M23S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','1.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24533513','1005055176','','OR000024533513','1766-71');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005055177','OV100505517700000001','00000001',' ','0010','','PM01','','10007523','POMNUR','','','02W CORPULS S3','02W CORPULS S3\n\n\n   Sjekk at Corpulse web fungerer\n   Kontroller at telemedisinsk utstyr fungerer\n   Corpuls3 Slim, LAN-versjon har nå 2 års gyldighet til neste\n    service.Styres av Alere.\n\nFor utfyllende info vedr. kontroll av Corpuls3, se fullstendig\nBrukermanual kap.9.2 Funksjonskontroll.\n\n  <H>- Modultilkoblingsstatus</>:\n      Separer alle modulene.\n        I statuslinjen vil tilkoblingssymbol for modulene bytte fra hel\n        linje til avbrutte signaler/bølger.\n      Koble sammen modulene.\n       I statuslinjen vil tilkoblingssymbol for modulene bytte fra\n       bølger til hel linje\n      Ingen feilmelding vises.\n\n<H>  - Funksjonstest av defibrillator</>:\n       To par CPR-elektroder, intakte og ikke utløpt utløpsdato.\n       For funksjonstesten kreves testboksen (Art.nr. 04310).\n       Pass på at et 1,5 V batteri er satt inn i testbox.\n       Slå på testboksen.\n       Koble testboksen til terapikontakten.\n       Velg manuell modus på defibrillatoren (kode 3333).\n       Velg energi 200 J.\n       Lad energi.\n       Gi sjokk.\n       Energi utlades internt via testboksen.\n       Ingen feilmelding vises.\n       Slå av testboksen etter å ha utført funksjonstesten, og løsne\n        den fra defibrillator.\n\n<H> - ,,Funksjonskontroll av skriver</>:\n       Kontroller at det er tilstrekkelig med papir igjen på rullen.\n       Kontroller om den røde markøren som indikerer slutten av rullen\n        er synlig.\n       Kjør en testutskrift.\n          * En utskrift vil starte.\n          * Rød stripe som indikerer slutten av papir rull er ikke\n            synlig.\n          * Det anbefales å bytte rull hvis denne er synlig.\n          * Synligheten på utskriften er av god kvalitet og kommer\n            tydelig frem.\n\n       Kontroller at en ekstra papirrull er tilgjengelig.\n\n\n\n\n\n\n\n\n - <H>Kontroll av strømforsyning</>:\n       Kontroller ladestatus.\n          * Slå på og kontroller ladestatus, se batterisymbol angitt i\n            minutt\n          * Separer de tre modulene mens Corpuls er påskrudd.\n          * Kontroller gjenværende batteritid for monitorenhet og\n            pasientboks i statuslinjen på hver enkelt modul.\n          * Samlet gjenværende batterietid bør være høyere enn 120 min.\n            Koble sammen igjen.\n\n<H>- EKG monitorering</>:\n      Tilstrekkelig med EKG elektroder for både monitorering og\n       diagnostisk EKG.\n           * Skal ligge i forpakning, og ikke utløpt utløpsdato.\n           * Funksjonkontroll av de to EKG kablene (monitorering og\n             diagnostisk).\n      Koble EKG- kabler til testbox (Art.nr. 04310), til en EKG\n       simulator eller til en frivillig. For optimale resultater, velger\n       du en forsterkning av x 0.5.\n      EKG vises som forventet i kurvefeltet. Send EKG elektronisk til\n       deg selv.\n\n<H>- Oksimetri:</>\n      Sjekk om oksimetri mellomkabelen og oksymetri sensor er til stede\n       og uskadet.\n      Fest oksimtrisensoren til din finger.\n          * Oksimetri verdier vises i en eller flere parameterfelter.\n          * Pulsen vises i et parameterfelt (PP).\n          * Pulskurve vises som en egen kurve.( Pleth)\n\n<H>- Kapnometri</>:\n      Sjekk at to av hvert slag av engangs CO2-adaptere er til stede og\n       uskadet.\n      Koble et desinfisert adapter til CO2- sensorer og fest\n       kabelen til pasientboksen.\n      Pust inn og ut gjennom adapteren flere ganger.\n          * CO2 konsentrasjonen vises i et parameterfelt.\n            Respirasjonsfrekvensen (RR) vises i et parameterfelt.\n          * Kapnogrammet vises i et kurvefelt\n\n<H>- Temperaturmåling</>:\n     Sjekk at temperatursensor er til stede og uskadet.\n     Koble pluggen til temperatursensor i inngangen på pasientboksen.\n          * Viser romtemperatur.\n     Ta temperatursensoren i hånden.\n          * Temperaturen skal stige.\n\n\n\n\n\n<H>- Ikke-invasiv blodtrykksmåling - NIBP:</>\n\n    Sjekk at NIBP-mansjett og slange er til stede og uskadet.\n    Gjennomfør en blodtrykksmåling på en testperson.\n         * Når målingen er utført skal blodtrykket vises i\n           parameterfeltet.\n\n\n<H>- HLR feedback:</>\n    Sjekk at det er to funksjonelle CPR- sensorer til stede, intakte og\n     ikke utløpt utløpsdato.\n    For å teste HLR funksjonen og HLR sensor, velg manuell modus på\n     defibrillatoren.\n    Koble CPR sensoren til CPR mellomkabelen som fører til\n     pasientboksen.\n    Flytt CPR sensoren opp og ned samtidig som du trykker på den.\n         * Kompresjonsfrekvens (HLR frekvens) vises i et parameterfelt.\n         * HLR-kurven vises i et kurve-felt.\n         * Tale- og tekstmeldinger «Trykk hardere», «Gode kompresjoner»\n           og «Slipp helt opp» blir spilt.\n\n\n<H>-,,Minne-kort (CompactFlash-kort / CF-kort):</>\n    Kontroller at CF-kortet er plassert i pasientboksen. ( plassert v/\n     EKG kablene)\n    Kontroller gjenværende minne på CF-kortet.\n         * Trykk og hold nede Resyme-knappen.\n         * Oppdragsvisningen kommer opp, og tilgjengelig minne vises.\n         * I hvert fall 25 % minne tilgjengelig.\n','','','','',NULL,NULL,'1','H4','0017690217','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-09 07:00:00.0000000','PT07H00M00S','2018-10-09 08:00:00.0000000','PT08H00M00S','2018-10-09 07:00:00.0000000','PT07H00M00S','2018-10-09 08:00:00.0000000','PT08H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24533514','1005055177','','OR000024533514','1766-75');
