insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005055189','OV100505518900000001','00000001','9','0010','Operation Finally Confirmed (CNF)','PM01','','10007486','POMLAB','','','2W-FV ANALYSE AV FRITT KLOR I BRANNVANN','2W-FV ANALYSE AV FRITT KLOR I BRANNVANN\n\nHent prøver fra brannvannet på følgende steder:\n\nBrannvann fra frostsikring i avløpsrenne på Helidekk.\n\n\nFyll prøveflasken helt full og skru korken godt på. Analyseres straks\netter prøve-uttak for å hindre at Cl2 flasher av.\n\nAnalysemetode:\n1.   Slå på HACH, den foretar selv-test.\n2.   Slå inn metodenummer 80, trykk [ENTER]\n3.   Still inn bølgelengden til 530nm med hjulet på siden av apparatet,\ntrykk [ENTER].\n4.   Ta en 10ml kyvette, skyll et par ganger med prøven, fyll så til\nmerket.\n5.   Sett kyvetten i HACH''en, (pass på at den står med skriften samme\nvei hver gang du skal lese av)<(>,<)> trykk [ZERO]. Dette er en\nblindprøve.\n6.   Ta ut kyvetten og tilsett en pute med DPD Free Chlorine, rist\nforsiktig til mesteparten er oppløst\n7.   Sett kyvetten i HACH''en, (pass på at den står med skriften samme\nvei hver gang du skal lese av).\nTrykk [SHIFT] og [TIMER]. Programmet går nå i 3 minutter.\nEtter 3 minutter piper det, trykk da [READ] og resultatet kan leses av.\n\n8.   Avlesing = mg/l Cl2\n\nResultater skal logges i Excel liste på lab teamsite.\nVerdiene på klor i brannvann skal ligge mellom 0.30-0.50 mg/l\n\nVidere bør det fremgå hvilke aksjoner som skal iverksettes hvis det\nmåles verdier utenfor det angitte måleområdet.','','','','',NULL,NULL,'1','H4','0017690236','00000002','','00000','','2.0','H',' ',' ','2.0','H','2.000','2018-10-10 07:00:00.0000000','PT07H00M00S','2018-10-10 11:00:00.0000000','PT11H00M00S','2018-10-10 07:00:00.0000000','PT07H00M00S','2018-10-10 11:00:00.0000000','PT11H00M00S','2018-10-11 08:21:29.0000000','PT08H21M29S','2018-10-11 08:21:34.0000000','PT08H21M34S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','2.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24533526','1005055189','','OR000024533526','1766-S7107');
