otoren. Det er ikke faglig forsvarlig å la\n,,motoren gå mer enn maksimalt 5 minutter uten at det er\n,,tilrettelagt for tilstrekkelig kjøling med kjølevann.\n2.,,Kontroller mhp. lekkasjer, vibrasjoner og ulyder.\n3.,,Tilbakestill systemet til normal operasjon\n\n\nC)  ETTER UTFØRT TEST:\n1.,,Tilbakestill systemet til normal operasjon\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for mob båt\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>FTF</> - ''CST Failure to function on demand''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017690240','00000002','','00000','','1.0','H',' ',' ','1.0','H','1.000','2018-10-08 07:00:00.0000000','PT07H00M00S','2018-10-08 08:20:00.0000000','PT08H20M00S','2018-10-08 07:00:00.0000000','PT07H00M00S','2018-10-08 08:20:00.0000000','PT08H20M00S','2018-10-10 14:06:27.0000000','PT14H06M27S','2018-10-10 14:06:30.0000000','PT14H06M30S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','1.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24533529','1005055192','','OR000024533529','1766-S7604');
