insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005059593','OV100505959300000001','00000001',' ','0010','','PM01','','10010147','POMCAT','','','02W - Funksjonstest Helidekk monitorer','02W - Funksjonstest Helidekk monitorer\n\n<H>2W funksjonstest for HELIDEKK MONITOR:</>\n\n<H>Mål:</>\nMålet er å teste at monitor er i operativ tilstand.\n<H>1.,,</>\nTeste at monitor kan beveges fritt og ikke står fast.\n<H>2.,,</>\nSjekke om monitor har mekaniske skader og lekkasjer\n<H>3.,,</>\nTeste at monitorventil åpner ved signal.\n<H>4.,,</>\nSjekke oscilleringsfunksjon (se at kanonen pendler)\n<H>5.,,</>\nKontroll spredemønster og kastlengde\n\n\n<H>Gjør det klar:</>\n<H>1.,,</>\nSjekk at brannkanonen er lett tilgjengelig (ingen hindring rundt\nkanonen) og at vanntilførsel er klar (trykk kontroll fra manometer at\ndet er vann fylt til deluge ventil/eller trykk i ringledning sjekkes fra\nSKR).\n<H>2.,,</>\nStart brannvann pumpe.**\n<H>3.,,</>\nSett nødvendige broinger.\n<H>4.,,</>\nSend ut PA melding om: test av brannkanoner på helidekk.\n\n** Grunn til at brannvannspumpene skal startes før testen er for å få et\njevnt trykk i systemet slik at monitorene ikke slites. Plutselig høye\ntrykk sliter delene fort.\n\n\n<H>Test sekvens:</>\nDet er tre fjernutløsningsmetoder for helidekk monitor på OSS:\n<H>1. </>\nAlle tre kanoner utløses vha trykknapp i helibua/helidekktårn; ( kan kun\nstarte men ikke stoppe kanonene, noe som må gjøres via kontrollrom)\n<H>2.</>\nAlle tre kanonene utløses en og en via ventil merket «manuell utløser»\nved hver kanon. En stenger også vannet selv med den samme ventilen.\n(Kanonene skal i denne testen også testes i jet-posisjon. Husk å stille\nkanonene tilbake til fog-posisjon, etter test i jet-posisjon).<H> </>\n<H>3. </>\nAlle kanoner kan utløses via trykknapp på panel på kanonene. Ved å\ntrykke inn en knapp på en kanon, så starter alle tre kanonene\nsamtidig.(Kontrollrom må stoppe vannet). Knappene testes på alle 3\nkanonene\n\nDet er ikke nødvendig å teste alle tre fjernutløsningsmetoder ved hver\nfunksjonstest. Det er tilstrekkelig at en velger en av de tre metodene\nhver gang. Hvilken metode som velges må noteres i AO slik at en sikrer\nat alle metodene testes ila 6 uker. I tillegg skal monitorene testes vha\nmanuell utløsning hver gang.\n\n\n<H>Testing:</>\n<H>Test av fjernutløsning av monitor og oscilleringsfunksjon.</>\n<H>1.,,</>\nSteng av skumventil manuelt.\n<H>2.,,</>\nBrannkanonene utløses vha en av de tre metodene beskrevet ovenfor. Se at\nkanonene pendler innenfor helidekkets randsone\n<H>3.,,</>\nKontroller kastelengde og spredemønster.\n<H>4.,,</>\nGjennomfør visuell sjekk for mekanisk skader og eksternlekkasje.\n<H>5.,,</>\nStopp testing med sjøvann.\n\n<H>Test av manuell utløsning av monitor</>\n<H>6.,,</>\nBehold skumventil stengt.\n<H>7.,,</>\nUtløse alle tre kanonene ved å åpne lokal ventil under kanoner,\nkontroller at kanonenes bevegelige deler kan beveges fritt.\n\n\n<H>Tilbakestilling:</>\n<H>1.</>\nMeld fra til SKR når test er utført og det meldes over PA at test av\nbrannkanoner på helidekk er nå ferdig\n<H>2.</>\nEtter test må monitor tilbakestilles til operativ stand. Skumventil\nåpnes, overbroinger oppheves. Åpne dreneringsventil og drener systemet.\n\n\n<H>Loggføring av testresultat:</>\nObservasjoner gjort under testen skal registreres i arbeidsordren (AO),\nog loggføres i M3- activity Report (M3-notifikasjon)\n\nHvis feil oppdages, skal M2 notifikasjon opprettes.\n\n\n<H>Liste 1. Design flow og trykk på monitorene.</>\n\n<H>Tag nr.,,,,,,        1766-SM-71-0001/0002/0003</>\n<H>Lokasjon: ,,,,        H10</>\n<H>Type monitor: ,,        Oscillerende med skum</>\n<H>Basis data: ,,</>\n<H>Design flow: ,,,,,,120 m3/h</>\n<H>Design pressure water: ,,16 barg</>\n<H>Design  flow AFFF: ,,,,1,2 m3/h</>\n<H>Design pressure AFFF: ,,18 barg</>\n<H>(Design data is from company datasheet)</>\n\n\n\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>FW-MONITOR VENTIL - :</>\n<H>Definisjon av svikt ved funksjonstest:</>\nDersom brannvannsmonitorventil ikke åpner ved test.\n\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for ventil\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>FTO</> - ''ISO Failure to open on demand''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>FW MONITOR, fjernstyrt:</>\n<H>Definisjon av svikt ved funksjonstest:</>\nDersom fjernstyrt monitor spredemønster/kastelengde ikke dekker\ndefinert målområde ved test.\n\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for aktuell monitor\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>BRD</> - ''CST Breakdown''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.\n','','','','',NULL,NULL,'1','H4','0017708082','00000000','','00000','','5.0','H',' ',' ','5.0','H','0.000','2018-10-14 07:00:00.0000000','PT07H00M00S','2018-10-14 12:00:00.0000000','PT12H00M00S','2018-10-14 07:00:00.0000000','PT07H00M00S','2018-10-14 12:00:00.0000000','PT12H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24537850','1005059593','','OR000024537850','1766-S7106');
