insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005059595','OV100505959500000001','00000001',' ','0210','','PM01','','10007513','POMMEC','1766-U','Utstyrsstopp','02W Funksjonstest Tørning av Livbåtmotor','02W Funksjonstest Tørning av Livbåtmotoror 1\n\nLB0100-0017 <H>Livbåt, motor - Funksjonstest tørning</>\n\nFORMÅL:\nVerifisere at motoren tørner.\n\nMerk: Denne aktiviteten erstattes av aktivitet for start-test\ndersom disse er planlagt utført i samme uke.\n\nUTFØRELSE:\n1. Koble fra strømtilførsel fra plattform.\n\n2. Kontroller før tørning:\n   - Kjølevann og oljenivå på motor\n   - Oljenivå på gir, eventuelt dersom ikke peilepinne på gir:\n      - Kontroller at ingen girolje i bunn av kjøl\n   - Se over motor for lekkasje, løse bolter/muttere\n   - At heateren på motoren fungerer/er varm\n   - At manøverhendler kan beveges lett\n   - At bryterne i instrumentpanelet står i korrekt posisjon\n   - At batterivelger står i stilling for start via\n     hovedsystem/stilling 1\n\nTest med batterivelger i posisjon «hovedsystem»/stilling 1:\n\n3. Hold stoppknapp inne og trykk på start slik at motor tørnes\n   i 5 sekund, uten start.\n\n4. Kontroller:\n   - at motor tørner\n   - ulyder\n   - oljetrykket stiger\n\nTest med batterivelger i posisjon «nødsystem»/stilling 2:\n\n5. Hold stoppknapp inne og trykk på start slik at motor tørnes\n   i 5 sekund, uten start.\n\n6. Kontroller:\n   - at motor tørner\n   - ulyder\n   - oljetrykket stiger\n\n7. Koble til strømtilførsel fra plattform til livbåt.\n\nSviktdefinisjon:\nMotoren tørner ikke.\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017708085','00000000','','00000','','0.5','H',' ',' ','1.0','H','0.000','2018-10-16 07:00:00.0000000','PT07H00M00S','2018-10-16 07:30:00.0000000','PT07H30M00S','2018-10-16 07:00:00.0000000','PT07H00M00S','2018-10-16 07:30:00.0000000','PT07H30M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24537852','1005059595','','OR000024537852','1766-S7601');
