 at motor tørner\n   - ulyder\n   - oljetrykket stiger\n\n7. Koble til strømtilførsel fra plattform til livbåt.\n\nSviktdefinisjon:\nMotoren tørner ikke.\n\n<H>-----------------------------------------------------------------</>\n\n','','','','',NULL,NULL,'1','H4','0017708086','00000000','','00000','','0.5','H',' ',' ','1.0','H','0.000','2018-10-16 07:00:00.0000000','PT07H00M00S','2018-10-16 07:30:00.0000000','PT07H30M00S','2018-10-16 07:00:00.0000000','PT07H00M00S','2018-10-16 07:30:00.0000000','PT07H30M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24537853','1005059596','','OR000024537853','1766-S7602');
