insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005059598','OV100505959800000001','00000001',' ','0010','','PM01','','10007497','POMLOG','','','1W - MOB øvelse / Starttest av mob-båt','1W - MOB øvelse / Starttest av mob-båt\n\n\nUKENTLIG SJEKKLISTE MOB-BÅT.\n\n\n\nÅr:                                      UKE NR:\n\n\nVHF RADIO FUNKSJONSTESTES MOT SKR. ELLER KRAN.\n,,,,,,,,,,,,,,,,\n\nSJEKK MOTORVARMER OG AT DEN LADER.\nKONTROLLER AT STRØMTILFØRSEL TIL LADING ER INTAKT.\n,,,,,,,,,,,,,,,,\n\nNAVIGASJON OG SØKELYS.,,,,,,,,,,,,,,,,\n\nBRANNSLUKNINGSAPPARAT.,,,,,,,,,,,,,,,,\n\nREDNINGSUTSTYR I BÅT OG SKAP. I hht TIL UTSTYRSLISTE.,,,,,,,,,,,,,,,,\n\nDIESEL NIVÅ.,,,,,,,,,,,,,,,,\n\nOLJE NIVÅ PÅ MOTOR.,,,,,,,,,,,,,,,,\n\nKJØLEVANN PÅ MOTOR.,,,,,,,,,,,,,,,,\n\nSTART AV MOTOR, ( TEST BEGGE BATTERI )  MAX 5.SEK.,,,,,,,,,,,,,,,,\n\nVIFTEREIM TIL KJØLEVANNSPUMPE, DYNAMO OG HYDRAULIKKPUMPE FOR VANNJET.,,\n,,,,,,,,,,,,,,\n\nMANØVERHENDLER.,,,,,,,,,,,,,,,,\n\nBÅTENS TILSTAND GENERELT.,,,,,,,,,,,,,,,,\n\nSJEKK GPS.,,,,,,,,,,,,,,,,\n\n,,,,,,,,,,,,,,,,\n\nSIGNATUR:,,,,,,,,,,,,,,,,\n\n\n\n\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>MOBBÅTMOTOR:</>\nTittel   : Start MOB-båt\n\n\n\nA) DEFINISJON AV KOMPONENTSVIKT\nMotor starter ikke.\n\nB) ARBEIDSBESKRIVELSE FOR TEST\n1.,,Start motoren.\n,,SSS-23-kravet består i å kontrollere startvilligheten til\n,,MOB-båtmotoren. Det er ikke faglig forsvarlig å la\n,,motoren gå mer enn maksimalt 5 minutter uten at det er\n,,tilrettelagt for tilstrekkelig kjøling med kjølevann.\n2.,,Kontroller mhp. lekkasjer, vibrasjoner og ulyder.\n3.,,Tilbakestill systemet til normal operasjon\n\n\nC)  ETTER UTFØRT TEST:\n1.,,Tilbakestill systemet til normal operasjon\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for mob båt\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>FTF</> - ''CST Failure to function on demand''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017708088','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-15 07:00:00.0000000','PT07H00M00S','2018-10-15 08:20:00.0000000','PT08H20M00S','2018-10-15 07:00:00.0000000','PT07H00M00S','2018-10-15 08:20:00.0000000','PT08H20M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24537855','1005059598','','OR000024537855','1766-S7604');
