insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005072749','OV100507274900000001','00000001',' ','0010','','PM01','','10007307','C02ELE','','','Installere preisolert tubing med v.k','Installere preisolert tubing med v.k\n\nReferanse til relevante AO;\n24474548E01   214425 RIVING  ELEKTRO BRØNN F-2\n24529410      214425 INSTRUMENT HOOK-UP BRØNN F2\n\nRelevante tegninger:\n11-3A-HM-E64-00011 Heat trace block diagram\n11-3A-EQ-E70-00001 Wiring/termination diagram EH820104.418-J13T\n\nFølgende tag er installert av FRAMO onshore:\n\nPIT-13-0963-01\nFE-13-0962-01\nFE-13-0963-01\nFE-13-0964-01\nFE-13-0965-01\n\nFølgende varmekabeltag er inkludert i denne AO:\n\nPIT-13-0962-01\nPIT-13-0964-01\nPIT-13-0965-01\n\nDet benyttes ferdig isolerte tubinger av typen E3-HC-N-TV-10X1\n,5-1F-TPU/11-5KTV2-CT-S. Legging av denne gjøres i samarbeid med instrument AO\n24529410. Tubing forlenges med deler fra hook up sett. Medfølgende kabel\nskal være lang nok til også denne forlengelsen.\n\nUtfør/bekreft A-test (ELE 19.1) av varmekablene PIT-13-0962-01, PIT-13-\n0964-01 og PIT-13-0965-01.\n\nEtter aktivitet 0015 T: Prefab/Inst 3 endeavslutninger tubing er\nfullført utfør B-test (ELE 19.2) for alle varmekablene.\n\nUtfør dermed tilkobling i koblingsboks EH820104.418-J13T.\n\nI fbm. aktivitet 0030 Utkobling av kurs tas varmekabel utkoblingsskjema\nut offshore.\n\nHusk å fyll ut vedlagt kost/vekt skjema for installasjon.\n\n\n\n\n\n\n','','','','',NULL,NULL,'1','X4','0017749788','00000000','','00000','','25.0','H',' ',' ','25.0','H','0.000','2018-10-10 12:50:25.0000000','PT12H50M25S','2018-10-12 13:50:25.0000000','PT13H50M25S','2018-10-10 12:50:25.0000000','PT12H50M25S','2018-10-12 13:50:25.0000000','PT13H50M25S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S','0.0','1','','','','',NULL,NULL,'24550960','1005072749','','OR000024550960','');
