insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005072749','OV100507274900000004','00000004',' ','0040','','PM01','','10007307','C02ELE','','','Trekking, terminering og test av tilf.','Trekking, terminering og test av tilf.\n\nRelevante tegninger:\n11-3A-HM-E64-00011 Heat trace block diagram\n\nKoblingsboks montert av FRAMO onshore har endret plassering på brønntre\ni forhold til tidligere plassering på brønnpanel.\nDersom ekisterende kabel EH820104.418-W13 som ligger kveilet ved brønn\nF2 blir for kort må det trekkes ny kabel.\n\nNB!! sjekk at kursen er lagt ut før fra/tilkobling.\n\nDersom eksisterende kabel fortsatt kan brukes:\n\nKabel som ligger kveilet ved F2 ihht. Rivepakke AO 24474548E01 må legges\nnoen meter etter at kabelrist er bygget helt frem til brønntre.\n\nFølgende kabel termineres i B ende:\nEH820104.418-W13 (P5/P12 2x2,5mm) termineres i EH820104.418-J13T.\nKoblingsboks plassert på brønntre av FRAMO.\n\nKabel tilkobles i A-ende:\nEH820104.418-W13 tilkobles EH820104.418-J05T. Kabel ligger jordet i\nkoblingsboks EH820104.418-J05T ihht. AO 24474548E01.\n\nDersom ny kabel:\n\nEksisterende kabel rives og kobles fra der kabel ligger jordet i\nkoblingsboks EH820104.418-J05T ihht. AO 24474548E01.\n\nNy kabel EH820104.418-W13 (P5/P12 2x2,5mm) trekkes mellom\nEH820104.418-J05T og EH820104.418-J13T.\n\nTermineres i B-ende:\nTermineres i koblingsboks EH820104.418-J13T montert på brønntre.\n\nTilkobles i A-ende:\nKabel tilkobles koblingsboks EH820104.418-J05T.\n\nNB!! sjekk at kursen er lagt ut før fra/tilkobling.\n\nTest at kabel er ok og fyll ut MCCR.','','','','',NULL,NULL,'1','X4','0017815216','00000000','','00000','','5.0','H',' ',' ','10.0','H','0.000','2018-10-14 10:31:52.0000000','PT10H31M52S','2018-10-14 15:31:52.0000000','PT15H31M52S','2018-10-14 10:31:52.0000000','PT10H31M52S','2018-10-14 15:31:52.0000000','PT15H31M52S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S','0.0','1','','','','',NULL,NULL,'24550960','1005072749','','OR000024550960','');
