.0000000','PT07H00M00S','2018-10-23 10:00:00.0000000','PT10H00M00S','2018-10-23 07:00:00.0000000','PT07H00M00S','2018-10-23 10:00:00.0000000','PT10H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24551406','1005073189','','OR000024551406','1766-69');
