insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005073190','OV100507319000000002','00000002',' ','0206','','PM01','','10007530','POMPRO','','','02W Starttest','02W Starttest\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>BRANNPUMPE/Starttest:</>\nTittel   : Start brannvannspumpe\n\n\nA) DEFINISJON AV KOMPONENTSVIKT\n-,,Dieselmotor starter ikke på første forsøk.\n-,,Vann kommer ikke ut av dumpeledning.\n-,,Det er ikke tilstrekkelig drivstoff.\n-,,Startpanel er helt eller delvis tildekket/obstruert.\n-,,System er mekanisk blokkert eller elektrisk inhibitert/overbroet.\n\nB) ARBEIDSBESKRIVELSE FOR TEST\nFor kombinerte brann- og sjøvannssystemer, skal de av dieselmotorene\nsom ligger i brannpumpe-modus testes ukentlig (myndighetskrav).\n\nGjennomfør test med pumpen i testmodus i henhold til plattformens\nrutiner:\n-,,Observer at dieselmotor starter på første forsøk og at vann\n,,kommer ut av dumpeledning.\n\nC)  ETTER UTFØRT TEST:\n-,,Tilbakestill til brannpumpemodus.\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for brannpumpe\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>FTS</> - ''ISO Failure to start on demand''\nFailure Mode  : <H>STP</> - ''CST Failure to stop on demand''\nFailure Mode  : <H>LOO</> - ''ISO Low output''\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017751545','00000000','','00000','','3.0','H',' ',' ','3.0','H','0.000','2018-10-23 09:00:00.0000000','PT09H00M00S','2018-10-23 12:00:00.0000000','PT12H00M00S','2018-10-23 09:00:00.0000000','PT09H00M00S','2018-10-23 12:00:00.0000000','PT12H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24551407','1005073190','','OR000024551407','1766-71');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005073190','OV100507319000000003','00000003',' ','0200','','PM01','','10007530','POMPRO','1766-U','Utstyrsstopp','02W Funksjonstest av dieselmotor MD0400','02W Funksjonstest av dieselmotor MD0400\n\nMD0400-0008 <H>Rutinekjøring</>\n\nMERK:\nDenne aktiviteten bør utføres samtidig med aktivitet for påhengt\nutstyr og må da koordineres med denne.\n\nUTFØRELSE:\n\n1. Start motor.\n\n2. Kjør denne på lav last inntil motoren er varm (typisk\n   oljetemperatur >60C).\n\n3. Legg på last trinnvis, dersom mulig.\n\n4. Sjekk at trykk i sjøvannskjølekretsen er iht. normale\n   verdier.\n\n5. Kontroller kjølevannspumpe for ulyd og vibrasjon.\n\n6. Kjør motoren med minimum 75% last i minimum 2 timer.\n\n7. Verifiser at ingen alarmer eller andre unormale forhold, som\n   lekkasjer etc. intrer.\n\n8. Kontroller eksos-fargen og temperatur ved normal drift.\n\n9. Sjekk eksos "waterspray" under kjøring (flow) og etter stans\n   (ingen flow). (Gjelder kun for motor med vannkjølt eksos).\n\n10. Logg driftsdata i skjema for aktuell motortype (se eksempel\n    under) etter 2 timers drift ved stabil last.\n\n11. Sammenlign disse med historiske data fra tidligere\n    rutinekjøringer.\n\n12. Verifiser at alt er normalt, eller foreta feilsøking dersom\n    driftsdata indikerer at en feilmode er under utvikling\n    (feks. betydelig økt ferskvanns- eller oljetemperatur, lavt\n    oljetrykk eller andre avvik sammenlignet med tidligere\n    rutinekjøringer).\n\n13. Ta av last trinnvis, og la motoren gå på tomgang for\n    nedkjøling før stopp (feks. eksostemperatur <200C).\n\n14. Stopp motoren og steng ned i henhold til lokale\n    nedstengingsrutiner.\n\n15. Kontroller etter stans:\n    - Smøroljenivå på dieselmotor\n    - Smøroljenivå på girboks\n    - Dieselnivå i dagtank\n    - Nivå i ekspansjonstanker for kjøleveske\n    - Luftspjeld (smøres og beveges)\n    - Luftspjeld og magnetiseringsbryter\n    - Forbrenningsmotor er satt tilbake til autostart\n\n16. Arkiver loggede driftsdata, og rapporter eventuell feilmoder\n    som ikke lar seg utbedre under utførelse av jobben.\n\ntag: _____________ timeteller:_________\ndato: _____________ utført av: _________\ntime _____________\n\nload kw_________\njacket water pressure_________\nlow temp water pressure_________\noil pressure after filter_________\ncamshaft oil pressure_________\nfuel pressure_________\ncp.engine oil temp_________\nengine oil temp before cooler_________\nengine oil temp after cooler_________\njacket wather temp outlet engine_________\nturbo blower air pressure no.1_______\nturbo blower air pressure no.2_________\neksos temp av._______\nsyl 1_________\nsyl 3_________\nsyl 4_________\nsyl 5_________\nsyl 6_________\nsyl 7_________\nsyl 8_________\nsyl 9_________\nsyl 10 _________ _________\nsyl 11_________\nsyl 12_________\nsyl 13_________\nsyl 14_________\nsyl 15_________\nsyl 16_________\ncran regulator_________\ngenerator main line oil pressure_________\ngenerator rear bearing oil pressure_________\n\n\n<H>-----------------------------------------------------------------</>\n','','','','',NULL,NULL,'1','H4','0017751546','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-22 07:00:00.0000000','PT07H00M00S','2018-10-22 09:00:00.0000000','PT09H00M00S','2018-10-22 07:00:00.0000000','PT07H00M00S','2018-10-22 09:00:00.0000000','PT09H00M