insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005073190','OV100507319000000006','00000006',' ','0203','','PM01','','10007475','POMELE','','','02W Innfasing av nødgenerator A/B','02W Innfasing av nødgenerator A/B\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>NØDGENERATOR/Startfeil:</>\nTittel   : Innfasing av nødgenerator\n\n\nA) DEFINISJON AV KOMPONENTSVIKT\nGeneratoren leverer ikke spenning og effekt til akseptable verdier.\n\nB) ARBEIDSBESKRIVELSE FOR TEST/MÅLING AV KOMPONENTSVIKT\nInnfasing av nødgenerator utføres sammen med start av nødgenerator.\n1.,,Ifm. annenhver startrutine skal generatoren fases inn på\n,,nettet og kjøres med belastning etter etablerte rutiner.\n2.,,Etter testkjøring kobles nødgenerator tilbake til normal\n,,"stand by" modus.\n\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for generatorpakke\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>BRD</> - ''ISO Breakdown''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017751549','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-22 15:00:00.0000000','PT15H00M00S','2018-10-22 17:00:00.0000000','PT17H00M00S','2018-10-22 15:00:00.0000000','PT15H00M00S','2018-10-22 17:00:00.0000000','PT17H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24551407','1005073190','','OR000024551407','1766-71');
insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005073190','OV100507319000000007','00000007',' ','0204','','PM01','','10007475','POMELE','','','02W Start nødgenerator A/B','02W Start nødgenerator A/B\n\n\nDa kortslutningsnivået er for høyt med parallellkjøring (2\nhovedkraftmaskiner og nødkraftmaskiner), kan innfasing gjøres i de\nperioder hvor kun en hovedkraft er i drift, f.eks under vannvask eller\nat den bare er stoppet. Dvs. at\nnødkraft kun må fases inn mot 1 hovedkraftmaskin i drift.\n\n\n<H>UTVALGT SIKKERHETSKRITISK UTSTYR:</>\n\n<H>NØDGENERATOR/Startfeil:</>\nTittel   : Start nødgenerator\n\n\nA) DEFINISJON AV KOMPONENTSVIKT\nGeneratorsettene starter ikke.\n\nB) ARBEIDSBESKRIVELSE FOR TEST\n\n1. For nødgeneratorer med uavhengige startsystemer, velg det\nsekundære startsystemet.\n2. Drivmotor startes i manuell/test mode ved hjelp av det sekundære\nstartsystemet.\n3. Registrer feil dersom maskinen ikke starter på første forsøk.\n4. Kontroller instrumentering for motor og generator og påse at\ndet ikke er kritiske alarmtilstander.\n5. Sjekk for lekkasjer samt smøreolje- og kjølevannsnivå og\netterfyll om nødvendig\n6. Etter testkjøring kobles tilbake til normal "stand by" modus.\n\n<H>Rapportering av svikt:</>\nEnhver svikt oppdaget ved utførelse av FV-testing skal\nrapporteres i SAP på en M2 Malfunction Report (Notifikasjon).\n\nM2 Notifikasjonen meldes på følgende måte:\n\nFunctLocation : <H>Tag</> for generatorpakke\nDetect Mthd   : <H>2</>   - ''ISO Functional testing''\nFailure Mode  : <H>BRD</> - ''ISO Breakdown''\n\n\nHusk alltid å beskrive svikten med bakenforliggende årsaker\nunder ''Activity''-mappen på den samme M2-notifikasjonen.','','','','',NULL,NULL,'1','H4','0017751550','00000000','','00000','','2.0','H',' ',' ','2.0','H','0.000','2018-10-22 17:00:00.0000000','PT17H00M00S','2018-10-22 19:00:00.0000000','PT19H00M00S','2018-10-22 17:00:00.0000000','PT17H00M00S','2018-10-22 19:00:00.0000000','PT19H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24551407','1005073190','','OR000024551407','1766-71');
