insert into [dbo].[Workorderoperation]([Werks], [Aufpl], [Objnr], [Aplzl], [Anlzu], [Vornr], [AnlzuTxt], [Steus], [Istru], [Arbid], [Arbpl], [Ktsch], [KtschTxt], [Ltxa1], [Longtext], [Sakto], [Ekorg], [Ekgrp], [Matkl], [Anzzl], [Prznt], [Indet], [Larnt], [Rueck], [Rmzhl], [Banfn], [Bnfpo], [Ablad], [Dauno], [Daune], [Einsa], [Einse], [Arbei], [Arbeh], [Ismnw], [Fsavd], [Fsavz], [Fsedd], [Fsedz], [Ssavd], [Ssavz], [Ssedd], [Ssedz], [Isdd], [Isdz], [Iedd], [Iedz], [Ntanf], [Ntanz], [Ntend], [Ntenz], [Ofmnw], [Aufkt], [Tplnr], [Equnr], [Slwid], [Usr00], [Usr08], [Usr09], [Aufnr_fk], [Aufpl_fk], [Equnr_fk], [Objnr_fk], [Tplnr_fk]) values('1766','1005073193','OV100507319300000001','00000001',' ','0010','','PM01','','10007523','POMNUR','','','02W CORPULS S3','02W CORPULS S3\n\n\n   Sjekk at Corpulse web fungerer\n   Kontroller at telemedisinsk utstyr fungerer\n   Corpuls3 Slim, LAN-versjon har nå 2 års gyldighet til neste\n    service.Styres av Alere.\n\nFor utfyllende info vedr. kontroll av Corpuls3, se fullstendig\nBrukermanual kap.9.2 Funksjonskontroll.\n\n  <H>- Modultilkoblingsstatus</>:\n      Separer alle modulene.\n        I statuslinjen vil tilkoblingssymbol for modulene bytte fra hel\n        linje til avbrutte signaler/bølger.\n      Koble sammen modulene.\n       I statuslinjen vil tilkoblingssymbol for modulene bytte fra\n       bølger til hel linje\n      Ingen feilmelding vises.\n\n<H>  - Funksjonstest av defibrillator</>:\n       To par CPR-elektroder, intakte og ikke utløpt utløpsdato.\n       For funksjonstesten kreves testboksen (Art.nr. 04310).\n       Pass på at et 1,5 V batteri er satt inn i testbox.\n       Slå på testboksen.\n       Koble testboksen til terapikontakten.\n       Velg manuell modus på defibrillatoren (kode 3333).\n       Velg energi 200 J.\n       Lad energi.\n       Gi sjokk.\n       Energi utlades internt via testboksen.\n       Ingen feilmelding vises.\n       Slå av testboksen etter å ha utført funksjonstesten, og løsne\n        den fra defibrillator.\n\n<H> - ,,Funksjonskontroll av skriver</>:\n       Kontroller at det er tilstrekkelig med papir igjen på rullen.\n       Kontroller om den røde markøren som indikerer slutten av rullen\n        er synlig.\n       Kjør en testutskrift.\n          * En utskrift vil starte.\n          * Rød stripe som indikerer slutten av papir rull er ikke\n            synlig.\n          * Det anbefales å bytte rull hvis denne er synlig.\n          * Synligheten på utskriften er av god kvalitet og kommer\n            tydelig frem.\n\n       Kontroller at en ekstra papirrull er tilgjengelig.\n\n\n\n\n\n\n\n\n - <H>Kontroll av strømforsyning</>:\n       Kontroller ladestatus.\n          * Slå på og kontroller ladestatus, se batterisymbol angitt i\n            minutt\n          * Separer de tre modulene mens Corpuls er påskrudd.\n          * Kontroller gjenværende batteritid for monitorenhet og\n            pasientboks i statuslinjen på hver enkelt modul.\n          * Samlet gjenværende batterietid bør være høyere enn 120 min.\n            Koble sammen igjen.\n\n<H>- EKG monitorering</>:\n      Tilstrekkelig med EKG elektroder for både monitorering og\n       diagnostisk EKG.\n           * Skal ligge i forpakning, og ikke utløpt utløpsdato.\n           * Funksjonkontroll av de to EKG kablene (monitorering og\n             diagnostisk).\n      Koble EKG- kabler til testbox (Art.nr. 04310), til en EKG\n       simulator eller til en frivillig. For optimale resultater, velger\n       du en forsterkning av x 0.5.\n      EKG vises som forventet i kurvefeltet. Send EKG elektronisk til\n       deg selv.\n\n<H>- Oksimetri:</>\n      Sjekk om oksimetri mellomkabelen og oksymetri sensor er til stede\n       og uskadet.\n      Fest oksimtrisensoren til din finger.\n          * Oksimetri verdier vises i en eller flere parameterfelter.\n          * Pulsen vises i et parameterfelt (PP).\n          * Pulskurve vises som en egen kurve.( Pleth)\n\n<H>- Kapnometri</>:\n      Sjekk at to av hvert slag av engangs CO2-adaptere er til stede og\n       uskadet.\n      Koble et desinfisert adapter til CO2- sensorer og fest\n       kabelen til pasientboksen.\n      Pust inn og ut gjennom adapteren flere ganger.\n          * CO2 konsentrasjonen vises i et parameterfelt.\n            Respirasjonsfrekvensen (RR) vises i et parameterfelt.\n          * Kapnogrammet vises i et kurvefelt\n\n<H>- Temperaturmåling</>:\n     Sjekk at temperatursensor er til stede og uskadet.\n     Koble pluggen til temperatursensor i inngangen på pasientboksen.\n          * Viser romtemperatur.\n     Ta temperatursensoren i hånden.\n          * Temperaturen skal stige.\n\n\n\n\n\n<H>- Ikke-invasiv blodtrykksmåling - NIBP:</>\n\n    Sjekk at NIBP-mansjett og slange er til stede og uskadet.\n    Gjennomfør en blodtrykksmåling på en testperson.\n         * Når målingen er utført skal blodtrykket vises i\n           parameterfeltet.\n\n\n<H>- HLR feedback:</>\n    Sjekk at det er to funksjonelle CPR- sensorer til stede, intakte og\n     ikke utløpt utløpsdato.\n    For å teste HLR funksjonen og HLR sensor, velg manuell modus på\n     defibrillatoren.\n    Koble CPR sensoren til CPR mellomkabelen som fører til\n     pasientboksen.\n    Flytt CPR sensoren opp og ned samtidig som du trykker på den.\n         * Kompresjonsfrekvens (HLR frekvens) vises i et parameterfelt.\n         * HLR-kurven vises i et kurve-felt.\n         * Tale- og tekstmeldinger «Trykk hardere», «Gode kompresjoner»\n           og «Slipp helt opp» blir spilt.\n\n\n<H>-,,Minne-kort (CompactFlash-kort / CF-kort):</>\n    Kontroller at CF-kortet er plassert i pasientboksen. ( plassert v/\n     EKG kablene)\n    Kontroller gjenværende minne på CF-kortet.\n         * Trykk og hold nede Resyme-knappen.\n         * Oppdragsvisningen kommer opp, og tilgjengelig minne vises.\n         * I hvert fall 25 % minne tilgjengelig.\n','','','','',NULL,NULL,'1','H4','0017751553','00000000','','00000','','1.0','H',' ',' ','1.0','H','0.000','2018-10-23 07:00:00.0000000','PT07H00M00S','2018-10-23 08:00:00.0000000','PT08H00M00S','2018-10-23 07:00:00.0000000','PT07H00M00S','2018-10-23 08:00:00.0000000','PT08H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT00H00M00S',NULL,'PT24H00M00S','0.0','1','','','PLAN','0010010225','2018-10-05 00:00:00.0000000','2018-10-25 00:00:00.0000000','24551410','1005073193','','OR000024551410','1766-75');
